var book = {
	"name": "ယိဘၭ",
	"numChapters": 42,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ၦလဂၩအီၪလၧခးအၧဇၭနီၪ, အမံၩ့မွဲစယိဘၭလီၫ. ၦလဂၩနီၪ, မွဲၦၡၩလၧၫ့ဎွ့ၩဒဲတီၩဝ့ၫတၭ, မွဲၦလၧအ",
			"2": "<sup>2</sup> ၥၭမဲၪယွၩဒဲဂၭဎ့ၭခွံၬဆၧအၧၩ့လီၫ.- တၭဆၧအီၪဖျဲၪန့",
			"3": "<sup>3</sup> လၧအဂးအဖိၪခွၫနွ့ၫဂၩ, ဒဲအဖိၪမုၪၥၧၫ့ဂၩလီၫ.- အ ဝ့ၫဒၪအဆၧဖိၪဆၧလံၩမွဲၥိၪ ဒဲဘ့ၪၥံၪနွ့ၫထီၫ့, ဒဲကလ အူၭၥံၪၥၧၫ့ထီၫ့,ဒဲချီဖၫၥံၪအဆီၪ့ယဲယၩ, ဒဲကၥ့ၪယီၩ့မိ ၥံၪယဲယၩ, ဒဲဂံၪ့အခ့ၫအၡၩလဖၪအီၪဝ့ၫအၪအၪလ့ၬ တၭး ၦလဂၩနီၪဒိၪနဲၪ့ ကယဲၦမုထၪ့ဖိၪၥံၪ ထီးအလူၬ လီၫ.",
			"4": "<sup>4</sup> တၭအဖိၪခွၫလဖၪ လ့ၩမၩဆၧအၪ့ဆၧအီၩလၧအ ဂံၪ့ဒၪဝ့ၫဆုၬဆုၬ, လဂၩလၧအနံၩဒၪဝ့ၫ,လဂၩလၧအ နံၩဒၪဝ့ၫတၭး အဝ့ၫၥံၪကိၭအထၧၫ့ဖုဝဲမုၪၥၧၫ့ဂၩၥံၪ ဘဲၫၥိၭအမိအၪ့ဆၧအီၩဆၧ လၧအဝ့ၫၥံၪအၥိၭလီၫ.",
			"5": "<sup>5</sup> ထီးအဝ့ၫၥံၪအဆၧအၪ့ဆၧအီၩအမုနံၩလဖၪ လ့ၩဎဲၪ့ ဝ့ၫဝၬယူၭတၭး စယိဘၭအၪ့မၧၫ့ဆၧမၩဆံၫ့ဎံၪထၪ့ အဝ့ၫၥံၪလီၫ. မုဆဲၪ့ထၪ့လနံၩ အဝ့ၫဒၪဂဲထုၪ့ဂီၩဂီၩ တၭ,လုထၪ့ဆၧလုမ့ၪဘဲၫအဝ့ၫၥံၪထီးအလူၬအဆၧဝံ ဆၧနၬအီၪဝ့ၫအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ စယိဘၭ စံၭဝ့ၫ,ဘၪလဘၪယဖိၪခွၫၥံၪမၪဘၪဆၧတၭ, လၧအ ၥၭခံဖၧၩ့နီၪစဲၪ့ဒၪခွံၬယွၩလီၫ. စယိဘၭမၩဝ့ၫဘဲၫနီၪ ၥိၭလထံၪဎးဘီၩ့ဎးလီၫ.",
			"6": "<sup>6</sup> တၭမုလနံၩအီၪဝ့ၫ,လၧယွၩအဖိၪခွၫၥံၪဂဲၫဒုၭနဲၪအ ၥၭလၧယဟိဝၩအမ့ၬယၫတၭး စၫတၫ့ဂဲၫဆ့လၧအဝ့ၫ",
			"7": "<sup>7</sup> ၥံၪအကျၩလီၫ.- တၭယဟိဝၩစံၭစၫတၫ့နီၪ, နဝ့ၫဒၪန ဂဲၫအထံၭခီၫခီၫလဲၪ. တၭစၫတၫ့ချဲၩ့ဆၧၫ့ ယဟိဝၩ စံၭဝ့ၫဒၪး လၧယဂၭဝံၩ့ဝၩ့ လၧဂၪ့ခိၪချိၫ့ယီၩ, ဒဲလ့ၩ",
			"8": "<sup>8</sup> ဆၧထဲၩ့ဆၧလၧအလီၩ့လီၫ.- တၭယဟိဝၩစံၭစၫတၫ့း ယခ့ၫယၡၩစယိဘၭနီၪ, လၧၦၡၩလၩ့ဂၬအဝ့ၫနီၪလၧ ဂၪ့ခိၪချိၫ့ယီၩလအီၪဘၪနးဂၩ, ၦၡၩအလၧၫ့အဎွ့ၩအ တီၩအလီၩ့, ၦလဂၩလၧအၥၭမဲၪယွၩ, ဒဲဂၭဎ့ၭခွံၬဆၧ",
			"9": "<sup>9</sup> အၧၩ့နီၪ, မွဲနယိထံၫယိဆၭဘၪဆ့ဧၪ.- တၭစၫတၫ့ချဲၩ့ ဆၧၫ့ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲစယိဘၭၥၭမဲၪယွၩပျီၩပျီၩ",
			"10": "<sup>10</sup> ဆ့ဧၪ.- မွဲနမၩထနါဝၩ့ထၬအဝ့ၫ,ဒဲအဂံၪ့,ဒဲကယဲအ ဆၧအီၪလခီၫလါလါထီးအလူၬနီၪ, မွဲအ့ၬဧၪ. အစူၪ ၥံၪအဆၧမၩနီၪနဆိၪဂ့ၩယူၭ, ဒဲအဆၧဖိၪဆၧလံၩအၪ",
			"11": "<sup>11</sup> ထၪ့လၧထံၫၥံၪခးၥံၪအၪအၪလ့ၬဆ့လီၫ.- အ့ၪမွဲဘိၩ့ နဲၪ့ယီၩယၩ့ထၪ့နစူၪတၭ, ထိၭဘၪအဆၧထီးအလူၬ",
			"12": "<sup>12</sup> တၭ,မွဲအမိဆိၪအၧၩ့နၧၩလၧနမ့ၬယၫမၬကၨၬ- တၭ ယဟိဝၩစံၭစၫတၫ့, ယိခွါ,ကယဲဆၧထီးအလူၬအီၪ လၧနစူၪဖၧၩ့နီၪး န့ၫအနၫ့ဆါဒၪဝ့ၫ,ထီးယၩ့ထၪ့နစူၪ ထၫ့ဒၩဝ့ၫလဂ့ၩ. တၭစၫတၫ့စဲၪ့ထၪ့ခွံၬ လၧယဟိဝၩ အမ့ၬယၫလီၫ.",
			"13": "<sup>13</sup> တၭဘၪဝ့ၫမုလနံၩ,မွဲလၧဖိၪခွၫၥံၪ, ဒဲအဖိၪမုၪၥံၪ အၪ့ဆၧဒဲအီၩစဘံၭထံၫ လၧအဝဲခွၫအဝဲၡါအဂံၪ့ဖၧၩ့",
			"14": "<sup>14</sup> လီၫ.- တၭအၥီၫ့လဂၩဂဲၫလၧစယိဘၭအအီၪတၭ,စံၭ ဝ့ၫဒၪး ချီၥံၪထဲၫဆၧ, ဒဲကၥ့ၪယီၩ့မိၥံၪအၪ့အဆၪလၧအ",
			"15": "<sup>15</sup> ဝ့ၫၥံၪအနဲၩ့ထံၭတၭး- ၦစဘံအၫ့ဖိၪၥံၪထမျၬန့ဝ့ၫတၭ, ဆိၬခွံၬအဝ့ၫၥံၪးဒဲဆၧအခ့ၫအၡၩလဖၪ ကျီၪ့ၥံၫခွံၬဝ့ၫ လၧနၭအနါတၭ, ၦဖီၩ့ဖျ့ၭန့ၫယၧၩလဂၩဎးယီၩဘဲၫ ၥိၭယမိလီၩဘၪနၧၩလီၫ.",
			"16": "<sup>16</sup> အဝ့ၫဒၪချဲၩ့ဒံၭအဘိၩ့ဘၭနီၪ, ၦဂူၫဂၩလဂၩဂဲၫဝ့ၫ တၭ,စံၭဝ့ၫဒၪး ယွၩအမ့ၪလၩ့ထ့ၬ လၧမူၭခိၪလခီၫ တၭ,ဘၪၥိၪၥံၪဘ့ၪၥံၪအဒီၪ့လဖၪ ဒဲအခ့ၫအၡၩလဖၪ တၭ,အၪ့ခွံၬအဝ့ၫၥံၪတၭး ဖီၩ့ဖျ့ၭန့ၫယၧၩလဂၩဎး ဘဲၫၥိၭယမိလီၩဘၪနၧၩလီၫ.",
			"17": "<sup>17</sup> အဝ့ၫဒၪချဲၩ့ဒံၭအဘိၩ့ဘၭနီၪ, ၦဂူၫဂၩလဂၩဂဲၫဝ့ၫ တၭ,စံၭဝ့ၫဒၪး ၦခၫလဒံၫဖိၪၥံၪ အၪ့နၩ့ဖၭအၥၭၥၧၫ့ဒီၪ့ ဂဲၫထမျၬ ကလအူၭလဖၪတၭ, မၩန့ဝ့ၫဒၪနီၪး ဒဲအဝ့ၫ ၥံၪကျီၪ့ၥံၫခွံၬဆၧအခ့ၫအၡၩလဖၪ လၧနၭအနါတၭ, ၦဖီၩ့ဖျ့ၭန့ၫယၧၩလဂၩဎး ဘဲၫၥိၭယမိလီၩဘၪနၧၩ လီၫ.",
			"18": "<sup>18</sup> အဝ့ၫဒၪချဲၩ့ဒံၭအဘိၩ့ဘၭနီၪ, ၦဂူၫဂၩလဂၩဂဲၫဝ့ၫ တၭ,စံၭဝ့ၫဒၪး နဖိၪခွၫၥံၪဒဲနဖိၪမုၪၥံၪအၪ့ဆၧ, ဒဲအီၩ စဘံၭထံၫလၧအဝ့ၫၥံၪအဝဲခွၫအဝဲၡါလဂၩအဂံၪ့ဖၧၩ့",
			"19": "<sup>19</sup> လီၫ.- တၭယိခွါ,လံၩမုဂဲၫထၪ့ခၫ့ဂၬၡါမုနၧၫ့ဖၫတၭ, ဘၪဂံၪ့နီၪအနိၪ့လံနိၪ့ ထီးအခၨဒိၭဘၪ ဖိၪၥၪခွၫၥံၪ တၭ,အဝ့ၫၥံၪၥံၫဝ့ၫဘဲၫနီၪ, ၦဖီၩ့ဖျ့ၭဝ့ၫန့ၫယၧၩလဂၩ ဎးဘဲၫၥိၭယမိလီၩဘၪနၧၩလီၫ.",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့စယိဘၭဂဲထုၪ့တၭ, ၡၫ့ယၬအကီၩ့အ ၥိၭတၭ,လိၩ့ခွံၬအခိၪ, ဒဲထိၪလၩ့ထံၩဖါအၥၭလၧဂၪ့",
			"21": "<sup>21</sup> ခိၪတၭ,ဘိၪ့ထၪ့ဘၩထၪ့ဆၧလီၫ.- တၭစံၭဝ့ၫဒၪ, ယ ဂဲၫထၪ့လၧခီၫ့ယီၩ လၧယမိအဒၧၩ့လးနီၪ အီၪဘိၪ့ဝ့ၫ တၭ,လၧယအီၪဘိၪ့ယီၩယမိထဲၩ့ထဲၩ့ဘဲၫနီၪၥိၭလီၫ. ယဟိဝၩဖ့ၪလၫ့တၭ,ယဟိဝၩမၩန့ခွံၬယူၭတၭ, မွဲယ ဟိဝၩအမံၩ့နီၪ ဘၪဆၧဆိၪဂ့ၩဒၪဝ့ၫဆံၭၬ",
			"22": "<sup>22</sup> လၧဆၧထီးအလူၬအဖၧၩ့ယီၩ, စယိဘၭလမၩမၪ ဘၪဆၧတၭ,ချဲၩ့ထၪ့ဆၧပျီၩပျီၩ ထၫ့ဒၩယွၩနီၪဆ့အ့ၬ."
		},
		"2": {
			"1": "<sup>1</sup> တၭဘၪဒီၭမုလနံၩ, ထီးယွၩအဖိၪခွၫၥံၪဂဲၫဒုၭနဲၪ",
			"2": "<sup>2</sup> အၥၭလၧယဟိဝၩအမ့ၬယၫနီၪး- တၭစၫတၫ့ဂဲၫဆ့လၧ အဝ့ၫၥံၪအကျၩနီၪ, ဘဲၫၥိၭအမိဒုၭနဲၪအၥၭလၧယဟိ ဝၩအမ့ၬယၫလီၫ. ထီးနီၪလဖၧၫ့ ယဟိဝၩစံၭစၫတၫ့ နီၪ,နဂဲၫအထံၭခီၫခီၫလဲၪ. တၭစၫတၫ့ချဲၩ့ဆၧၫ့ယဟိ ဝၩစံၭဝ့ၫဒၪး လၧယဂၭဝံၩ့ဝၩ့လၧဂၪ့ခိၪချိၫ့ယီၩ ဒဲလ့ၩ",
			"3": "<sup>3</sup> ဆၧထဲၩ့ဆၧလၧအလီၩ့လီၫ.- ထီးနီၪလဖၧၫ့ယဟိဝၩ စံၭစၫတၫ့နီၪး ယခ့ၫယၡၩစယိဘၭလဂၩ, လၧၦၡၩ လၩ့ဂၬအဝ့ၫလၧဂၪ့ခိၪချိၫ့ယီၩ လအီၪဘၪနးဂၩ, ၦၡၩ အလၧၫ့အဎွ့ၩအတီၩအလီၩ့ ၦၥၭမဲၪယွၩဒဲဂၭဎ့ၭခွံၬ ဆၧအၧၩ့နီၪ, မွဲနယိထံၫယိဆၭယူၭဧၪ.နထိၪဂဲၩယၧၩ ထၫ့ဒၩအဝ့ၫဒၪ, ဘဲၫၥိၭယမိမၩဂၭဂီၩ့အဝ့ၫ ထီးအ လးလအီၪဘၪ,လါနၫ့တၭ, အဝ့ၫဒၪဖီၪ့ထၬဒံၭအဆၧ မွဲဆၧတီၩဒံၭလီၫ.",
			"4": "<sup>4</sup> စၫတၫ့ချဲၩ့ဆၧၫ့ယဟိဝၩတၭ, စံၭဝ့ၫဒၪးဆၧဖံၭလၧ ဆၧဖံၭအဂးတၭး ကယဲအဆၧအီၪလမံၩ့လါလါနီၪ, ၦၡၩမိဖ့ၪလၫ့ခွံၬထီးအလူၬလၧအၥၭမၧၫ့အဂးလီၫ.",
			"5": "<sup>5</sup> အ့ၪမွဲ,ဘိၩ့နဲၪ့ယီၩယၩ့ထၪ့နစူၪတၭ, ထိၭဘၪအဎွံၪ ဒဲအယၪတၭး မွဲအမိဆိၪအၧၩ့နၧၩလၧနမ့ၬယၫလီၫ.",
			"6": "<sup>6</sup> တၭယဟိဝၩ စံၭစၫတၫ့နီၪး ယိခွါ,မွဲအအီၪလၧနစူၪ ဖၧၩ့လါနၫ့တၭး အၥၭမၧၫ့နီၪမၩဖီၩ့ဖျ့ၭဆံၭ.",
			"7": "<sup>7</sup> စၫတၫ့စဲၪ့ထၪ့ခွံၬ လၧယဟိဝၩအမ့ၬယၫတၭ,ထး စယိဘၭလၧဝံၫ့အၧၩ့ၥံၪ လၧအခၪ့ယၫၥၭဖိးလၧအခိၪ",
			"8": "<sup>8</sup> ဒၩ့နီၪလီၫ.- တၭအဝ့ၫဒၪမၩန့ဖၧၩ့ကဲၩ့ ဘဲၫၥိၭအမိကွၭ လၩ့အလီၩ့, လၧအဆၧၫ့နၩ့လၧဖံၫ့ချၪဖၧၩ့အဘိၩ့ဘၭ",
			"9": "<sup>9</sup> နီၪလီၫ.- ထီးနီၪလဖၧၫ့ အမၫစံၭအဝ့ၫဒၪး မွဲနဖီၪ့ထၬ ဒံၭနဆၧမွဲဆၧတီၩဆ့ဧၪ. ဆိၪအၧၩ့ယွၩတၭ, ၥံၫနဝ့ၫ",
			"10": "<sup>10</sup> ဖီၩၬ- အ့ၪမွဲစယိဘၭစံၭအဝ့ၫ, နဝ့ၫဒၪနချဲၩ့ဆၧဘဲၫ ၦမုၪအဂီၩ့လဂၩချဲၩ့ဝ့ၫအၥိၭလီၫ. ဆၧအဂ့ၩနီၪပဒိၭ န့လၧယွၩအစူၪဖၧၩ့တၭ, ဆၧအအၧၩ့နီၪ မွဲပဒိၭန့ဆ့ အ့ၬဧၪ.လၧဆၧထီးအလူၬ အဖၧၩ့ယီၩ စယိဘၭမၪ ဘၪလၧအနိၭဖျံၩဆ့အ့ၬ.",
			"11": "<sup>11</sup> တၭစယိဘၭအထံၩအၥိၭ ၥၧၫ့ဂၩၥံၪနါဂၧၫ့လၧက ယဲဆၧအၧၩ့လၧအလၩ့ဘၪဝ့ၫထီးအလူၬ အဂဲးအကၠီၪ့ လီၫ. အဝ့ၫၥံၪဂဲၫထၪ့လဂၩ လၧအလးဒၪဝ့ၫ, လဂၩ လၧအလးဒၪဝ့ၫ, ၦတံမၫဖိၪစအံၫလဲဖၭ, ဒဲၦၡုအၫဖိၪ စဘံလဒၭ,ဒဲၦန့ၫအမၫဖိၪစဇိဖၫး အဂဲးဘဲၫယီၩအဝ့ၫ ၥံၪအုၩ့လၩ့လိၬအၥၭ လၧအမိလ့ၩၥုၪ့ခါၥၭလၩ့ လၧ",
			"12": "<sup>12</sup> အၥိၭ,ဒဲချဲၩ့မုၬအၥၭနီၪဆ့လီၫ.- အဝ့ၫၥံၪအီၪယဲၩ့စၪ့ ထၪ့အမ့ၬၥၪတၭ, ၥ့ၪယၫအဝ့ၫဒၪအ့ၬ. အဝ့ၫၥံၪဂၪ့ ၥီၫထၪ့တၭ, ၡၫ့လၩ့အကီၩ့အၥိၭဆုၬဆုၬတၭ, ဎွံၪထၪ့ ဂၪ့ခိၪအမုၬ လၧအခိၪဎွံၪအဖၫ့ခိၪ လၧမူၭခိၪလခီၫ",
			"13": "<sup>13</sup> လီၫ.- တၭအဝ့ၫၥံၪဆၧၫ့နၩ့လၧအၥိၭ လၧဂၪ့ခိၪအ လီၩ့နီၪ,နွ့ၫဒုၩဒဲနွ့ၫနံၩတၭး အဝ့ၫၥံၪဒၪဘၪလၧဆၧၡၪ့ ဆၧနၭဖၭဒိၪလၩ့ဘၪအဝ့ၫနီၪ, အခိးမွဲအဝ့ၫၥံၪချဲၩ့ဒုၪ့ ဝ့ၫနးဂၩအ့ၬ."
		},
		"3": {
			"1": "<sup>1</sup> လၧခဲၫ့ထဲၩ့, စယိဘၭအၩ့ထၪ့အနိၭဆိၪအၧၩ့အမု နံၩနီၪလီၫ.",
			"2": "<sup>2</sup> စယိဘၭချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪး- မု နံၩလၧယအီၪဖျဲၪနီၪ, ဒဲမုနၩဆ့, လၧဆၧစံၭဝ့ၫး ဖိၪၥၪ",
			"4": "<sup>4</sup> အခွၫဘၪဆၧဒၧၩ့ထၪ့န့ဝ့ၫနီၪ, မွဲအဂၭဂီၩ့ဖီၩၬ- မုနံၩ နီၪ,မွဲအခံၭလၩ့ဝ့ၫဆံၭးယွၩလၧထၭနီၪ, မွဲအထီးအၪ့ ဎၬလဂ့ၩ, ဒဲဆၧဖၩ့နီၪ,မွဲအထီးဖၩ့ထၪ့ဘၪဝ့ၫလဂ့ၩ.",
			"5": "<sup>5</sup> မွဲဆၧခံၭဒဲဆၧၥံၫအလၩၡုၪဘၪအဝ့ၫဆံၭ. မွဲဆၧအုၪ့ ၥံၪလၩ့ဘၪဝ့ၫတၭ, မုနံၩအဆၧခံၭနီၪ မွဲအဒုၭၥၭမဲၪ",
			"6": "<sup>6</sup> ဝ့ၫဆံၭ.- မုလနၩနီၪ,မွဲဆၧခံၭၥၧၫ့ဖီၪ့ထၬဝ့ၫဆံၭ. လၧ နံၪ့အမုနံၩၥံၪ လၩၥံၪအကျၩနီၪ, မွဲအထီးၥုၪ့ထိၬၥၭ ထိၬလဂ့ၩ,ဒဲထီးနုၬလၧလၩၥံၪအဆၧဝံထၪ့နၬထၪ့အ",
			"7": "<sup>7</sup> ကျၩနီၪလဂ့ၩ.- ယိခွါ, မုလနၩနီၪ,မွဲအအီၪယူဝ့ၫဆံၭ.",
			"8": "<sup>8</sup> ဒဲဆၧၥၭထိၬအၥီၫနီၪထီးနုၬလၧအဖၧၩ့လဂ့ၩ.- ၦလ ဖၪလၧအဆိၪအၧၩ့မုနံၩမုနၩၥံၪ, ၦလၧအထိၪဂဲထုၪ့ မၪနီၪၥ့ၪ,မွဲအဆိၪအၧၩ့အဝ့ၫၥံၪဆံၭ. ဆၧဖၩ့ထၪ့ၥူၫ",
			"9": "<sup>9</sup> လံၫၥူၫလံၫအၡၪၥံၪနီၪ, မွဲအခံၭလၩ့ဆံၭ.- ယိလါ,လါ နၫ့ဆၧဖၩ့အဖၧၩ့ၥၭနီၪ, မွဲအထီးဒၪဘၪဝ့ၫလဂ့ၩးမွဲအ",
			"10": "<sup>10</sup> ထီးဒၪဘၪမုဆဲၪ့ထၪ့နီၪလဂ့ၩ.- အဂဲးဘဲၫယီၩမွဲအလ ကၭဘံၭထၬဘၪဒၧၩ့လး လၧအအီၪဖျဲၪန့ယၧၩအတ ရၫ့တၭ, မွဲအမၩလၩ့ဘံၭခွံၬ ဆၧၡၪ့ဆၧနၭလၧယမ့ၬ",
			"11": "<sup>11</sup> ၥၪၥံၪဆ့အ့ၬ.- ယလၥံၫဘၪလၧဒၧၩ့လးဖၧၩ့နီၪမွဲအဂဲး ဘဲၫၥ့ၪလဲၪ. လၧယဂဲၫထၪ့ လၧဂူၭဖိၫ့ဖၧၩ့နီၪ, ယၥၭ",
			"12": "<sup>12</sup> လစဲၪ့ထၪ့ခွံၬဘၪနီၪ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- ခၪ့လုးခိၪၥံၪ နီၪအီၪတဲၩ့ဝဲၩအၥၭလၧယဂး, မွဲအဂဲးဘဲၫၥ့ၪလဲၪး ဒဲ",
			"13": "<sup>13</sup> နူၥံၪလၧအမိအၪ့နူနီၪအီၪဝ့ၫမွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- အ့ၪ လမွဲဘၪနီၪ, ဘိၩ့နဲၪ့ယီၩ ယမံၫနၩ့ယူၭတၭ, ယအီၪ ပွံၭယူၭယဝ့ၫဒၪတၭ, ယမံၫမၪယူၭနီၪး ထီးနီၪလဖၧၫ့",
			"14": "<sup>14</sup> ယမိအီၪပွံၭဘၪယူၭ.- လၧစဎွၩၥံၪဒဲဂၪ့ခိၪအၡၩဒုၭ ကိၪ့ဆၧလဖၪအၥိၭ, ၦလၧအၥုၪ့ထၪ့အလးအီၪယူဝ့ၫ",
			"15": "<sup>15</sup> လၧအနၫ့ဆါဒၪဝ့ၫအဂးနီၪလီၫ.- အ့ၪလမွဲဘၪဘဲၫနီၪ ယအီၪလၧၦဒိၪဖၭဒိၪၥံၪ, လၧအအီၪလၧထီၫ့, ၦလၧ",
			"16": "<sup>16</sup> အမၩဎွ့ၩဂံၪ့လဖၪလၧစ့ၩး- အ့ၪလမွဲဘၪဘဲၫနီၪမွဲဘဲၫ ၦအမုအလၩလဘၪဒံၭဘၪလါနၫ့နီၪ, အီၪဖျဲၪန့ဝ့ၫတၭ, ယမိအီၪဘၪအ့ၬး ဘဲၫဖိၪၥၪဆံၭလၧအလဒၪဘၪဆၧ",
			"17": "<sup>17</sup> ဖၩ့နးဆိၭအၥိၭနီၪလီၫ.- အလးထီးနီၪ, ၦအၧၩ့ဖိၪၥံၪ မၩခိမၩဝီၩလၧၩ့ဆၧအ့ၬး တၭထီးနီၪ, ၦလၧဆၧပွံၭ",
			"18": "<sup>18</sup> အၥၭလဖၪနီၪအီၪပွံၭဝ့ၫဒၪလီၫ.- ၦထီၫ့ဖိၪၥံၪကိၭဂၩ ဒ့ၭအီၪဒၪဆၧတၭး အကဆါ အၪ့မၧၫ့ဎီးဝ့ၫ အလူနီၪ,",
			"19": "<sup>19</sup> အဝ့ၫၥံၪနါဂၧၫ့လၧၩ့အ့ၬ.- အဒိၪအဆံၭအီၪထီးနီၪနံၫ ဂၩလူၬးဒဲအဎီးအၡၩနီၪ ဂၭဖျ့ၭယူၭလၧအကဆါအ စူၪဖၧၩ့နီၪလီၫ.",
			"20": "<sup>20</sup> မွဲအဖ့ၪလၫ့ဆၧဖၩ့လၧ ၦလၧအဘၪဆၧခိဆၧဝီၩနီၪ, အဂဲးဘဲၫၥ့ၪလဲၪး ဒဲၥၭမၧၫ့လၧၦလၧအၥုၪ့အုၭၥၭအုၭ နီၪ,",
			"21": "<sup>21</sup> မွဲအဂဲးဘဲၫၥ့ၪလဲၪး- အဝ့ၫၥံၪဆိၫ့ၥံၫလါနၫ့နီၪ, ဆၧ ၥံၫဂဲၫဘၪအ့ၬး တၭမွဲအအၪ့ဎၬဝ့ၫအၪနဲၪ့လၧဆၧလူ",
			"22": "<sup>22</sup> ဒိၪဎွ့ၩဒိၪလၧအအီၪၥူၪဝ့ၫအဂးနီၪး- ထီးအဝ့ၫၥံၪဒၪ ဘၪဆၧၥွၪခိၪနီၪ, မုၬလၩဝ့ၫ,ၥုၪ့ထိၬၥၭထိၬ, ၥုၪ့ဎွံၫၥၭ",
			"23": "<sup>23</sup> ယီၫဖၭဒိၪး- ဆၧဖ့ၪလၫ့ဆၧဖၩ့လၧၦၡၩလၧအဖၧၩ့ ၥၭအီၪၥူၪဝ့ၫနီၪ, ဒဲယွၩမၩထနါဝၬဖီၩ့ဝ့ၫနီၪ, မွဲအဂဲး",
			"24": "<sup>24</sup> ဘဲၫၥ့ၪလဲၪ.- တၭလၧယဆၧအၪ့ဆၧအီၩအၥိၭနီၪဆၧ ဂၪ့အုၩ့ဂၪ့ထိၬလဖၪဂဲၫဘၪယၧၩ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ ဒဲယဂၪ့ကိၭၡၭထၪ့နီၪလူၫလၩ့ခွံၬအၥၭ ဘဲၫထံၫအၥိၭ",
			"25": "<sup>25</sup> မွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- အဂဲးဘဲၫယီၩယၥၭမဲၪဆၧအၧၩ့ တၭ,မွဲအချႃၭန့ယူၭယၧၩတၭး ဒဲဆၧလၧယၥၭမဲၪဒိၪ",
			"26": "<sup>26</sup> ဒိၪလ့ၬနီၪလၩ့ဘၪဝ့ၫလၧယလီၩ့လီၫ.- တၭယအီၪဘၪ မုၬအ့ၬး ယအီၪဘၪဂုးခၧၫ့အ့ၬး ယအီၪပွံၭဘၪဆ့အ့ၬး တၭဆၧခိဆၧဝီၩဂဲၫဝ့ၫလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ ၦတံမၫဖိၪစအံၫလဲဖၭ ချဲၩ့ဆၧၫ့ဝ့ၫ",
			"2": "<sup>2</sup> တၭ,စံၭဝ့ၫဒၪး- ၦလဂၩအ့ၪချဲၩ့ဒုၪ့နၧၩ လထံၪတၭ, မွဲနၥၭမိခိထၪ့ဆ့ဧၪ, မွဲလါနၫ့ဘိၩ အ့ၪလချဲၩ့ဘၪနီၪ,",
			"3": "<sup>3</sup> မွဲပလၫထိးမိနၧၩ့လဂၩလဲၪၬ- ယိခွါ, နဝ့ၫဒၪနအၪ့ၥီၪ့",
			"4": "<sup>4</sup> ၦၡၩအၪဂၩ, ဒဲမၩဆီၪ့ထၪ့ၦစူၪဆါလဖၪလီၫ.- နဆၧ ချဲၩ့ၥံၪမၩဂုးထၪ့ၦလၧအၥၭဂံၩ့ဂၩ့လဖၪ, ဒဲခၪ့လုးခိၪ",
			"5": "<sup>5</sup> ၥံၪလၧအဂဲးဆါနီၪ, နမၩဆီၪ့ထၪ့နဝ့ၫလီၫ.- အ့ၪမွဲဘိၩ့ နဲၪ့ယီၩ, ဆၧလၩ့ဘၪနၧၩတၭ, နၥၭလၩ့ဘဲၩ, မွဲအထိၭ",
			"6": "<sup>6</sup> ဘၪနၧၩတၭ,နၥၭခိထၪ့ဝ့ၫဒၪလီၫ.- နဆၧၥၭမဲၪနီၪ,မွဲ နဆၧဒိၭနဲၩ့နၥၭအလးနီၪမွဲအ့ၬဧၪး နဆၧယိလါနီၪ,",
			"7": "<sup>7</sup> မွဲဝ့ၫနဖၧၩ့ၥၭလဖၪအဆၧတီၩဆၧလီၩ့လီၫ.- ဘိၩ့နဲၪ့ ယီၩနၪ့ထၪ့ထဲၩ့နဝ့ၫဘီၪး ၦလၧအဆၧမၪလအီၪဘၪ နီၪ,မွဲအဘၪဆၧဂၭဂီၩ့ၦလဂၩလဲၪး ဒဲၦအတီၩအလီၩ့",
			"8": "<sup>8</sup> ၥံၪဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫခီၫခီၫလဲၪ.- ဘဲၫယဒၪဘၪယူၭ အၥိၭနီၪး ၦလၧအထဲၫဆၧအၧၩ့နီၪ, ဒဲဎွံၪဆၧမၩဂၭ",
			"9": "<sup>9</sup> ဂီၩ့နီၪ,မွဲအကူၭဆၧလမံၩ့ဎးလီၫ.- လၧယွၩအၥၭနီၪ အဝ့ၫၥံၪဂၭဂီၩ့ဝ့ၫဒၪတၭး လၧအၥၭထၪ့ဆီၪ့အကၠီၩ့",
			"10": "<sup>10</sup> နီၪအဝ့ၫၥံၪဘၪဆၧအၪ့လူၬခွံၬဝ့ၫလီၫ.- ဆၬလၥၧၫ့ နီၪကိၭၡၭထၪ့အလူတၭ, ဆၬလၥၧၫ့ယုၩ့ဆၧနီၪ, ဒဲဆၬလၥၧၫ့ဖိၪၥံၪအၥွၪလဖၪ, ဘၪဆၧမၩခါဝ့ၫဒၪ လီၫ.",
			"11": "<sup>11</sup> ဆၬလၥၧၫ့အဂဲးဆီၪ့နီၪ လၧအဆၧအၪ့လအီၪ ဘၪအကၠီၩ့တၭ, ဂၭဂီၩ့ဝ့ၫဒၪ, ဒဲဆၬလၥၧၫ့မိအဖိၪၥံၪ ဘၪလၩ့ပၩဝ့ၫဒၪလီၫ.",
			"12": "<sup>12</sup> တၭဆၧဂဲၫဆိၬၥူၪဝ့ၫ ဆၧချဲၩ့လထံၪလၧယအီၪ,ဒဲ",
			"13": "<sup>13</sup> ယနါဒိၭန့အဆၧချဲၩ့ဘံၪၥွံၫနီၪလီၫ.- ထီးဆၧမံၫမၪ လၩ့ဘၪၦၡၩၥံၪ, လၧမုနၩအဆၧဒၪဆၧလၧယၫလခီၫ",
			"14": "<sup>14</sup> အဆၧဆီၫ့မီၪ့အဖၧၩ့နီၪး- ဆၧၥၭမဲၪလၩ့ဘၪယၧၩ, ဒဲယဝၭထိၬတၭ, ဆၧနီၪမၩဝၭထိၬယဎွံၪၥံၪ ထီးအ",
			"15": "<sup>15</sup> လူၬလီၫ.- ထီးနီၪလဖၧၫ့ၥၭလဂၩလ့ၩဖီၩ့ခွံၬ လၧယမ့ၬ",
			"16": "<sup>16</sup> ယၫတၭ,ယယၪအဆီၪ့ၥံၪဂဲထုၪ့ထၪ့ဝ့ၫဒၪလီၫ.- အဝ့ၫ ဆၧၫ့ထုၪ့အီၪပထုၬလါနၫ့, ယဒၪဘၪ အခံးအဂၩ့ၥ့ၪ အ့ၬးတၭဆၧအဂၩ့လမံၩ့ အီၪလၧယမ့ၬယၫနီၪ ဆၧ",
			"17": "<sup>17</sup> အီၪလၩ့မါပံၭတၭး ယနါဂၧၫ့ဆၧအလူစံၭဝ့ၫဒၪး- မွဲၦ ၡၩတီၩနဲၪ့လီၩ့နဲၪ့ယွၩနီၪဆ့ဧၪ.- မွဲၦၡၩဆံၫ့ဎံၪဂ့ၩနဲၪ့ ၦလၧအတဲၩ့လၩ့ဝ့ၫနီၪဆ့ဧၪ.-",
			"18": "<sup>18</sup> ယိခွါ,အဝ့ၫဒၪဒိၭနဲၩ့ အၥၭလၧအခ့ၫအၡၩအဖၧၩ့အ့ၬ. ဒဲအၥီၫ့ၥံၪမွဲအအီၪ",
			"19": "<sup>19</sup> က့ၪဝ့ၫလၧၦကိၪ့ဆၧလၥ့ၪဘၪနီၪလီၫ.- အ့ၪမွဲပအီၪ လၧဂံၪ့ကဖံၬနီၪ, လၧအခၪ့ထံၭ အီၪလၧဂၪ့ခိၪမုၬအ ဖၧၩ့,ၦလၧအဘၪဆၧမၩလၩ့ဘျ့ၭဝ့ၫ ဘဲၫၥံၭမုအၥိၭ",
			"20": "<sup>20</sup> နီၪအၪနဲၪ့အနီၪဒံၭလီၫ.- လၧမုဂီၩထီးမုဂၪလၩ့, အဝ့ၫ ၥံၪဘၪဆၧမၩဂၭဂီၩ့ဝ့ၫတၭ, ၦၡၩလယိလခွါဘၪနီၪ,",
			"21": "<sup>21</sup> အဝ့ၫၥံၪဂၭဂီၩ့အဆိၩဆိၩအကၠၪကၠၪလီၫ.- အဝ့ၫၥံၪ အဆၧဂ့ၩဆၧဘွၩမွဲဆၧမၩန့ခွံၬဝ့ၫလၧအၥိၭနီၪ, မွဲအ့ၬ ဧၪး ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪလအီၪဘၪတၭ, အဝ့ၫၥံၪၥံၫဝ့ၫ ဒၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ကိၭၡၭထၪ့ဘိၩ့နဲၪ့ယီၩဘီၪး ၦလၧအမိကိၭဆၧၫ့ နီၪ,မွဲအအီၪလဂၩဂၩဆ့ဧၪ. တၭနမိကၠၪနၥၭလၧၦဆံၫ့",
			"2": "<sup>2</sup> ဎံၪၥံၪလဂၩဂၩလဲၪ.- အဂဲးဘဲၫယီၩဆၧၥၭထၪ့ကျီၪ့ ခွံၬၦဂီၩ့ဖိၪနီၪ, ဒဲဆၧၥၭခ့ၬမၩၥံၫ ၦကိၪ့လၥ့ၪဘၪနီၪ",
			"3": "<sup>3</sup> လီၫ.- တၭယနၫ့ဆါဒၪယဝ့ၫဒၪဘၪၦအၧၩ့ဖိၪၥံၪဆဲၩ လၩ့အဝံလါနၫ့နီၪ, မီခိၬယဆိၪအၧၩ့အလးလၧအအီၪ",
			"4": "<sup>4</sup> ဝ့ၫလီၫ.- အဖိၪအလံၩၥံၪအီၪယဲၩ့လၧဆၧထိးထဲၩ့တၩ့ ထဲၩ့ဝ့ၫး လၧတရၫ့ဖၧၩ့နီၪဘၪဆၧအၪ့မၧၫ့ဆီၪ့ဝ့ၫတၭ,",
			"5": "<sup>5</sup> ၦမၩဖီၩ့ဖျ့ၭဝ့ၫအီၪနးဂၩအ့ၬ.- အဝ့ၫၥံၪကူၭဘုၪဂီၩ့နီၪ, ၦၥၭဝံအၥၭ အၪ့ဝ့ၫဒၪတၭး မၩန့ခွံၬဝ့ၫ လၧဆၧဆူၪ ကျၩဒၪလ့ၬနီၪ, ဒဲဖျံၩခွၩ့အီၪဒိၭအၥၭလၧအဝ့ၫၥံၪအ",
			"6": "<sup>6</sup> စူၪလးခၪ့ခိၪအဂးလီၫ.- အဂဲးဘဲၫယီၩဆၧအၧၩ့နီၪဂဲၫ ထၪ့လၧဂၪ့ခိၪမုၬအကျၩဆ့အ့ၬ, ဒဲဆၧခိဆၧဝီၩနီၪမဲၪ",
			"7": "<sup>7</sup> ထၪ့လၧဂၪ့ခိၪအဖၧၩ့နီၪဆ့အ့ၬ.- အဂဲးဘဲၫယီၩၦၡၩ အီၪဖျဲၪဝ့ၫလၧဆၧခိဆၧဝီၩအဂး, ဘဲၫမ့ၪဖဲးၥံၪဒံၩထၪ့ ဝ့ၫအၥိၭနီၪလီၫ.",
			"8": "<sup>8</sup> အ့ၪမွဲယဝ့ၫဒၪ,ယမိအၪ့ဎၬယွၩး ဒဲယမိအီၪက့ၪယ",
			"9": "<sup>9</sup> မူၭလၧယွၩအစူၪဖၧၩ့လီၫ.- အဝ့ၫဒၪမၩဆၧအဒိၪအ ယိၬ, ဒဲဆၧလၧၦအၪ့ဎၬဒၪလၥ့ၪဘၪး ဆၧလၩ့လၭလ",
			"10": "<sup>10</sup> ဖၪဆၧဝံထၪ့နၬထၪ့ၥ့ၪအ့ၬ.- အဝ့ၫဒၪဒုၭဆၧၩ့လၩ့ဆၧ လၧဂၪ့ခိၪချိၫ့ယီၩ, ဒဲအၪ့မၧၫ့လၩ့ထံၫ လၧဆံၬၥံၪနၩ",
			"11": "<sup>11</sup> ၥံၪအဖၧၩ့နီၪလီၫ.- ၦၥၭဆၧၩ့လဖၪမွဲအဒုၭဆၧၫ့နၩ့ဝ့ၫ လၧလးထၪ့ထီၫ, ဒဲၦၥုၪ့အုၭၥၭအုၭၥံၪ, ဒုၭအီၪထၪ့",
			"12": "<sup>12</sup> လၧဆၧကဲၪထၪ့ကဲၪထီၫအဖၧၩ့လီၫ.- ၦအၪ့လီၫဆၧ အဆၧကိၪ့ၥံၪနီၪ, မွဲအမၩဂၭဂီၩ့ဝ့ၫ ထီးအဝ့ၫၥံၪအစူၪ",
			"13": "<sup>13</sup> မၩကဲၪထၪ့ဆၧလၧအကိၪ့ဝ့ၫနီၪၥ့ၪအ့ၬ.- မွဲအဖီၪ့ထၬ ၦကိၪ့ဆၧၥ့ၪလၧအဝ့ၫၥံၪ အဆၧအၪ့လီၫဝ့ၫအဖၧၩ့, ဒဲ မၩဂၭဂီၩ့ ၦကိၪ့အၪ့လီၫဆၧ အဆၧဒုၭကိၪ့နီၪလီၫ.",
			"14": "<sup>14</sup> လၧမုဆၫလခီၫနီၪ, အဝ့ၫၥံၪဘၪခီၩ့ လၧဆၧခံၭတၭ, လၧမုထုၪ့နီၪ အဝ့ၫၥံၪဂၭဖၬလုးဆၧဘဲၫလၧမုနၩလခီၫ",
			"15": "<sup>15</sup> အၥိၭနီၪလီၫ.- တၭမွဲအမၩဖီၩ့မၩဖျ့ၭၦၡၪ့ဖိၪယၬဖိၪ ၥံၪလၧနၭၥံၪဖၩ့ၥံၪ, ဒဲလၧအဝ့ၫၥံၪအနိၭ, ဒဲလၧၦဆီၪ့",
			"16": "<sup>16</sup> ၥံၪအစူၪဖၧၩ့လီၫ.- အခိးမွဲဆၧယိလါအီၪလၧၦဂဲးဆါ ဘၭဆါအဂး, ဒဲဆၧအၧၩ့နီၪကၭဘံၭထၬအနိၭဒၪဝ့ၫ လီၫ.",
			"17": "<sup>17</sup> ယိခွါ,ၦလၧယွၩအၪ့ၥီၪ့ဝ့ၫနီၪ ဘၪဆိၪဂ့ၩဝ့ၫ, အခိး မွဲၦၥ့ၪဆၧလူၬအဆၧစ့ၩရၫ့နီၪ, ထီးမၩကြၩ့ထမးလ",
			"18": "<sup>18</sup> ဂ့ၩ.- အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမၩကဲၪထၪ့ဆၧဖၧၩ့လး တၭ,ဘီၪ့ထၪ့ထဲၩ့ဝ့ၫ, ကျီၪ့ဆၧတၭ, အစူၪဒၪဝ့ၫဘၠၩ့",
			"19": "<sup>19</sup> ထဲၩ့ဝ့ၫဒၪလီၫ.- လၧဆၧခိဆၧဝီၩဎူၫမံၩ့အဖၧၩ့နီၪ,အ ဝ့ၫဒၪမိမၩဖီၩ့မၩဖျ့ၭနၧၩး မွဲကဒၪယူၭ. လၧနွ့ၫမံၩ့အ",
			"20": "<sup>20</sup> ဖၧၩ့နီၪ,ဆၧအၧၩ့မိလၩ့ဘၪနၧၩနးမံၩ့အ့ၬ.- လၧဆၧ ၥၭဝံလၩ့ဒိၩအဖၧၩ့နီၪ, မိမၩဖီၩ့ဖျ့ၭနၧၩ လၧဆၧၥံၫ ဒဲလၧဆၧဒုၭၥုၭအဖၧၩ့နီၪ, လၧနၭၥံၪဖၩ့ၥံၪ အစီၩ့အ",
			"21": "<sup>21</sup> မၩ့နီၪလီၫ.- လၧၦဖျ့ၩဖျ့ၪဆၧနီၪ, ဆၧမိအီၪက့ၪၥူၪခွံၬ နၧၩ,ဒဲဆၧမၩဂၭဂီၩ့လမံၩ့ အ့ၪဂဲၫတၭ, နမိၥၭမဲၪဆ့",
			"22": "<sup>22</sup> အ့ၬ.- နမိနံဘၪဆၧမၩဂၭဂီၩ့ဆၧ ဒဲဆၧၥၭဝံလၩ့ဒိၩ တၭးဂၪ့ခိၪအဆၧဖိၪဆၧဎါၥံၪနီၪ, နၥၭမဲၪအလးအီၪ",
			"23": "<sup>23</sup> ဆ့အ့ၬ.- အဂဲးဘဲၫယီၩလိးၥံၪလဲၫ့ၥံၪမိအုၩ့လၩ့ဆၧလၧ နၧၩ,ဒဲမံၩ့လၬကျၩအဆၧဖိၪဆၧဎါၥံၪ မိအီၪအိၭလိၬ",
			"24": "<sup>24</sup> အၥၭလၧနၧၩဆ့လီၫ.- အခိးမွဲနမိၥ့ၪယၫ,လၧနတဲၩနီၪ အီၪလၧဆၧဘၪလိၬအိၭလိၬ နမိထဲၩ့အီၪၡီၩ့နလးတၭ,",
			"25": "<sup>25</sup> နမိဂၭဖျိၭဖၧၩ့ၥၭအ့ၬ.- တၭနမိၥ့ၪယၫလၧနချံၫနၥၪအီၪ အၪအၪလ့ၬ, ဒဲနဖိၪနလံၩ ဘဲၫဂၪ့ခိၪအနၪ့ၥံၪမံၩ့ၥံၪအ",
			"26": "<sup>26</sup> ၥိၭနီၪလီၫ.- နမိထီၩ့လၩ့ၥွၪခိၪဖၧၩ့ လၧခိၪဘွၩ, ဘဲၫ ဘုၪလၧၫ့လၧဆၧမၩန့ထဲၩ့ဝ့ၫလၧအဆၧၫ့အထီဘၪအ",
			"27": "<sup>27</sup> ၥိၭနီၪလီၫ.- ယိခွါ, ပအၪ့ဎၬဒၪဘၪတၭ, ဆၧမၩအၥၭ ဘဲၫနီၪ,ခိၭနၪတၭ, ၥ့ၪယၫနဝ့ၫ, လၧနဂးဒၪနဝ့ၫဘီၪ."
		},
		"6": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စယိဘၭ ချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭး",
			"2": "<sup>2</sup> မွဲယဆၧခိဆၧဝီၩယီၩ ဘၪဆၧခံၫ့န့လါဝ့ၫလၩ့ထံး လၩ့ဆ့ၭး ဒဲယဆၧၡၪ့ဆၧနၭ ထီးအလူၬ ဘၪဆၧအီၪ",
			"3": "<sup>3</sup> က့ၪကီၪ့လါဝ့ၫလၧခံၫ့ဖၧၩ့ဆံၭ.- အဂဲးဘဲၫယီၩ ဘိၩ့နဲၪ့ ယီၩ, မွဲအမိဎၧၫ့နဲၪ့ မၫဆမံၭအမ့ၭၥံၪတၭး လၧဆၧ ယီၩလမံၩ့အကၠီၩ့ယချဲၩ့မၪဘၪယူၭဆၧယူၭ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩၦၥ့ၪဆၧလူၬ အဖျါၥံၪအီၪလၧယဖၧၩ့ တၭ,အဆၧစုၪနီၪအိၩထၪ့ခွံၬယၥၭး ယွၩအဆၧမၩ",
			"5": "<sup>5</sup> ၥၭမဲၪလဖၪနီၪတဲၩ့ဝဲၩအၥၭထၫ့ဒၩယၧၩလီၫ.- လၧနၪ့ ၥံၫ့ဆ့ၬအကျၩကၥ့ၪယီၩ့မိဂၪ့ကိၭထၪ့ဆ့ဧၪး လၧအ",
			"6": "<sup>6</sup> ဆၧအီၪအၪနီၪ ချီဖၫမိဂၪ့ဆ့ဧၪး- ဆၧလၧအဘျိၪနီၪ ထံၫလၪအ့ၪလအီၪဘၪတၭ, ၦအၪ့ဘၪမိၥ့ၪဆ့ဧၪး မွဲ ဆၧအအွံၪအီၪဝ့ၫ လၧဆၧအဒံၪဘျံၭအဖၧၩ့နီၪဆ့ဧၪ.",
			"7": "<sup>7</sup> ဆၧလၧယလမိထိၭဘၪယၥၭနီၪ ကဲၪထၪ့ဆၧအၪ့လၧ ယၥၭလိၪလီၫ.",
			"8": "<sup>8</sup> ယဆိၫ့န့ဘၪဆၧလၧယအၪ့ကံၩ့နီၪ, မွဲယွၩဖ့ၪလၫ့",
			"9": "<sup>9</sup> ဆၧလၧယယိလါအဖၧၩ့ၥၭနီၪဆံၭ.- မွဲအဘၪလါယွၩ အၥၭလၧအမိမၩဂၭဂီၩ့ယၧၩဆံၭ. မွဲအဖျါခွံၬအစူၪ,",
			"10": "<sup>10</sup> ဒဲဒၪ့ထ့ၬခွံၬယၧၩဆံၭ.- အဂဲးဘဲၫယီၩဆၧနီၪမိကဲၪဆၧ မုၬယၥၭတၭ, ယမိၥုၪ့ထိၬၥၭထိၬ လၧဆၧၡၪ့ဆၧနၭ လၧအလယၫ့ၥၭဘၪဆၧအဖၧၩ့နီၪ, ဒဲလၧဆၧဆံၫ့ဎံၪ",
			"11": "<sup>11</sup> လဂၩအဆၧချဲၩ့လဖၪယအီၪက့ၪၥူၪခွံၬဆ့အ့ၬ.- လၧ ယမိယိလါဆၧနီၪ, မွဲယဂဲးယဘၭအီၪလၧဆၧနီၪလ မံၩ့လဲၪ. ဒဲလၧယမိအွံၪၥၭဆၧၩ့ဒံၭ အကၠီၩ့တၭ, ယ",
			"12": "<sup>12</sup> ထုၬနီၪမိမၩအၥၭဘဲၫၥ့ၪလဲၪ.- ယဂဲးယဘၭမွဲလိးၥံၪ အဂဲးအဘၭဧၪး တၭယဖံၭယယၪနီၪ မွဲထီးၥံၪၡၬၥံၪ",
			"13": "<sup>13</sup> ဆ့ဧၪ.- ဆၧမၩဆၧၩ့လၧယဖၧၩ့နီၪ မွဲအစဲၪ့ထၪ့ခွံၬအ့ၬ ဧၪး ဒဲဆၧထိးထဲၩ့တၩ့ထဲၩ့နီၪမွဲဆၧနၫ့ထၪ့ခွံၬလၧယ",
			"14": "<sup>14</sup> ဖၧၩ့ဆ့ဧၪ.- ၦလၧအဘၪနၭဘၪၡၪ့နီၪ အထံၩအၥိၭ ကြၨၭယၫ့ၥုၪ့ယၫ့ၥၭဝ့ၫ, အ့ၪမွဲအစဲၪ့ဒၪခွံၬ ၦၥ့ၪဆၧ",
			"15": "<sup>15</sup> လူၬအဆၧၥၭမဲၪလီၫ.- ယထၧၫ့ဖုဝဲၥံၪအၪ့လီၫဆၧဘဲၫ ထံၫဖိၪချိၬအၥိၭနီၪ, ဘဲၫထံၫဖိၪချိၬအကၠီၪ့အၥိၭလၧအ",
			"16": "<sup>16</sup> လ့ၩဖီၩ့ခွံၬဝ့ၫဒၪး- လၧအဒုၪထၪ့ဝ့ၫ လၧထံၫလိးအ ကၠီၩ့,လၧမူၭခိၪဖီၫ အီၪၥူၪအၥၭ လၧအဖၧၩ့အကၠီၩ့",
			"17": "<sup>17</sup> လီၫ.- အဆၧၫ့အထီလၧအခိထၪ့နီၪ, အဝ့ၫၥံၪလၩ့မါပံၭ တၭ,ထီးဆၧခိအ့ၪဘၪအဝ့ၫၥံၪတၭ, အၪ့ခွံၬဝ့ၫလၧအ",
			"18": "<sup>18</sup> လးနီၪလီၫ.- ၦဖနံၬဖိၪအဒီၪ့ၥံၪလ့ၩ ဆၧဖိၬအဝ့ၫၥံၪအ ဖၧၩ့ၥၭတၭ,ကၠၪခွံၬအၥၭး လ့ၩလၧဆၧအီၪယူအလး",
			"19": "<sup>19</sup> ၥံၪတၭ,ဂၭဂီၩ့ဝ့ၫဒၪလီၫ.- တံမၫအဖနံၬဖိၪအဒီၪ့ၥံၪ လ့ၩဆၧယိဝ့ၫတၭ, ၡံဘၫအဒီၪ့လဖၪယိလါအဝ့ၫၥံၪ",
			"20": "<sup>20</sup> တၭး- မွဲအမ့ၬမဲဝ့ၫလၧအယိလါဆၧနီၪအကၠီၩ့တၭ,",
			"21": "<sup>21</sup> အဝ့ၫၥံၪဂဲၫထီၩ့ထီးနီၪတၭ, အမ့ၬမဲဝ့ၫဒၪလီၫ.- အဂဲး ဘဲၫယီၩဘိၩ့နဲၪ့ယီၩ,နၥံၪကဲၪဆၧနးမံၩ့အ့ၬး နၥံၪဒၪ",
			"22": "<sup>22</sup> ဘၪယဆၧနၭဆၧၡၪ့တၭ,နၥံၪၥၭမဲၪဆၧလီၫ.- ဂဲၫဆိၬ ဆၧလၧယအီၪမွဲဂ့ၩ, ဆၧဘၪဆဲၫ့လၧနၥံၪအဆၧထူၭ",
			"23": "<sup>23</sup> ဆၧလၧၫ့နီၪ ဖ့ၪလၫ့လၧယဂးမွဲဂ့ၩ,- မၩဖီၩ့မၩဖျ့ၭ ယၧၩလၧယဒုၪယဒၩအစူၪဖၧၩ့, ဒဲဒုၭဂၭဖျ့ၭယၧၩ လၧၦဆီၪ့အစူၪဖၧၩ့ဆံၭနီၪ, မွဲယစံၭယူၭဆ့ဧၪ.",
			"24": "<sup>24</sup> နၥံၪဝ့ၫဒၪယီၩၥီၪ့လိၪယၧၩဘီၪး ယမိလၩ့မါပံၭတၭး ဒုၭၥ့ၪယၫယၧၩ လၧယမၩမၪဘၪဆၧအဂဲးအကၠီၪ့နီၪ",
			"25": "<sup>25</sup> ဘီၪ.- ဆၧချဲၩ့အတီၩလဖၪနီၪ မွဲအဆီၪ့ဆံၭဒိၪလဲၪၬ အ့ၪမွဲနၥံၪအဆၧချဲၩ့ကြၩ့ထမးၥံၪ, မွဲအဒုၭနဲၪဆၧနီၪ",
			"26": "<sup>26</sup> လမံၩ့လဲၪ.- မွဲနၥံၪဆီၫ့မီၪ့လၧနၥံၪမိအၪ့ၥီၪ့ဆၧချဲၩ့လ ဖၪဆ့ဧၪ, ဒဲၦလၧအလယိလါဘၪဆၧနီၪအဆၧချဲၩ့လ",
			"27": "<sup>27</sup> ဖၪ,လၧအမွဲဘဲၫလံၩအၥိၭဧၪ.- မွဲမၬနၥံၪမိမၩအၧၩ့ ၦဖိၪဎွ့ၪနီၪ, ဒဲခုၪ့ဆၧဖၧၩ့လၧနၥံၪ အထံၩအၥိၭအဂး",
			"28": "<sup>28</sup> လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ မွဲအဘၪလါနၥံၪအၥၭ, ယိ ယၧၩဘီၪး အဂဲးဘဲၫယီၩ လၧနၥံၪအမ့ၬယၫယမိချဲၩ့",
			"29": "<sup>29</sup> ကဘျံၭကဘျၪအ့ၬ.- ယစံၭ,ထဲၩ့ထဲၩ့လါဘီၪး မွဲအ ထီးကဲၪထၪ့ဆၧအၧၩ့လဂ့ၩး မွဲကဒၪယူၭ,ထဲၩ့ထဲၩ့ဘီၪး",
			"30": "<sup>30</sup> ယမူၭနီၪမွဲအတီၩအလီၩ့လီၫ.- ဆၧအၧၩ့နီၪမွဲအအီၪ လၧယဖျ့ၩအလီၩ့ဆ့ဧၪး ယထဲးယိခွါဆၧတၭ, မွဲယ ၥ့ၪယၫဆၧလဂ့ၩဘၪနီၪၥ့ၪအ့ၬဧၪ."
		},
		"7": {
			"1": "<sup>1</sup> လၧဂၪ့ခိၪချိၫ့ယီၩ ဆၧဒုၭၥုၭလၧၦၡၩအဂးနီၪအီၪ အ့ၬဧၪ,ဒဲအနံၩအၥၫ့လဖၪ မွဲဘဲၫၦဒိၭအၪ့လံၩ့လၩ့အ",
			"2": "<sup>2</sup> ၥၭအနံၩအၥၫ့နီၪ,မွဲအ့ၬဧၪ.- ဘဲၫဆၧအခ့ၫအၡၩဆိၫ့ န့ဘၪဆၧလၩၡုၪအၥိၭ, ဒဲဘဲၫၦဒိၭအၪ့လံၩ့လၩ့အ",
			"3": "<sup>3</sup> ၥၭနီၪဆိၫ့န့ဘၪအလံၩ့အလဲၫအၥိၭး- ဘဲၫနီၪၥိၭယန့ ဘၪလၩၥံၪဘၪဆဲၫ့လၧဆၧၡၪ့ဆၧနၭနီၪ, ဒဲမုနၩလဖၪ",
			"4": "<sup>4</sup> လၧဆၧပွံၭယၥၭနီၪအီၪဝ့ၫလၧယဂးဆ့လီၫ.- လၧယ မံၫနၩ့အခၫနီၪ, ယစံၭး မွဲမုနၩမိဖီၩ့တၭ, ယမိဂဲထုၪ့ ထဲၩ့ဆံၭယံၬလဲၪၬ ယလၩ့ပွံၭ လၧယကၠၪယၥၭလါ",
			"5": "<sup>5</sup> ခီၫလါခီၫထီးဆၧဖၩ့ထၪ့လီၫ.- ယဖံၭယယၪကီၩ့ၥိၭ ထၪ့ဝ့ၫဆၧအုၪဒဲဂၪ့ခိၪအခိလီၪ့လဖၪတၭး ယဖံၭအ",
			"6": "<sup>6</sup> ဖၧၩ့လးလၩ့ဘံၭနီၪထ့ဖၭထၪ့ဒီၭလီၫ.- ယမုနံၩလဖၪ ချဲၫ့နဲၪ့ၦထၭထၪအလူၪထွံၫ, ဒဲလၧဆၧယိလါလအီၪ",
			"7": "<sup>7</sup> ဘၪနီၪလူၬခွံၬဝ့ၫဒၪလီၫ.- ယၥၭမၧၫ့မွဲလံၩတၭ, နၪ့ထၪ့ ထဲၩ့ဘီၪး ယမ့ၬၥၪမိဒၪဘၪဆၧအဂ့ၩနးကၠၪဒီၭအ့ၬ.",
			"8": "<sup>8</sup> ၦလံဂၩလၧအဒၪဘၪယၧၩအမ့ၬၥၪနီၪ, မိဒၪဘၪလၧၩ့ ယၧၩအ့ၬး နၥံၪအမ့ၬၥၪၥံၪမိအၪ့ဎၬလါနၫ့ယၧၩတၭ,",
			"9": "<sup>9</sup> ယမိအီၪအ့ၬ.- ဘဲၫဆၧအုၪ့လူၬဝ့ၫနီၪ, ဒဲဒံၩခွံၬဝ့ၫအ ၥိၭးဘဲၫနီၪၥိၭၦလၧအလ့ၩလၩ့လၧဖျႃဖၧၩ့နီၪ, မိဂဲၫ",
			"10": "<sup>10</sup> ထဲၩ့ထၪ့လၧၩ့အ့ၬ.- မိထဲၩ့ထဲၩ့ဒီၭလၧအဂံၪ့အ့ၬ, ဒဲအ လးနီၪၥ့ၪယၫလၧၩ့အဝ့ၫအ့ၬ.",
			"11": "<sup>11</sup> မၩအၥၭဘဲၫနီၪတၭယမိပဒၩ့ယနိၭအ့ၬး လၧယၥုၪ့ အုၭၥၭအုၭတၭ, ယမိချဲၩ့ဆၧလီၫ. လၧယဆၧဘၪမီၪ့ ဘၪမၭအကၠီၩ့, ယၥၭအံၩ့နဲၫ့တၭ, ယချဲၩ့ဆၧလီၫ.",
			"12": "<sup>12</sup> လၧနဘၪအီၪက့ၪၦခိၭယၧၩလဒီၪ့နီၪအကၠီၩ့တၭ, ယ",
			"13": "<sup>13</sup> မွဲမၫဆမံၭဧၪ,ယမွဲဆၧယိၬအဆၧမိဎါနီၪဆ့ဧၪ.- ထီး ယအ့ၪစံၭ, ယလးမံၫဒၩမိမၩမုၬယၥၭ, ယလးမံၫမိမၩ",
			"14": "<sup>14</sup> ဎွံၫထၪ့ယဆၧဂၪ့အုၩ့ဂၪ့ထိၬလဖၪနီၪး- ထီးနီၪလဖၧၫ့ နမၩၥၭမဲၪယၧၩလၧဆၧမံၫမးလဖၪ, ဒဲမၩၡုၭယၧၩ",
			"15": "<sup>15</sup> လၧဆၧဒၪဆၧလၧယၫလခီၫလဖၪနီၪလီၫ.- တၭယရွံ န့ဆၧလၩ့အုၭၥံၫ, ဆၧၥံၫဒိၪ အၪနဲၪ့ ယၥၭမၧၫ့ဒံၭ",
			"16": "<sup>16</sup> လီၫ.- ယဎွ့လၩ့တၭး ယမိမၧၫ့အဆိၩအကၠၪအ့ၬး မၩ ဘူၭယၧၩလဂ့ၩ, အဂဲးဘဲၫယီၩယမုနံၩလဖၪမွဲဆၧအ",
			"17": "<sup>17</sup> အွံၩလီၫ.- ၦၡၩလၧနမိမၩဒိၪထၪ့အဝ့ၫ, ဒဲအီၪက့ၪန",
			"18": "<sup>18</sup> ဆၧဆီၫ့မီၪ့လၧအဂးနီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ.- ဒဲလၧန မိအီၪၡီၩ့အဝ့ၫကိၭဂီၩဒ့ၭ, ဒဲမၩခွါဝ့ၫနီၪလထံၪဎးဘီၩ့",
			"19": "<sup>19</sup> ဎးတၭ,မွဲဆၧနီၪလမံၩ့လဲၪ.- နလကၠၪခွံၬဘၪလၧ ယၧၩ,ဒဲဖျါယၧၩ ထီးယယုလၩ့ထဲၩ့ဘၪ ယထိၪဖျံၭ",
			"20": "<sup>20</sup> ထံၫနီၪ,မွဲအဆံၭယံၬလဲၪ.- ၦလၧအခိၭၦၡၩလဂၩဧ့, ယမၪဘၪယူၭတၭ, မွဲယဘၪမၩနၧၩလၧဆၧနီၪလမံၩ့ လဲၪ.မွဲနအီၪက့ၪယၧၩလၧဆၧမၩနဲၪ့အဂး, ဘဲၫၥိၭယ မိကဲၪဆၧယိၭအဎၧၫ့ လၧယဂးဒၪယဝ့ၫ, မွဲဘၪလဲၪ.",
			"21": "<sup>21</sup> တၭမွဲဘၪနီၫနလဖျါခွံၬဘၪယဆၧမၪနီၪလဲၪး ဒဲယဆၧ အၧၩ့နီၪ, နလမၩဖီၩ့မၩဖျ့ၭခွံၬဘၪနီၪ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- လယံၬဘၪတၭ,ယမိမံၫနၩ့လၧဂၪ့ခိၪမုၬအကျၩ တၭးနမိအၪ့ဎၬလါနၫ့ယၧၩတၭ, ယအီၪလၧၩ့အ့ၬ."
		},
		"8": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ၦၡုအၫဖိၪစဘံလဒၭချဲၩ့ဆၧၫ့ဝ့ၫတၭ,",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪး- နမိချဲၩ့ဆၧလဖၪယီၩဆံၭယံၬလဲၪ. ဒဲနနိၭ အဆၧချဲၩ့လဖၪမိကဲၪဘဲၫလံၩ ဆီၪ့အၥိၭဆံၭယံၬလဲၪ.",
			"3": "<sup>3</sup> ဆၧတီၩနီၪမွဲယွၩမိမၩကဒၩထဲၩ့ဆ့ဧၪး ဆၧတီၩ",
			"4": "<sup>4</sup> ဆၧလီၩ့နီၪ,မွဲၦၥ့ၪဆၧလူၬမိမၩကဒၩထဲၩ့ဆ့ဧၪ.- နဖိၪ ခွၫၥံၪမၪဘၪဆၧထၫ့ဒၩလါနၫ့အဝ့ၫဒၪ, ဒဲအဝ့ၫနီၪဖ့ၪ လၫ့ခွံၬအဝ့ၫၥံၪလၧ အဆၧဒဲၩဘၭအစီၩ့အမၩ့အဖၧၩ့",
			"5": "<sup>5</sup> တၭး- နနၫ့ဆါဒၪနဝ့ၫနအ့ၪအၪ့ဎၬယွၩ, ဒဲအၪ့ကံၩ့အၪ့",
			"6": "<sup>6</sup> ယၫၦၥ့ၪဆၧလူၬနီၪး- နအ့ၪဆံၫ့ဎံၪဝ့ၫဒဲအတီၩအလီၩ့ တၭးမွဲတၡါဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ အဝ့ၫဒၪမိနၪ့ထၪ့အ ၥၭလၧနဂး, ဒဲနဂံၪ့အတီၩအလီၩ့နီၪမိဒုၭဂုးခၧၫ့ဝ့ၫဒၪ",
			"7": "<sup>7</sup> လီၫ.- ထီးနီၪလဖၧၫ့, လၧအခၪ့ထံၭနမွဲဆၧဆံၭလါနၫ့ တၭ, လၧအထုၬလခီၫနမိကဲၪဆၧဖၭဒိၪလ့ၬလီၫ.",
			"8": "<sup>8</sup> တၭယစံၭနၧၩ,အၪ့စၪ့လါၦအဆိၩလၧဖျိၩ့နီၪ, ဒဲ ယိနဲၪ့ဆၧ လၧအဝ့ၫၥံၪအဖါလဖၪ ဒုၭနဲၪဖျီၪထၪ့ဝ့ၫနီၪ",
			"9": "<sup>9</sup> ဆံၭ.- အဂဲးဘဲၫယီၩပအီၪထၪ့ဘိၩ့လၧမုဂၪတၭ, ၥ့ၪ ယၫဆၧနးမံၩ့အ့ၬး အဂဲးဘဲၫယီၩပမုနံၩလဖၪလၧဂၪ့",
			"10": "<sup>10</sup> ခိၪချိၫ့ယီၩမွဲဘဲၫဆၧလၩၡုၪအၥိၭနီၪလီၫ.- တၭအဝ့ၫ ၥံၪမိၥီၪ့လိၪနၧၩ, ဒဲလီၩဘၪနၧၩ, ဒဲချဲၩ့ထၪ့ဆၧချဲၩ့လၧ",
			"11": "<sup>11</sup> အၥၭခံဖၧၩ့မွဲအ့ၬဧၪ.- ကဖံၬအ့ၪလအီၪဘၪနီၪ,ဖီးထံၫ မဲၪထၪ့ဘၪမိၥ့ၪဧၪး ထံၫအ့ၪလအီၪဘၪတၭ, မွဲဖီးလ",
			"12": "<sup>12</sup> ဖၪနီၪမိကဲၪထၪ့ဆ့ဧၪ.- လၧၦလဖ့ၬဒံၭဘၪတၭအီၪၥံၫ့ ဆ့ၬဒံၭနီၪ, မွဲအဎဲၫ့ထၬဆိၫနဲၪ့နၪ့ၥံၪမံၩ့ၥံၪအဂူၫဂၩလ ဖၪနီၪလီၫ.",
			"13": "<sup>13</sup> တၭၦလၧအၥၭနၪ့ခွံၬယွၩထီးအလူၬနီၪ, အဖၧၩ့ၥၭ ၥံၪမၩအၥၭဘဲၫနီၪၥိၭလီၫး ၦလဆံၫ့ဘၪ အဆၧယိ",
			"14": "<sup>14</sup> လါနီၪမိဂၭဂီၩ့ဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫယီၩအဆၧဒိၭနဲၩ့ အလးနီၪမိဘၪဆၧဒၪ့ထ့ၬခွံၬတၭး အဆၧဒိၭနဲၩ့နီၪ,",
			"15": "<sup>15</sup> မွဲခၩ့အဒိၩ့လီၫ.- မွဲအမိဒိၭနဲၩ့အၥၭလါနၫ့လၧအဂံၪ့ တၭ,အီၪဂုးခၧၫ့အ့ၬး မိဖီၪ့ထၬလါနၫ့နီၪ, မွဲအအီၪ",
			"16": "<sup>16</sup> ဆၧၫ့ထုၪ့ဝ့ၫဒၪအ့ၬ.- အဝ့ၫဒၪၥံၫ့ဝ့ၫ လၧမုအမ့ၬယၫ",
			"17": "<sup>17</sup> တၭ,အထဲၩ့အဖၫ့မၩဎွ့ၩအကျိၭနီၪလီၫ.- အဝံၥံၪမၩ ဘုၭထၬအၥၭလၧလိးအပိၩ့း ဒဲဒၪဘၪလိးလဖၪအလး",
			"18": "<sup>18</sup> လီၫ.- ထီးအ့ၪဘၪဆၧမၩဂၭဂီၩ့ခွံၬ လၧအလးနီၪ,မီၪ့",
			"19": "<sup>19</sup> ဘံၭခွံၬအဝ့ၫဒၪတၭ, စံၭဝ့ၫ,ယဒၪဘၪနၧၩအ့ၬ.- ယိခွါ, အနီၪမွဲအဖၧၩ့ၥၭအဆၧၥၭထိၬ, ဒဲလၧဂၪ့ခိၪအဖၧၩ့",
			"20": "<sup>20</sup> နီၪဂူၫဂၩၥံၪမိမဲၪထၪ့ဝ့ၫဒၪလီၫ.- ယိခွါ, ၦအလၧၫ့အ ဎွ့ၩနီၪယွၩခွံၬၡိၭအ့ၬ, မိဖီၪ့ၦအၧၩ့အစူၪနီၪဆ့အ့ၬ.",
			"21": "<sup>21</sup> လၧအမၩဎွ့ၩထၪ့နနိၭလၧဆၧနံအဘိၩ့ဘၭ, ဒဲနနိၭဖျံၩ",
			"22": "<sup>22</sup> လၧဆၧၥုၪ့ထိၬၥၭထိၬနီၪ,- ၦလၧအမ့ၬလဲၩနၧၩလဖၪ, မိဘၪဆၧ ဒုၭကီၩ့ထၪ့ၥိၭထၪ့ ဆၧမ့ၬမဲလီၫ. တၭၦ အၧၩ့လဖၪအီၪဝ့ၫအလးနီၪ, လမိအီၪလၧၩ့ဘၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စယိဘၭချဲၩ့ဆၧၫ့ဝ့ၫတၭ,စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> မွဲတၡါယူၭ,ဆၧမွဲဘဲၫနီၪၥိၭ,ယၥ့ၪယၫး အဂဲးဘဲၫ ယီၩၦၡၩအီၪတီၩဝ့ၫလီၩ့ဝ့ၫ လၧယွၩအမ့ၬယၫ မိၥ့ၪ",
			"3": "<sup>3</sup> ဘဲၫၥ့ၪလဲၪ.- အ့ၪမိဂဲးလိၬတ့ၭလိၬဘၪအၥၭ လၧအ ဝ့ၫဒၪတၭ,လၧဆၧလထီၫ့အကျၩနီၪ, မွဲအချဲၩ့ဆၧၫ့န့",
			"4": "<sup>4</sup> လထံၪနီၪၥ့ၪအ့ၬ.- အၥၭကိၪ့ဆၧၥ့ၪ, ဒဲအစီၩ့အမၩ့ ဒိၪဒိၪလ့ၬတၭ, ၦလၧအထၫ့ဒုၪဒၩအဝ့ၫ အီၪဂုးခၧၫ့",
			"5": "<sup>5</sup> နီၪ,မွဲပလၫလဂၩလဲၪ.- အဝ့ၫဒၪၥုၭခွံၬခိၪလီၩ့ၥံၪဘိၩ့ အဝ့ၫၥံၪလချႃၭၥ့ၪယၫဒံၭဘၪတၭ, လၧအဆၧၥၭထၪ့",
			"6": "<sup>6</sup> အဖၧၩ့နီၪမွဲအချႃၬလၩ့အဝ့ၫၥံၪလီၫ.- အဝ့ၫမၩဝၭဂၪ့ ခိၪၥုၭခွံၬလၧအလးတၭး အထုၪ့လဖၪဘၪဆၧထိၪ",
			"7": "<sup>7</sup> တရူၩဝ့ၫလီၫ.- အဝ့ၫမၪလူၬမုတၭဖၩ့ထၪ့ဝ့ၫဒၪအ့ၬး",
			"8": "<sup>8</sup> ၡၪၥံၪနီၪမွဲအစဲၩနဲၪ့ထၬဝ့ၫဒၪလီၫ.- အဝ့ၫဒၪပၠၪလၩ့ မူၭခိၪနီၪလဂၩဎးတၭ, ယဲးလၩ့လၧမၫဆမံၭအလပီၩ",
			"9": "<sup>9</sup> အဖၫ့ခိၪနီၪလီၫ.- အဝ့ၫဒၪတဲၩ့လၩ့ၡၪကဆၫ့, ၡၪအိၫ ရဲအၫ့,ဒဲၡၪဒိၩ့မု, ဒဲအဒူၭလဖၪအီၪၥူၪဝ့ၫလၧမုခံၫ့လ",
			"10": "<sup>10</sup> ခီၫလီၫ.- မွဲအမၩဆၧအဒိၪအထီၫလဖၪလၧၦၡၩအၪ့ ဎၬၥ့ၪယၫအဂဲးအကၠီၪ့ဘၪအ့ၬ, ဒဲဆၧလၩ့လၭလၧၦဝံ",
			"11": "<sup>11</sup> ထၪ့နၬထၪ့ၥ့ၪအ့ၬ.- ယိခွါ,မွဲအလ့ၩဖီၩ့ခွံၬယၧၩတၭ, ယဒၪဘၪအဝ့ၫအ့ၬး လ့ၩဝ့ၫဘဲၫနီၪလါနၫ့, ယၥ့ၪယၫ",
			"12": "<sup>12</sup> အဝ့ၫအ့ၬ.- ယိခွါ,အဝ့ၫဒၪမၩန့ထၪ့ခွံၬဆၧတၭ, မွဲပ လၫမိပဒၩ့ထၬ အဝ့ၫလဂၩလဲၪး မွဲနမၩနီၫလဲၪနီၪ, မွဲ",
			"13": "<sup>13</sup> ပလၫမိစံၭဝ့ၫလဂၩလဲၪ.- ယွၩအ့ၪလဒုၭဂဲၫထဲၩ့ဘၪ အဆၧၥၭထၪ့နီၪ, ၦအီၪက့ၪထၪ့ထီၫအၥၭ လၧအမၩ ဆၧၩ့ဆၧနီၪကူၭလၩ့အၥၭလၧအဖၫ့လၬလီၫ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲယချဲၩ့ဆၧၫ့အဝ့ၫဒၪကြၨၭ",
			"15": "<sup>15</sup> ဆ့ဧၪးမွဲယရွံန့ဆၧချဲၩ့ၥံၪထၫ့ဒၩအဝ့ၫဒၪဆ့ဧၪ.- ယမွဲ ၦအတီၩအလီၩ့လါနၫ့နီၪ, ယချဲၩ့ဆၧၫ့အဝ့ၫနီၪအ့ၬး ယမိအၪ့ကံၩ့အၪ့ယၫၦလၧ အမိစ့ၩရၫ့ယၧၩလဂၩနီၪ",
			"16": "<sup>16</sup> လီၫ.- ယအ့ၪကိၭထၪ့တၭ, အဝ့ၫဒၪစံၭဆၧၫ့ယၧၩနီၪ,",
			"17": "<sup>17</sup> မွဲအခိၭနၪယလူနီၪ,ယမိနဲၩအ့ၬ.- အဂဲးဘဲၫယီၩမွဲအ မၩလၩ့ဘျ့ၭယၧၩ လၧလဖုၬအဖၧၩ့, ဒဲလၧအလးလ",
			"18": "<sup>18</sup> အီၪဘၪနီၪ, မၩအၪထၪ့ယဖၧၩ့လးၥံၪလီၫ.- လဒုၭၥၪ ထၪ့ဘၪယၧၩး အ့ၪမွဲမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ယၧၩလၧဆၧ",
			"19": "<sup>19</sup> ၡၪ့ဆၧနၭအခၫနီၪလီၫ.- အ့ၪဘၪဆဲၫ့လၧဂဲးဆီၪ့ဘၭ ဆီၪ့တၭ, ယိခွါး အဝ့ၫဒၪမွဲဆၧအဂဲးဆီၪ့ၬ အ့ၪဘၪ ဆဲၫ့လၧအတီၩနီၪ, မွဲပလၫမိဖၭဝဲၩအဆၧၫ့အထီလၧ",
			"20": "<sup>20</sup> ယဂးလဂၩလဲၪ.- ယမွဲလါနၫ့ၦအတီၩတၭ, ယနိၭဒၪ ယဝ့ၫမိစ့ၩရၫ့စၪယၧၩတၭး ယအ့ၪလၧၫ့ဎွ့ၩလါနၫ့, အဝ့ၫဒၪမိဒုၭနဲၪလၧယမွဲၦနါကဲၪ့လီၫ.",
			"21": "<sup>21</sup> ယအ့ၪလၧၫ့ထၪ့ဎွ့ၩထၪ့လါနၫ့နီၪ, ယယိထဲၩ့ခွါထဲၩ့ ယနၫ့ဆါဒၪယဝ့ၫဆ့အ့ၬး ယၥၭမၧၫ့ယီၩယအီၪက့ၪ",
			"22": "<sup>22</sup> ဘဲၫဆၧအဎွ့ၩဒိၪဆ့အ့ၬ.- မွဲဝ့ၫဆၧလမံၩ့ဎးတၭ,အ ခိးမွဲယစံၭး အဝ့ၫဒၪမၩလူၬခွံၬၦအတီၩဒဲၦအအၧၩ့ဆ့",
			"23": "<sup>23</sup> လီၫ.- ထီးဆၧၥံၫချဲၫ့အ့ၪမၩဂၭဂီၩ့ၡုၭဆၧတၭ, အဝ့ၫ ဒၪမိနံဘၪ ၦလၧအဆၧမၪလအီၪဘၪ အဆၧၡၪ့နီၪ",
			"24": "<sup>24</sup> လီၫ.- ဂၪ့ခိၪနီၪဘၪဆၧဖ့ၪလၫ့ခွံၬဝ့ၫလၧၦအအၧၩ့အစူၪ ဖၧၩ့း အဝ့ၫဒၪမၩဘံၭခွံၬ ၦလၧအစ့ၩရၫ့ဆၧလဖၪအ မ့ၬတၭးအ့ၪလမွဲဘၪနီၪ, မွဲအအီၪခီၫခီၫလဲၪး မွဲပလၫ",
			"25": "<sup>25</sup> လဂၩလဲၪ.- ယမုနံၩလဖၪချဲၫ့နဲၪ့ၦၥိၫ့လံၬပရၧၫ့နီၪ",
			"26": "<sup>26</sup> စဲၪ့ဖျိၭတၭ,ဒၪဘၪဆၧဂ့ၩနးမံၩ့အ့ၬ.- လ့ၩဖီၩ့ခွံၬဘဲၫ ချံၫခီၫ့ဘီၩ့အၥိၭတၭ, ဘဲၫလံၬကျီၫ့ကျီၫ့ဘျၨၪလၩ့လၧ",
			"27": "<sup>27</sup> အဆၧအၪ့ဂူၬန့အအီၪၥိၭနီၪလီၫ.- ယအ့ၪစံၭ,ယမိၥၭ နၪ့ခွံၬယဆၧၥူၭဝံၪၥူၭလၩနီၪ, ယမိခွံၬၡိၭယဆၧဎၧၫ့",
			"28": "<sup>28</sup> တၭ,ယမိၥုၪ့ထိၬၥၭထိၬတၭး- ထီးနီၪလဖၧၫ့ယၥၭမဲၪ ယဆၧခိဆၧဝီၩထီးအလူၬလဖၪနီၪ, ယၥ့ၪယၫလၧနမိ အီၪက့ၪယၧၩဘဲၫၦလၧအဆၧမၪလအီၪဘၪဆ့အ့ၬ.",
			"29": "<sup>29</sup> ယဝ့ၫဒၪ,ဆၧအ့ၪအီၪက့ၪယၧၩ ဘဲၫၦလၧဆၧမၪအီၪ ဝ့ၫအၥိၭတၭ, မွဲယမၩဎၧၫ့လၩ့ ယၥၭဒၪယဝ့ၫယီၩအ",
			"30": "<sup>30</sup> ဂဲးဘဲၫၥ့ၪလဲၪ.- ယအ့ၪၥူၫဝၭလါနၫ့ ယနၫ့ဆါလၧမူၭ ခိၪဖီၫအထံၫနီၪး ဒဲယမၩဆံၫ့ယစူၪ ဂ့ၩဘၪစဲၪလါနၫ့",
			"31": "<sup>31</sup> တၭး- နမိခွံၬလၩ့ယၧၩလၧဆၧဖၧၩ့တၭ, ယကီၩ့ယ",
			"32": "<sup>32</sup> ၥိၭဒၪယဝ့ၫနီၪမိအီၪက့ၪၥၭလိၪယၧၩလီၫ.- လၧယမိ ချဲၩ့ဆၧၫ့အဝ့ၫနီၪ, ဒဲလၧယမိလ့ၩဎုၬ လၧဆၧစ့ၩရၫ့ခွး",
			"33": "<sup>33</sup> အဖၧၩ့တၭ, အဝ့ၫဒၪမွဲၦၡၩဘဲၫယၧၩအၥိၭအ့ၬး- ၦ လၧအမိစ့ၩရၫ့ ဆၧလၧပဘိၩ့ဆၧၩ့, ဒဲအီၪက့ၪအစူၪ",
			"34": "<sup>34</sup> လၧပၧၩနံၫဂၩလူၬ အလီၩ့အီၪနးဂၩအ့ၬ.- အနိၪထး နီၪမွဲအကၠၪခွံၬဝ့ၫ လၧယအီၪဆံၭး ဘဲၫၥိၭဆၧၥၭမဲၪ",
			"35": "<sup>35</sup> အဝ့ၫနီၪ,ထီးမၩနၧၩ့မၩစၪဘၪယၧၩလဂ့ၩ.- ယမိချဲၩ့ ထၪ့တၭ, ယမိၥၭမဲၪအဝ့ၫအ့ၬး အဂဲးဘဲၫယီၩ လၧယ နၫ့ဆါဒၪယဝ့ၫအဖၧၩ့, ဆၧမၩအၥၭဘဲၫနီၪအ့ၬ."
		},
		"10": {
			"1": "<sup>1</sup> ယၥၭမၧၫ့ယီၩဒုၭပွံၭယၥၭတၭ, ယမိဖျါခွံၬယဆၧ ဂၪ့အုၩ့ဂၪ့ထိၬနီၪ ယမိချဲၩ့ဆၧလၧယၥုၪ့ခိၥၭဝီၩလီၫ.",
			"2": "<sup>2</sup> ယမိစံၭယွၩ, ထီးအီၪက့ၪဆၧမၪ လၧယလီၩ့လဂ့ၩး နဂဲးလိၬတ့ၭလိၬယၧၩမွဲအဂဲးဘဲၫၥ့ၪလဲၪ, ဒုၭနဲၪယၧၩ",
			"3": "<sup>3</sup> နးထံၪဘီၪ.- လၧနမိမၩၡၪ့မၩယၬဆၧ, စ့ၩရၫ့စၪဆၧ မၩလၧနစူၪဒၪနဝ့ၫမၩနီၪ, ဒဲဒုၭဖၩ့ဒိၭၦအၧၩ့ၥံၪအဆၧ",
			"4": "<sup>4</sup> ကိၪ့နီၪ, မွဲအဂ့ၩလၧနမ့ၬယၫဆ့ဧၪ.- မွဲနအီၪလၧဆၧ ယၪအမ့ၬယၫနီၪဆ့ဧၪး မွဲနဒၪဘၪဆၧဘဲၫၦၡၩအၥိၭ",
			"5": "<sup>5</sup> ဆ့ဧၪး- နမုနံၩလဖၪမွဲဘဲၫၦၡၩအမုနံၩလဖၪဧၪး နနံၪ့",
			"6": "<sup>6</sup> ၥံၪမွဲဘဲၫၦၡၩအမုနံၩလဖၪအၥိၭဆ့ဧၪ.- မွဲနအၪ့ဎၬ",
			"7": "<sup>7</sup> ယဆၧအၧၩ့,ဒဲနမိအၪ့ဎၬယိယဆၧဒဲၩဘၭဆ့ဧၪ.- နၥ့ၪ ယၫလၧယလမွဲဘၪၦအၧၩ့ဖိၪတၭး ၦမၩဖီၩ့ဖျ့ၭလၧ နစူၪဖၧၩ့ၥ့ၪနးဂၩအ့ၬ.",
			"8": "<sup>8</sup> နစူၪဒၪနဝ့ၫမၩကဲၪထၪ့ယၧၩ, ဒဲမၩထၪ့ယခံးယဂၩ့",
			"9": "<sup>9</sup> ထၧၫ့ဂၩယၫလါနၫ့တၭးနမၩဂၭဂီၩ့ယၧၩဘီၪၬ- ဘိၩ့ နဲၪ့ယီၩနၪ့ထၪ့ထဲၩ့လၧနမၩထၪ့ယခံးယဂၩ့ လၧကဖံၬ တၭ,မွဲနမိဒုၭကဲၪထဲၩ့ဒီၭယၧၩ လၧဂၪ့ခိၪအမုၬနီၪဆ့ ဧၪ.",
			"10": "<sup>10</sup> နလူၫလၩ့ယၧၩဘဲၫဆၧနူထံၫအၥိၭ, ဒဲမၩလၩ့ဒၭ",
			"11": "<sup>11</sup> ယၧၩဘဲၫဆၧနူထံၫလၩ့ဒၭအၥိၭနီၪ, မွဲအ့ၬဧၪ.- နဒုၭ ကီၩ့ဒုၭၥိၭထၪ့ယၧၩ လၧဆၧဖံၭဆၧယၪ, ဒဲနထၭထၪ",
			"12": "<sup>12</sup> ယၧၩလၧဎွံၪၥံၪထီၪ့ၥံၪနီၪလီၫ.- ၥၭမၧၫ့ဒဲဆၧအခိး အတၩနဖ့ၪလၫ့ယၧၩတၭ, နယိထဲၩ့ခွါထဲၩ့ယၥၭၡီၩ့",
			"13": "<sup>13</sup> လီၫ.- တၭဆၧလဖၪယီၩ နအီၪက့ၪၥူၪခွံၬလၧနၥၭခံ ဖၧၩ့းဆၧယီၩလမံၩ့အီၪလၧနၥၭဖၧၩ့နီၪ ယၥ့ၪယၫယ ဝ့ၫလီၫ.",
			"14": "<sup>14</sup> ယအ့ၪမၪဘၪဆၧနဒၪဘၪယၧၩတၭ, မွဲနမိမၩဖီၩ့",
			"15": "<sup>15</sup> မၩဖျ့ၭယဆၧဒဲၩဘၭအ့ၬ.- ယအ့ၪမွဲၦအၧၩ့တၭ,ဆၧ ၡၪ့ဆၧနၭဘၪယၧၩဖီၩၬ အ့ၪမွဲအတီၩအလီၩ့နီၪယ မိၬထၪ့ယခိၪအ့ၬး ဆၧမ့ၬမဲမၩလၧၫ့ဎွ့ၩယၧၩ, ယဆၧ",
			"16": "<sup>16</sup> ၡၪ့ဆၧနၭဖျီၪထၪ့ဖီၩၬ- အ့ၪဆိၬထၪ့အၥၭတၭ,နလီၩ့ အၪ့ဎၬယၧၩ ဘဲၫဆၬလၥၧၫ့အၥိၭနီၪ, ဒဲဒုၭနဲၪနစီၩ့န",
			"17": "<sup>17</sup> မၩ့လၩ့လၭနီၪလၧယလီၩ့လီၫ.- နမၩထၪ့ၥၫ့ဒီၭနဆၧ ထိးအၥၭထၫ့ဒုၪဒၩယၧၩတၭ,နမၩအၪထၪ့နဆၧၥၭ ထၪ့လၧယလီၩ့တၭးဆၧခမျၧးနီၪ ဖိၬဆၧခမျၧးအခဲၫ့ ထၫ့ဒုၪဒၩယၧၩလီၫ.",
			"18": "<sup>18</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲနဒုၭဂဲၫထၪ့ယၧၩ လၧဆၧ ဒၧၩ့လးအဖၧၩ့နီၪ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ, မွဲယကြၨၭၥံၫ",
			"19": "<sup>19</sup> ယူၭတၭ,ၦမ့ၬၥၪမိဒၪဘၪယၧၩနးတီၪ့အ့ၬ.- ယကြၨၭ အီၪဘဲၫယလဂဲၫထၪ့ဘၪအၥိၭတၭး ကြၨၭလၧၦဆိၬ ခွံၬယူၭယၧၩ လၧဒၧၩ့လးနီၪထီၩ့လၧဆၧၥွၪခိၪလီၫ.",
			"20": "<sup>20</sup> ယအီၪၡၩနံၩၡၩၥၫ့မွဲအ့ၬဧၪ. မွဲအထီးမၩဘူၭယၧၩ လဂ့ၩ.လၧယလချႃၭလ့ၩထီၩ့အလးလၧယလဂဲၫထဲၩ့",
			"21": "<sup>21</sup> ဘၪနီၪ,- လၧဆၧခံၭအခးဒဲဆၧၥံၫအလၩၡုၪအခး,",
			"22": "<sup>22</sup> လၧဆၧခံၭအခးဘဲၫဆၧခံၭၥၧၫ့ဝ့ၫအၥိၭ, ဆၧၥံၫအ လၩၡုၪ,လၧအလဎၩ့ဘၪး ဒဲလၧဆၧဖၩ့နီၪအီၪဘဲၫဆၧ ခံၭၥၧၫ့အၥိၭတၭး မွဲအဒုၭအီၪဒၪယၧၩ ဘဲၫၥိၭယမိ အီၪမုၬထၪ့ထဲၩ့လဆံၭဆံၭဘီၪ."
		},
		"11": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ ၦနၫအမၭဖိၪ စဇိဖၫနီၪချဲၩ့ဆၧၫ့ဝ့ၫ",
			"2": "<sup>2</sup> တၭ,စံၭဝ့ၫဒၪး- ဆၧချဲၩ့အၪလဖၪနီၪၦစံၭဆၧၫ့အလး အီၪအ့ၬဧၪး ၦချဲၩ့ဆၧၥ့ၪနီၪ, မွဲဆၧအီၪက့ၪဝ့ၫလၧအ",
			"3": "<sup>3</sup> တီၩအလီၩ့နီၪ, ကြၨၭအ့ၬဧၪ.- နချဲၩ့ၥူၪဂဲၩဆၧနီၪ, မွဲ အဒုၭအီၪလၩ့မါပံၭၦၡၩဧၪး နမၩကြၩ့ထမးဆၧတၭ,",
			"4": "<sup>4</sup> ၦကြၨၭဒုၭမ့ၬမဲနၧၩနးဂၩအ့ၬဧၪ.- အဂဲးဘဲၫယီၩန စံၭ,ယဆၧၥီၪ့နီၪဆံၫ့ဝ့ၫတၭ, ယဝ့ၫဒၪယအီၪဆံၫ့လၧ",
			"5": "<sup>5</sup> နမ့ၬယၫလီၫ.- တၭမွဲယွၩချဲၩ့ထၪ့လါဆၧ, ဒဲအၩ့ထၪ့",
			"6": "<sup>6</sup> အနိၭထၫ့ဒၩနၧၩဆံၭ.- ဒဲဒုၭနဲၪလါနၧၩ လၧဆၧကိၪ့ ၥ့ၪအအီၪၥူၪလဖၪ,လၧဆၧၥုၪ့ဖၭၥၭဖၭမွဲဆၧအၪအၪ လ့ၬတၭး ထီးနီၪလဖၧၫ့နမိၥ့ၪယၫလၧယွၩနၪ့ထၪ့ထဲၩ့ နဆၧဒဲၩဘၭထီးအလူၬ လၧအထၫ့ဒၩနၧၩနီၪအ့ၬ.",
			"7": "<sup>7</sup> ယွၩအဆၧယိၬလဖၪနီၪ, မွဲနအၪ့ဎၬဒၪဘၪမိၥ့ၪဆ့ ဧၪး ၦၥ့ၪဆၧလူၬနီၪ, မွဲနအၪ့ဎၬၥ့ၪယၫအဝ့ၫလၧၫ့",
			"8": "<sup>8</sup> လၧၫ့ဎွ့ၩဎွ့ၩမိၥ့ၪဆ့ဧၪ.- မွဲအထၪ့ထီၫဘဲၫမူၭခိၪအၥိၭ နီၪးနမၩမိၥ့ၪဘဲၫၥ့ၪလဲၪး ယိၬနဲၪ့ဖျႃဖၧၩ့တၭ,နမိၥ့ၪ",
			"9": "<sup>9</sup> ယၫဘဲၫၥ့ၪလဲၪ.- အဆၧထိၪနီၪထီၫနဲၪ့ဂၪ့ခိၪ, ဒဲလဲနဲၪ့",
			"10": "<sup>10</sup> မၫဆမံၭၬ- အဝ့ၫဒၪအ့ၪဒၪ့ထ့ၬဆၧမွဲဂ့ၩ, ကၭဘံၭထၬ ဆၧမွဲဂ့ၩ, ဒုၭအီၪကီၪ့ဆၧမွဲဂ့ၩ, မွဲပလၫပဒၩ့ထၬမိၥ့ၪ",
			"11": "<sup>11</sup> လဂၩလဲၪ.- အဂဲးဘဲၫယီၩအဝ့ၫဒၪၥ့ၪယၫၦအၧၩ့ဖိၪ ၥံၪမွဲအဒၪဆၧအၧၩ့ဆၧၥၫ့နီၪ မွဲလဆီၫ့မီၪ့ဘၪအဂဲး",
			"12": "<sup>12</sup> အကၠီၪ့နီၪဆ့ဧၪ.- အ့ၪမွဲၦၡၩမၩဖိၫလိၫအၥၭတၭ,အ ဆၧကိၪ့ၥ့ၪနီၪအီၪအ့ၬး ခီၫလၧအအီၪဖျဲၪၥၫ့နီၪမၩအ ၥၭဘဲၫကၥ့ၪယီၩ့မံၩ့အဖိၪအၥိၭလီၫ.",
			"13": "<sup>13</sup> နဝ့ၫဒၪနအ့ၪတဲၩ့ဝဲၩနၥၭ, ဒဲယူၬထၪ့နစူၪလၧယွၩအ",
			"14": "<sup>14</sup> အီၪနီၪတၭ,- ဆၧအၧၩ့အ့ၪအီၪလၧနစူၪဖၧၩ့တၭ, ခွံၬ ၡိၭခွံၬလၧအယဲၩ့ဆံၭး ဒဲဒုၭအီၪဆၧအၧၩ့ဆၧၥၫ့လၧ",
			"15": "<sup>15</sup> နအီၪဝ့ၫအလးဖၧၩ့နီၪလဂ့ၩး- မွဲမၬ, ထီးနီၪလဖၧၫ့နမိ မိၬထၪ့တၡါနမ့ၬလၧမဲၪၥၧၫ့မဲၪဝီၩနီၪလအီၪဘၪနီၪ, ဒဲနမိ",
			"16": "<sup>16</sup> အီၪဂုးခၧၫ့တၭ,ၥၭမဲၪဆၧအ့ၬ.- အဂဲးဘဲၫယီၩနမိၥၭ နၪ့ခွံၬဆၧၡၪ့ဆၧနၭတၭ, နမိနၪ့ထၪ့ဝ့ၫဘဲၫထံၫလၧအ",
			"17": "<sup>17</sup> ယွၩဖီၩ့ခွံၬဝ့ၫအၥိၭနီၪလီၫ.- တၭနမၧၫ့နီၪ မိဂဲၫထၪ့ ယုၩ့ယဲနဲၪ့မုထုၪ့အခၫနီၪတၭ, ဆၧခံၭမိမၩအၥၭဘဲၫ ဆၧဖၩ့ထၪ့အၥိၭနီၪလီၫ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့လၧဆၧယိလါအီၪဝ့ၫအကၠီၩ့တၭ, န မိအီၪဂုးခၧၫ့းမွဲကဒၪယူၭ, နမိအၪ့ဎၬဆၧ,ဒဲမံၫနၩ့လၧ",
			"19": "<sup>19</sup> ဆၧၥၭမဲၪလအီၪဘၪလီၫ.- နမိမံၫမၪတၭ,ၦဒုၭၥၭမဲၪ နၧၩအီၪနးဂၩအ့ၬး မွဲကဒၪယူၭ, ၦအၪဂၩမိချဲၩ့မုၬနါ",
			"20": "<sup>20</sup> နၧၩလီၫ.- အ့ၪမွဲၦအၧၩ့ဖိၪအမ့ၬၥၪၥံၪမိလူၬခွံၬတၭး အဝ့ၫၥံၪအဆၧဖလ့ၬအလးလၩ့မါဝ့ၫ, ဒဲအဆၧယိ လါနီၪမွဲဘဲၫၦၥၭစဲၪ့ထၪ့ခွံၬဝ့ၫအၥိၭနီၪလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စယိဘၭချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> မွဲတၡါ,နၥံၪမွဲၦခမျၧးၥံၪနီၪ ဒဲဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ",
			"3": "<sup>3</sup> မိၥံၫလၧနၥံၪအၥိၭလီၫ.- ယဝ့ၫဒၪယီၩဆ့ ယအီၪလၧ ၥၭကိၪ့ၥ့ၪဘဲၫနၥံၪအၥိၭး ယမွဲဆံၭနဲၪ့နၥံၪအ့ၬးတၭ",
			"4": "<sup>4</sup> ဆၧလဖၪယီၩမွဲပလၫလၥ့ၪယၫဘၪလဂၩလဲၪ.- ယမွဲ ၦလဂၩလၧအထံၩအၥိၭချဲၩ့ကြၩ့ထမးဝ့ၫတၭ, ၦလၧ အကိၭထၪ့ယွၩနီၪ, အဆၧစံၭဆၧၫ့ဝ့ၫးၦအတီၩအလီၩ့",
			"5": "<sup>5</sup> ဘၪဆၧနံဘၪဒုၪဒွ့ၪဝ့ၫလီၫ.- ၦလၧအခၪ့ဘူၭလၧအမိ ဖျၬဝ့ၫနီၪ, လၧၦအီၪဂုးခၧၫ့ဝ့ၫလၧအၥၭဆီၫ့မီၪ့ဆၧအ ဖၧၩ့နီၪ,မၩအၥၭဘဲၫဆၧဒုၪဒွ့ၪအီၪ လၧဆၧၡၪ့ဆၧနၭ",
			"6": "<sup>6</sup> အကၠီၩ့နီၪလီၫ.- ၦထမျၬဆၧအတဲၩၥံၪ ကဲၪထၪ့ကဲၪ ထီၫဝ့ၫ, ဒဲၦလၧအမၩထံၬထၬယွၩနီၪ အီၪဂုးခၧၫ့ဝ့ၫ တၭ,ယွၩဒုၭဂဲၫဆၧလၧအဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> အ့ၪမွဲဘိၩ့နဲၪ့ယီၩအၪ့စၪ့ဆၧဖိၪဆၧဎါၥံၪ, အဝ့ၫၥံၪ မိၥီၪ့လိၪနၧၩး ဒဲထိၪၥံၪလံၪၥံၪလၧဆၧဖိၭဖၫ့နီၪ အဝ့ၫ",
			"8": "<sup>8</sup> ၥံၪမိဒုၭနဲၪနၧၩလီၫ.- အ့ၪလမွဲဘၪတၭစံၭဂၪ့ခိၪနီၪ, မွဲ အမိၥီၪ့လိၪနၧၩး ဒဲမၫဆမံၭအယၪလဖၪမိလီၩဘၪနၧၩ",
			"9": "<sup>9</sup> လီၫ.- လၧဆၧထီးအလူၬလဖၪယီၩအကၠီၩ့,မွဲပလၫ လၥ့ၪယၫဘၪ, လၧယဟိဝၩအစူၪဒုၭကဲၪထၪ့ဆၧယီၩ",
			"10": "<sup>10</sup> လဲၪ.- ဆၧမၧၫ့ထီးအလူၬအၥၪ, ဒဲၦၡၩထီးအလူၬအ",
			"11": "<sup>11</sup> ၥၭအီၪလၧပလၫအစူၪဖၧၩ့လဂၩလဲၪ.- တၭပနါနီၪ မၩခွါဆၧချဲၩ့ၥံၪ, ဘဲၫနိၭအၪ့ယိခွါအဆၧအၪ့ဆၧအီၩ",
			"12": "<sup>12</sup> အၥိၭ, မွဲအ့ၬဧၪ.- လၧၦၥၭၡါၥံၪအကျၩဆၧကိၪ့ၥ့ၪ ကိၪ့ဘၪအီၪဝ့ၫတၭ, လၧအၪနံၩအၪၥၫ့အဖၧၩ့နီၪၥုၪ့",
			"13": "<sup>13</sup> ဖၭၥၭဖၭအီၪဝ့ၫလီၫ.- လၧအဝ့ၫဒၪအၥိၭဆၧကိၪ့ၥ့ၪ ကိၪ့ဘၪဒဲဆၧအစီၩ့အမၩ့နီၪအီၪဝ့ၫး အဝ့ၫဒၪအီၪလၧ",
			"14": "<sup>14</sup> ဆၧဒုၭကိၪ့ဆၧဒဲၥုၪ့ဖၭၥၭဖၭလီၫ.- ယိခွါ, အဝ့ၫဒၪ ခွံၬလၩ့ခွံၬတၭ, ဆၧမိမၩထၪ့ထဲၩ့ဒီၭအ့ၬး မွဲအကၭဘံၭ",
			"15": "<sup>15</sup> ထၬၦၡၩတၭ,ဆၧမိဖျါခွံၬဝ့ၫအ့ၬး- ယိခွါ, မွဲအဖီၪ့ ထၬထံၫၥံၪတၭ,အဝ့ၫၥံၪလၩ့ၥံၭခွံၬဝ့ၫဒၪနီၪ ဒဲအဖျါ",
			"16": "<sup>16</sup> ခွံၬဝ့ၫတၭ,အဝ့ၫၥံၪမၩဂၭဂီၩ့ဂၪ့ခိၪလီၫ.- အဝ့ၫဒၪအီၪ လၧဂဲးဆီၪ့ဘၭဆီၪ့ ဒဲဆၧကိၪ့ၥ့ၪကိၪ့ဘၪး ၦဘၪဆၧ အၪ့လီၫဝ့ၫ,ဒဲၦလၧအအၪ့လီၫဆၧနီၪမွဲအဝ့ၫဒၪအဆၧ",
			"17": "<sup>17</sup> လီၫ.- အဝ့ၫဒၪမီၩ့ဒုၭကဲၪဎီးၦလၧအဒုၭကိၪ့ဆၧလဖၪ,",
			"18": "<sup>18</sup> ဒဲၦစ့ၩရၫ့ခွးလဖၪမၩကဲၪထၪ့ဝ့ၫၦဂီၩ့ဖိၪနီၪလီၫ.- မွဲအ ကွဲၪလၩ့စဎွၩၥံၪ အခၧၩ့ယးနီၪ, ဒဲဘဲၩ့ထၬဖျံၩလၧအ",
			"19": "<sup>19</sup> ဝ့ၫၥံၪအယးဒံၩ့လီၩ့နီၪလီၫ.- မွဲအမီၩ့ဒုၭကဲၪဎီးၦလု",
			"20": "<sup>20</sup> ဆၧလဖၪးဒဲဒုၭလၩ့ထံၩဖါၦအဆီၪ့ၥံၪလီၫ.- အဝ့ၫဒၪ ၥုၭခွံၬၦအတီၩအဆၧချဲၩ့, ဒဲမၩန့ခွံၬၦၥၭၡါလဖၪအ",
			"21": "<sup>21</sup> ဆၧကိၪ့ၥ့ၪနီၪလီၫ.- မွဲအလူၫလၩ့ဆၧကြၩ့ထမးလၧၦ",
			"22": "<sup>22</sup> ဒိၪၥံၪအလီၩ့,ဒဲကွဲၪလၩ့ၦဂဲးဆီၪ့အခၧၩ့ယးလီၫ.- ဆၧ အဒိၪအယိၬ လၧဆၧခံၭကျၩနီၪ, အဝ့ၫဒၪဒုၭဖျီၪထၪ့ဒဲ ဆၧၥံၫအလၩၡုၪနီၪ အဝ့ၫဒၪဂဲၫဆိၬထၪ့ လၧဆၧဖၩ့",
			"23": "<sup>23</sup> အကျၩလီၫ.- အဝ့ၫဒၪဒုၭဒိၪထၪ့ၦဆၨၩၥံၪတၭ, မၩ ဂၭဂီၩ့အဝ့ၫၥံၪဆ့း မွဲအဒုၭလဲထၪ့ ၦဆၨၩၥံၪအနဲၩ့",
			"24": "<sup>24</sup> ထံၭ,ဒဲမီၩ့ခွံၬအဝ့ၫၥံၪဆ့လီၫ.- အဝ့ၫဒၪမၩန့ခွံၬၦထံၫ ဖိၪခးဖိၪၥံၪအၦဒိၪလဖၪအၥၭကိၪ့ၥ့ၪ, ဒဲဒုၭဂၭဝံၩ့ဝၩ့ အဝ့ၫၥံၪလၧဆၧအလးအီၪယူဝ့ၫ လၧဖၧၩ့ၥၭလအီၪ",
			"25": "<sup>25</sup> ဘၪနီၪလီၫ.- အဝ့ၫၥံၪလုးဆၧ လၧဆၧခံၭကျၩတၭ, ဆၧဖၩ့အီၪအ့ၬး အဝ့ၫဒၪဒုၭလ့ၩအဝ့ၫၥံၪဒံၩ့ခံၫ့ဒၫ့ဎၩ့ ဘဲၫၦမၧၩ့ဆၧအၥိၭနီၪလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ယိခွါ,ယမ့ၬၥၪဒၪဘၪဝ့ၫထီးအလူၬး ယနါနါဂၧၫ့",
			"2": "<sup>2</sup> ဘၪယူၭ,ဒဲနၪၥ့ၪယူၭဆ့လီၫ.- ဆၧလၧနၥံၪၥ့ၪယၫတၭ, ယၥ့ၪယၫယဝ့ၫဆ့း ယအီၪလၧနၥံၪအဖၫ့လၬနးဆံၭ အ့ၬ.",
			"3": "<sup>3</sup> အ့ၪမွဲ,ယဝ့ၫဒၪယီၩ, ယမိချဲၩ့လၧၦၥ့ၪဆၧလူၬလ ဂၩနီၪး ဆၧမိချဲၩ့ဒုၪ့လိၬဘၪယၥၭ လၧယွၩနီၪလီၫ.",
			"4": "<sup>4</sup> အ့ၪမွဲနၥံၪမွဲၦတဲၩ့ဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪလဖၪ, နၥံၪထီး",
			"5": "<sup>5</sup> အလူၬ မွဲၦဘၠၩ့ဆၧပျီၩပျီၩန့ကၩဆၧနးမံၩ့အ့ၬ.- မွဲန ၥံၪအီၪလါလၩ့မါပံၭတၡါဆံၭး အဂဲးဘဲၫယီၩအနီၪမွဲ",
			"6": "<sup>6</sup> နၥံၪအဆၧကိၪ့ၥ့ၪလီၫ.- ဘိၩ့နဲၪ့ယီၩခိၭနၪယဆၧချဲၩ့ ကိၪ့ၥ့ၪ,ဒဲဒိၭနၥံၪအနါ လၧယနိၭဖျံၩ အဆၧချဲၩ့အၪ့",
			"7": "<sup>7</sup> ယၫဆၧလဖၪနီၪဘီၪ.- လၧယွၩအဂးနီၪ, မွဲနၥံၪမိချဲၩ့ အၧၩ့ချဲၩ့ၥၫ့ဆ့ဧၪး ဒဲလၧအဝ့ၫအဂးနီၪ, မွဲနၥံၪမိလီၩ",
			"8": "<sup>8</sup> ဘၪဆၧအၪ့လီၫနီၪဆ့ဧၪ.- နၥံၪမိယိမ့ၬအဝ့ၫဒၪဧၪ.န",
			"9": "<sup>9</sup> ၥံၪမိဂဲးလိၬတ့ၭလိၬလၧယွၩအဂးဆ့ဧၪ.- အဝ့ၫဒၪအၪ့ ဎၬၥ့ၪယၫနၥံၪနီၪ, မွဲအဂ့ၩဆ့ဧၪး အ့ၪလမွဲဘၪနီၪ,ဘဲၫ ၦၡၩဘၪဆၧအၪ့လီၫဝ့ၫအၥိၭနီၪ, မွဲနၥံၪအၪ့လီၫအဝ့ၫ",
			"10": "<sup>10</sup> ဒၪဘဲၫနီၪၥိၭဘၪမိၥ့ၪဧၪ.- နၥံၪအ့ၪယိမ့ၬၦၡၩလၧဆၧ",
			"11": "<sup>11</sup> အီၪၥူၪဝ့ၫတၭ,အဝ့ၫဒၪမိအၪ့ၥီၪ့တၡါနၥံၪလီၫ.- အဝ့ၫ ဒၪအကယးကဖးနီၪမိမၩၥၭမဲၪနၥံၪအ့ၬဧၪ, ဒဲအဆၧ",
			"12": "<sup>12</sup> ဒုၭၥၭမဲၪမိလၩ့ဘၪနၥံၪအ့ၬဧၪ.- နၥံၪအဆၧချဲၩ့ကိၪ့ ၥ့ၪကိၪ့ဘၪလဖၪ မွဲဘဲၫဖံၫ့ချၪအဆၧချဲၩ့ဒီၩ့း ဒဲနၥံၪအ ထိၬလဖၪ မွဲကဖံၬအထိၬၥံၪလီၫ.",
			"13": "<sup>13</sup> အီၪလၩ့မါပံၭ လၧယမ့ၬယၫဘဲၫၥိၭယမိချဲၩ့ထၪ့ ဆၧဘိၩ့နဲၪ့ယီၩတၭး ထီးဒၪဆၧလမံၩ့မံၩ့မိလၩ့ဘၪ",
			"14": "<sup>14</sup> ယၧၩနီၪ,မွဲအဂဲၫဒၪဝ့ၫဆံၭ.- ယအဲၪ့ဆိၬန့ယဖံၭယ ယၪ,ဒဲအီၪက့ၪယၥၭမၧၫ့လၧယစူၪဖၧၩ့, မွဲအဂဲးဘဲၫ",
			"15": "<sup>15</sup> ၥ့ၪလဲၪ.- ယိခွါ, မွဲအမၩၥံၫလါနၫ့ယၧၩနီၪ, ယမိဒိၭနဲၩ့ ယၥၭလၧအစူၪဖၧၩ့း မွဲလါနၫ့ဘဲၫနီၪတၭ, လၧအဝ့ၫ ဒၪအမ့ၬယၫနီၪ, ယမိချဲၩ့ဖီၩ့ဖျ့ၭယဖၧၩ့ၥၭဒၪယဝ့ၫ",
			"16": "<sup>16</sup> အဂဲးအကၠီၪ့ဆ့လီၫ.- တၭအဝ့ၫဒၪမိကဲၪဆ့ယဆၧဖီၩ့ ဖျ့ၭအလး, အဂဲးဘဲၫယီၩၦစံၪစၪလဖၪနီၪမိဂဲၫလၧအ",
			"17": "<sup>17</sup> မ့ၬယၫအ့ၬ.- ယဆၧချဲၩ့လဖၪယီၩ,ဒဲဆၧလၧယလီၩ ဖျီၪထၪ့လၧနၥံၪအနါဖၧၩ့လဖၪနီၪ, ခိၭနၪနၥံၪဝ့ၫထံၫ",
			"18": "<sup>18</sup> ထံၫဆၭဆၭဆံၭ.- ယိခွါဘိၩ့နဲၪ့ယီၩ, ယတဲၩ့ဝဲၩယူၭ ယမူၭယူၭတၭ, ယၥ့ၪယၫလၧဆၧမၪလအီၪဘၪလၧ",
			"19": "<sup>19</sup> ယလီၩ့လီၫ.- ၦလၧအမိဂဲးလိၬတ့ၭလိၬလၧယၧၩယီၩ, မွဲၦလဂၩလဲၪးအ့ၪမွဲဘဲၫနီၪ, ယမိအီၪလၩ့မါပံၭတၭ,",
			"20": "<sup>20</sup> ယမိၥံၫဒၪယဝ့ၫလီၫ.- န့ၫဆၧနံၫမံၩ့လဖၪထီးမၩလၧ ယဂးလဂ့ၩး ထီးနီၪလဖၧၫ့မွဲယမိအီၪက့ၪၥူၪခွံၬယၥၭ",
			"21": "<sup>21</sup> လၧနမ့ၬယၫအ့ၬ.- နစူၪနီၪၥုၭခွံၬလၧယလီၩ့ဆံၭး ဒဲန",
			"22": "<sup>22</sup> ဆၧမၩၥၭမဲၪနီၪ, မွဲအထီးဒုၭၥၭမဲၪယၧၩလဂ့ၩး- ထီး နီၪလဖၧၫ့ကိၭထၪ့နဝ့ၫတၭ, ယမိစံၭဆၧၫ့ဆၧး အ့ၪလ မွဲဘၪနီၪယမိချဲၩ့ထၪ့တၭ,စံၭဆၧၫ့ဒၪနဝ့ၫဘီၪ.",
			"23": "<sup>23</sup> ယဆၧအၧၩ့ၥံၪ ဒဲယဆၧဒဲၩဘၭၥံၪ, မွဲအအီၪဆံၭ အၪလဲၪ ယဆၧမၪဒဲယဆၧဒဲၩဘၭ, ဒုၭၥ့ၪယၫယၧၩ",
			"24": "<sup>24</sup> ယီၩဆံၭ.- နအီၪက့ၪကဒုၩခွံၬနမ့ၬ, ဒဲအီၪက့ၪယၧၩ",
			"25": "<sup>25</sup> ဘဲၫနဒုၪနဒၩအၥိၭနီၪ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- ၥံၪ့လၪလၧ အဘၪဆၧနၫ့ဝံၩ့ဝၩ့ဝ့ၫနီၪ နမိဒုၭၥၭမဲၪဧၪ, ဖ့ၫဎဲၫ့ထၬ",
			"26": "<sup>26</sup> နီၪမွဲနလီၩ့ဆီးဆ့ဧၪ.- အဂဲးဘဲၫယီၩနကွ့ၭဆၧခၪ့ၥံၪ ထၫ့ဒုၪဒၩယၧၩ, ဒဲဒုၭန့ၥၫယၧၩလၧယၥၭဘၪ့အဆၧ",
			"27": "<sup>27</sup> ဒဲၩဘၭလဖၪနီၪလီၫ.- ဒဲနအီၪက့ၪယခၪ့လၧၥိၭဖၧၩ့, ဒဲအီၪခိၭယဖၧၩ့ၥၭထီးအလူၬလဖၪနီၪ, မွဲအဂဲးဘဲၫၥ့ၪ လဲၪးတၭနဝၩ့ထၬယခၪ့ယၫၥၭနီၪလီၫ.",
			"28": "<sup>28</sup> တၭအဝ့ၫဒၪ,မိလူၬခွံၬ ဘဲၫဆၧအုၪဆၧကျၪအၥိၭ, ဘဲၫဆၧကီၩ့ဆၧၥိၭ လၧအဎိၩ့အဎါၥံၪ အၪ့ခွံၬဝ့ၫအၥိၭ နီၪလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> ၦၡၩလၧအအီၪဖျဲၪလၧၦမုၪနီၪ, မွဲအအီၪၡၩနံၩၡၩ",
			"2": "<sup>2</sup> ၥၫ့တၭ,ဎွ့ၩဝ့ၫလၧဆၧခိဆၧဝီၩနီၪလီၫ.- အဝ့ၫဒၪဂဲၫ ထၪ့ဘဲၫဖီၫအၥိၭနီၪတၭ, ဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫနီၪး စဲၪ့ ဘဲၫဆၧလၩၡုၪအၥိၭတၭ, အီၪဂုးခၧၫ့ဝ့ၫနးစီၪ့အ့ၬ.",
			"3": "<sup>3</sup> မွဲနစၪ့ထၪ့နမ့ၬၥၪ လၧၦမၩအၥၭဘဲၫနီၪၥိၭအလီၩ့ဆ့ ဧၪးတၭနမိဒုၭနုၬယၧၩ လၧဆၧစ့ၩရၫ့အဖၧၩ့လၧနၥိၭ",
			"4": "<sup>4</sup> ဆ့ဧၪ.- မွဲပလၫဒုၭဂဲၫထၪ့ဆၧအဆံၫ့ လၧဆၧလဆံၫ့",
			"5": "<sup>5</sup> ဘၪအဖၧၩ့နီၪ, မိၥ့ၪလဂၩလဲၪးအီၪနးဂၩအ့ၬ.- အနံၩ အၥၫ့လဖၪအ့ၪဘၪဆၧဖၭဝဲၩဝ့ၫနီၪ, အလၩလဖၪအ ဆၧဝံထၪ့နၬထၪ့နီၪအ့ၪအီၪလၧနမ့ၬယၫတၭ, နအ့ၪဝၩ့",
			"6": "<sup>6</sup> ထၬဝ့ၫဘဲၫၥိၭအထီးခၫ့ဖၬၥ့ၪလဂ့ၩတၭး- ဘဲၫၥိၭအမိ အီၪပွံၭ, ဒဲမုၬလၩဝ့ၫလၧအမုနံၩအဖၧၩ့,ဘဲၫၦဒိၭအၪ့",
			"7": "<sup>7</sup> လံၩ့အၥၭအၥိၭနီၪ,ကၠၪခွံၬနဝ့ၫလၧအဝ့ၫဒၪဆံၭ.- အ ဂဲးဘဲၫယီၩၥံၪ့လထံၭ, အ့ၪဘၪဆၧခူၬခွံၬဝ့ၫတၭ, မွဲအ မိမဲၪထၪ့ဒီၭ ဒဲဒိၪထၪ့ဝ့ၫလဂၭဂီၩ့ဘၪနီၪ, ယိလါဆၧ",
			"8": "<sup>8</sup> အလးအီၪဝ့ၫလီၫ.- အဝံလၧဂၪ့ခိၪအဖၧၩ့နီၪ ၡါထၪ့",
			"9": "<sup>9</sup> လါနၫ့တၭ,အမိၡါလၧဂၪ့ခိၪဖၧၩ့ၥံၫလါနၫ့နီၪး- မွဲအ အီၩထံၫအကၠီၩ့တၭ, ထိထၪ့ဝ့ၫနီၪမိဒိၭထၪ့ဝ့ၫဘဲၫၥံၪ့",
			"10": "<sup>10</sup> ဖိၪအၥိၭနီၪလီၫ.- အ့ၪမွဲၦၡၩၥံၫဒဲလူၬခွံၬဝ့ၫ, မွဲကဒၪ ယူၭ,ၦၡၩအၥၭစဲၪ့ထၪ့ခွံၬတၭ, မွဲအအီၪခီၫခီၫလဲၪၬ",
			"11": "<sup>11</sup> ဘဲၫထံၫလူၬခွံၬလၧကမၫဖၧၩ့အၥိၭး ဒဲဘဲၫထံၫဖိၪ",
			"12": "<sup>12</sup> ချိၬလၩ့ၥံၭဎဲၫ့ထၬခွံၬဝ့ၫအၥိၭနီၪး- ဘဲၫနီၪၥိၭၦၡၩမံၫ နၩ့ဆ့တၭ,လမိဂဲထုၪ့ဘၪး အဝ့ၫၥံၪလမိနၪ့ထၪ့ထဲၩ့ ဘၪဝ့ၫဆၧလမိထိၪဂဲထုၪ့ဘၪဝ့ၫ လၧအဆၧမံၫမၪအ ဖၧၩ့ထီၩ့လၩ့လၧမူၭခိၪၥံၪလအီၪလၧၩ့ဘၪနီၪလီၫ.",
			"13": "<sup>13</sup> မွဲနအီၪက့ၪၥူၪခွံၬလါယၧၩ လၧဖျႃဖၧၩ့း ဒဲအီၪက့ၪ ၥူၪခွံၬလါယၧၩ ထီးနဆၧၥၭထၪ့နီၪ လ့ၩဖီၩ့ခွံၬတၭ, ဖၭဝဲၩအဆၧၫ့အထီလၧယဂး, ဒဲနၪ့ထၪ့ထဲၩ့ယၧၩ",
			"14": "<sup>14</sup> ဆံၭ.- ၦၡၩအ့ၪၥံၫနီၪ, မွဲအမိမၧၫ့ထၪ့ထဲၩ့ဒီၭဆ့ဧၪး ယဆၧဒုၭၥုၭအနံၩအၥၫ့ထီးအလူၬလဖၪနီၪ, ယမိခိၭ",
			"15": "<sup>15</sup> ယဝ့ၫ,ထီးဆၧအၪ့လဲၩခွံၬယၧၩနီၪလီၫ.- နဝ့ၫဒၪနမိ ကိၭတၭ,ယမိစံၭဆၧၫ့ယဝ့ၫး နဝ့ၫဒၪနၥၭအီၪဝ့ၫလၧ",
			"16": "<sup>16</sup> ဆၧလၧနစူၪမၩကဲၪထၪ့ဝ့ၫနီၪလီၫ.- အဂဲးဘဲၫယီၩဘိၩ့ နဲၪ့ယီၩနဝံထၪ့နၬထၪ့ယခၫထၪ့ဆၧလဖၪး နခိၭယိယ",
			"17": "<sup>17</sup> ဆၧဒဲၩဘၭနီၪမွဲအ့ၬဧၪ.- ယဆၧမၪနီၪဘၪဆၧစဲၩနဲၪ့ ထၬဝ့ၫလၧထိၪ့ဖၧၩ့တၭ, နဆၭဘံၭထၬယဆၧအၧၩ့နီၪ",
			"18": "<sup>18</sup> လီၫ.- ခိၪလီၩ့နီၪလၩ့ထ့ၬတၭ, လၩ့ဘျ့ၭဝ့ၫဒၪတၡါး",
			"19": "<sup>19</sup> ဒဲလိးၥံၪလဲၫ့ၥံၪၥုၭခွံၬအၥၭလၧအလးလီၫ.- ထံၫမၩ လံၩ့လိးၥံၪလဲၫ့ၥံၪတၭ, ထၪ့လုၬဘံၭခွံၬဆၧမၩလၩ့မါ ခွံၬဂၪ့ခိၪအမုၬတၭး ဘဲၫနီၪၥိၭနဝ့ၫဒၪနမၩဂၭဂီၩ့ခွံၬ",
			"20": "<sup>20</sup> ၦၡၩအဆၧယိလါနီၪလီၫ.- နမၩနၧၩ့မၩစၪဝ့ၫလထံၪ ဎးဘီၩ့ဎးတၭ, ထဲၩ့ထဲၩ့ဝ့ၫနီၪး နအၪ့လဲၩခွံၬ အမ့ၬ",
			"21": "<sup>21</sup> တၭ,နဖျါခွံၬအဝ့ၫဒၪလီၫ.- အဝ့ၫဒၪအဖိၪခွၫလဖၪန့ ဘၪဆၧလၩဆၧဖၩ့တၭ,ၥ့ၪယၫဝ့ၫအ့ၬး အဝ့ၫၥံၪဘၪ ဆၧဆၪ့လၩ့ဝ့ၫတၭ, အ့ၪမွဲၥ့ၪယၫအဂဲးနးမံၩ့အ့ၬ.",
			"22": "<sup>22</sup> န့ၫအဖံၭအယၪမိဘၪဆၧခိဆၧဝီၩ လၧအဂးဒၪဝ့ၫဒဲ အၥၭလၧအဖၧၩ့မိအုၭလၧအဂးဒၪဝ့ၫလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ ၦတံမၫဖိၪစအံၫလဲဖၭ ချဲၩ့ဆၧၫ့ဝ့ၫ",
			"2": "<sup>2</sup> တၭ,စံၭဝ့ၫဒၪး- ၦကိၪ့ဆၧၥ့ၪလဂၩနီၪ, မွဲအမိချဲၩ့ ဆၧၫ့ဝ့ၫလၧဆၧၥ့ၪယၫအူၪဖိၫအၥၭ, ဒဲမၩဎွ့ၩအဂူၭဖိၫ့",
			"3": "<sup>3</sup> လၧလံၩမုထၪ့လခီၫနီၪဆ့ဧၪး- မွဲအမိဂဲးလိၬတ့ၭလိၬ လၧဆၧချဲၩ့လန့ကၩဘၪဆၧနီၪ, ဒဲလီၩလၩ့ဆၧလဖၪ",
			"4": "<sup>4</sup> လၧအလဒုၭအီၪထၪ့ဘၪဆၧဂ့ၩနးမံၩ့နီၪဧၪ.- မွဲယူၭ, နနၫ့ဆါဒၪနဝ့ၫခွံၬၡိၭခွံၬဆၧၥၭမဲၪတၭ, နပဒၩ့ဆၧဘၩ",
			"5": "<sup>5</sup> ဆိၪဖၪလၧယွၩအမ့ၬယၫလီၫ.- အဂဲးဘဲၫယီၩနနိၭဒၪ နဝ့ၫလီၩဖျီၪထၪ့နဆၧအၧၩ့တၭ, နရွံန့ၦအၪ့လီၫဆၧအ",
			"6": "<sup>6</sup> ဖျ့ၩနီၪလီၫ.- နနိၭဒၪနဝ့ၫစ့ၩရၫ့စၪနၧၩတၭ, မွဲယၧၩအ့ၬး မွဲကဒၪယူၭ,နနိၭဖျံၩဒၪနဝ့ၫထိးအၥၭ ထၫ့ဒုၪဒၩနၧၩ",
			"7": "<sup>7</sup> လီၫ.- နဝ့ၫဒၪနမွဲၦၡၩအီၪဖျဲၪဆိၫလဂၩနီၪဆ့ဧၪး တၭ လၧခိၪလီၩ့ထိၩ့ချိၬၥံၪလချႃၭအီၪထၪ့ဒံၭဘၪနီၪ, မွဲဆၧ",
			"8": "<sup>8</sup> ဒုၭဂဲၫထၪ့နၧၩဆ့ဧၪ.- ယွၩအဆၧအီၪၥူၪနီၪ, မွဲနနါဂၧၫ့ ယူၭဧၪ.မွဲနဖီၪ့ထၬဆၧကိၪ့ၥ့ၪလၧနနၫ့ဆါဒၪနဝ့ၫအဂး",
			"9": "<sup>9</sup> ဧၪ.- ဆၧလမံၩ့မံၩ့လၧပလၥ့ၪယၫဘၪနီၪ, မွဲနၥ့ၪယၫ ဆၧနီၪလမံၩ့လဲၪး ဆၧလအီၪဘၪလၧပၧၩယီၩ, မွဲနနၪ",
			"10": "<sup>10</sup> ၥ့ၪဆၧနီၪလမံၩ့လဲၪ.- ၦၥၭၡါၥံၪ ဒဲၦခိၪဘွၩယူၭအီၪ",
			"11": "<sup>11</sup> လၧပၥိၭ,ၡါနဲၪ့ဒံၭနဖါနီၪလီၫ.- ယွၩအဆၧမၩမုၬ ထၪ့ဆၧနီၪ,မွဲအဆံၭလၨၪလၧနဂးဆ့ဧၪး ဆၧအီၪၥူၪ",
			"12": "<sup>12</sup> အီၪလၧနဖၧၩ့လမံၩ့မံၩ့ဆ့ဧၪ.- နၥၭဒၪနဝ့ၫမွဲအဆိၬန့ ခွံၬနၧၩအဂဲးဘဲၫၥ့ၪလဲၪ, နဖျၭနမ့ၬလၧဆၧနီၫလၫအ",
			"13": "<sup>13</sup> ကၠီၩ့နီၪလဲၪ.- အဂဲးဘဲၫယီၩနကၠၪနၥၭထၫ့ဒုၪဒၩယွၩ နီၪ,နနိၭဒုၭထၪ့ဖျ့ၭဆၧချဲၩ့ ဘဲၫနီၪၥိၭ အဂဲးဘဲၫၥ့ၪ",
			"14": "<sup>14</sup> လဲၪ.- ၦၡၩလၧအမိအီၪဆံၫ့ဎံၪဝ့ၫနီၪ,မွဲဆၧနီၪလမံၩ့ လဲၪးဒဲၦအီၪဖျဲၪလၧၦမုၪနီၪ, မိတီၩဝ့ၫလီၩ့ဝ့ၫ ဘဲၫၥ့ၪ",
			"15": "<sup>15</sup> လဲၪ.- ယိခွါ,ယွၩဒိၭနဲၩ့အၥၭလၧအၡၩဆံၫ့ဎံၪလဖၪ",
			"16": "<sup>16</sup> ဆ့အ့ၬးဒဲမူၭခိၪၥံၪလၧအမ့ၬၥၪဖၧၩ့ဆံၫ့ဆ့အ့ၬ.- ၦၡၩ လၧအအီၩဆၧအၧၩ့ ဘဲၫထံၫအၥိၭနီၪ, စံၪစၪနၭနဲၪ့",
			"17": "<sup>17</sup> အနီၪဒံၭဆံၭအၪလဲၪ.- ယမိဒုၭနဲၪနၧၩတၭ, ခိၭနၪန ဝ့ၫဘီၪးတၭဆၧလၧယဒၪဘၪလဖၪနီၪ ယမိလီၩဖျီၪ",
			"18": "<sup>18</sup> ထၪ့ဝ့ၫဒၪလီၫ.- ဆၧလၧၦကိၪ့ဆၧၥ့ၪလဖၪလီၩဖျီၪထၪ့ လၧအဝ့ၫၥံၪအဖါလဖၪတၭ, အီၪက့ၪၥူၪခွံၬဆၧနးမံၩ့",
			"19": "<sup>19</sup> အ့ၬ.- ဆၧဖ့ၪလၫ့ထံၫၥံၪခးၥံၪ န့ၫလၧအဝ့ၫၥံၪအစူၪ",
			"20": "<sup>20</sup> ဖၧၩ့တၭ,ၦမွံၩနီၪလဲးလီၩ့ လၧအကျၩနးဂၩအ့ၬ.- ၦ လတီၩလလီၩ့ဘၪလဂၩ ဘၪဆၧဂူၭဆၫ အမုနံၩမုနၩ ထီးအလူၬ, ဒဲနံၪ့ၥံၪလၩၥံၪ လၧဆၧအီၪက့ၪကီၪ့လၧၦ",
			"21": "<sup>21</sup> မၩအၧၩ့မၩၥၫ့ဆၧအဂးနီၪဆ့လီၫ.- ဆၧမၩၥၭမဲၪအ ၥီၫအီၪလၧအနါဖၧၩ့တၭ, လၧဆၧမုၬဆၧဎၩ့အဖၧၩ့",
			"22": "<sup>22</sup> နီၪ,ၦမၩဂၭဂီၩ့ဆၧဂဲၫဘၪအလီၩ့တၭး- မွဲအမိဂၭဖျ့ၭ ထၪ့ခွံၬလၧဆၧခံၭကျၩနီၪနဲၩဝ့ၫအ့ၬး တၭဆၧအီၪက့ၪ",
			"23": "<sup>23</sup> ဝဲၩဝ့ၫလၧနၭၥံၪဖၩ့ၥံၪအဂးလီၫ.- ဂၭဝံၩ့ဝၩ့အၪ့ဎၬ ကိၪတၭ,မွဲအအီၪခီၫခီၫလဲၪး အဝ့ၫဒၪၥ့ၪယၫလၧဆၧ",
			"24": "<sup>24</sup> ခံၭအမုနံၩလၩ့ဘူၭဝ့ၫဒၪလီၫ.- ဆၧခိဆၧဝီၩဒဲဆၧၥုၪ့ အုၭၥၭအုၭ မၩၥၭမဲၪအဝ့ၫတၭး မၩနၧၩ့မၩစၪအဝ့ၫ ဘဲၫစဎွၩအီၪတဲၩ့ဝဲၩအၥၭ လၧဆၧဒုၭၥုၭအဂးလီၫ.",
			"25": "<sup>25</sup> အဂဲးဘဲၫယီၩမွဲအယၩ့ထၪ့အစူၪထၫ့ဒုၪဒၩယွၩ, ဒဲအီၪ က့ၪထၪ့ထီၫအၥၭ ထၫ့ဒုၪဒၩ ၦၥ့ၪဆၧလူၬလဂၩနီၪ",
			"26": "<sup>26</sup> လီၫ.- လၧအခိၬဆီၪ့ဒဲလၧအထၩ့ဖံၭတၪ့နီၪ, မွဲအစဲၪ့",
			"27": "<sup>27</sup> ထၫ့ဒၩအဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩမၩဘံၭခွံၬလၧအမ့ၬ လၧဆၧၥိၪ,ဒဲအီၪက့ၪကီၪ့ဆၧၥိၪ လၧယးဒံၩ့အလီၩ့",
			"28": "<sup>28</sup> လီၫ.- မွဲအအီၪလၧဒိၩ့ၥံၪအီၪယူဝ့ၫနီၪ, လၧအဂံၪ့လ ဖၪၦၡၩအီၪနးဂၩအ့ၬ, လၧဆၧမိဒုၭကဲၪထၪ့ဆၧအ",
			"29": "<sup>29</sup> ပိၩ့လဖၪလီၫ.- အဝ့ၫဒၪမိကဲၪၦၥထံၫအ့ၬ,အဆၧထူၭ ဆၧလၧၫ့အီၪဂုးခၧၫ့ဆ့အ့ၬး အဝ့ၫမိမၩအၪထၪ့စူၪလး",
			"30": "<sup>30</sup> ခၪ့ခိၪလၧဂၪ့ခိၪချိၫ့ဆ့အ့ၬ.- မွဲအမိဂၭဖျ့ၭထၪ့ခွံၬလၧ ဆၧခံၭကျၩနီၪအ့ၬး မ့ၪလၪမိမၩဎဲၫ့ထၬအထဲၩ့ၥံၪဖၫ့ ၥံၪတၭး လၧယွၩအနိၭအၥၪအကၠီၩ့နီၪ, မွဲအမိလ့ၩဖီၩ့ ခွံၬဝ့ၫဒၪလီၫ.",
			"31": "<sup>31</sup> မွဲအထီးဒိၭနဲၩ့အၥၭလၧဆၧအၧၩ့လဂ့ၩး ဆၧမိအၪ့ လီၫန့ဝ့ၫ,အဂဲးဘဲၫယီၩ ဆၧအၧၩ့နီၪမိကဲၪထၪ့အလံၩ့",
			"32": "<sup>32</sup> အလဲၫလီၫ.- လၧအဆၧၫ့အထီ လချႃၭဘၪဒံၭဘၪနီၪ ဆၧလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫတၭ, အထဲၩ့နီၪအီၪယ့ၫလၧၩ့",
			"33": "<sup>33</sup> အ့ၬ.- မွဲအမိတရူၩလၩ့ခွံၬအစဘံၭၥၪအဘၪ့ၥံၪ, ဘဲၫ စဘံၭမုအၥိၭနီၪ, ဒဲဘဲၫအလဲအိၫ့အၥိၭနီၪမိခွံၬၡိၭခွံၬ",
			"34": "<sup>34</sup> အဖီၫၥံၪလီၫ.- အဂဲးဘဲၫယီၩၦဘၪဆၧစံၪစၪနီၪအဂံၪ့ မိအီၪယူဝ့ၫတၭ,မ့ၪမိအၪ့ခွံၬၦဖ့ၪလၬဆီၪ့အတဲၩလဖၪ",
			"35": "<sup>35</sup> နီၪလီၫ.- အဝ့ၫၥံၪဒၧၩ့ထၪ့န့ဆၧအၧၩ့တၭ, ဆိၫ့အီၪန့ ဆၧပျီၩပျီၩနီၪး အဝ့ၫၥံၪအဒၧၩ့လးတဲၩ့ဝဲၩဆၧကဘျံၭ ကဘျၪလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စယိဘၭချဲၩ့ဆၧၫ့ဝ့ၫတၭး စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> ဆၧဘဲၫနီၪၥိၭ ယနါဂၧၫ့အၪအၪလ့ၬတၭး နၥံၪဝ့ၫ ကိၭဂၩဒ့ၭ မွဲၦၡၩမၩမုၬထၪ့ဆၧလၧအလန့ကၩဘၪ",
			"3": "<sup>3</sup> ဆၧလီၫ.- လံၩအဆၧချဲၩ့လဖၪနီၪ, မွဲအထုၬအီၪဆ့ ဧၪးဘဲၫနမိချဲၩ့ဆၧၫ့ဆၧနီၪ, ဆၧနီၫလၫမၩဒူၩနၥၭလ",
			"4": "<sup>4</sup> မံၩ့လဲၪ.- ယဝ့ၫဒၪယချဲၩ့ဆၧဘဲၫနၥံၪအၥိၭ မိၥ့ၪဆ့ တၭးနၥံၪအၥၭအ့ၪအီၪလၧယၥၭအလးတၭး ယတဲၩ့ ဝဲၩဆၧချဲၩ့ၥံၪထၫ့ဒုၪဒၩနၥံၪၥ့ၪတၭ, ယဂံဂုယခိၪလၧ",
			"5": "<sup>5</sup> နၥံၪၥ့ၪဆ့လီၫ.- အ့ၪမွဲယမိမၩဆီၪ့ထၪ့နၥံၪလၧယနိၭ တၭ,ယနိၭဖျံၩအဆၧမၩမုၬနီၪ မိဒုၭဂုးထၪ့နၥံၪလီၫ.",
			"6": "<sup>6</sup> ယချဲၩ့ဆၧလါနၫ့တၭ, ယၥုၪ့အုၭၥၭအုၭ လၩ့ဆါ ထဲၩ့အ့ၬး ယအီၪလၩ့မါပံၭလါနၫ့နီၪ, မွဲအစဲၪ့ဒၪခွံၬ",
			"7": "<sup>7</sup> ယၧၩလဆံၭဆံၭဆ့ဧၪ.- အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ယွၩဒုၭ ပွံၭယၥၭတၭ, နမၩယူၭယဂံၪ့အီၪယူဝ့ၫ ထီးအလူၬ",
			"8": "<sup>8</sup> တၭး- မွဲနစၧၩ့ထၬယၧၩတၭ, အဝ့ၫနီၪကဲၪဆၧထိးအ ၥၭထၫ့ဒၩယၧၩတၭ, ယဆၧဎွ့လၩ့ဂဲထုၪ့ထၫ့ဒၩယၧၩ",
			"9": "<sup>9</sup> တၭ,ထိးအၥၭလၧယမ့ၬယၫလီၫ.- အဆၧၥၭထၪ့အဲၪ့ ၡၫ့ယၬယၧၩ, ဒဲလီၩ့ဆီးယၧၩး မွဲအအဲၪ့ဂံၬအၥွၫလၧ ယလီၩ့တၭ, ယဒုၪယဒၩကျဲၩ့အမ့ၬၥၪ လၧယလီၩ့",
			"10": "<sup>10</sup> လီၫ.-အဝ့ၫၥံၪအၩ့ထၪ့အနိၭ လၧယလီၩ့တၭးလၧ ဆၧဒုၪဒွ့ၪနီၪ, အဝ့ၫၥံၪဒဲၩယနိၭဖၩထံၭတၭး အီၪကီၪ့ ထၫ့ဒုၪဒၩၡီၩ့ယၧၩလီၫ.",
			"11": "<sup>11</sup> ယွၩဖ့ၪလၫ့ခွံၬယၧၩလၧၦအၧၩ့အစူၪဖၧၩ့, ဒဲခွံၬလၩ့ ယၧၩလၧၦမၩအၧၩ့မၩၥၫ့ ဆၧလဖၪအစူၪဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> ယအီၪဘၪယူၭမုၬမုၬတၭ, မွဲအမၩခါခွံၬယၧၩတၭ, ဖီၪ့ထၬယခိၬတၭ, ခွံၬလၩ့ဘျ့ၭယၧၩတၭ, အီၪက့ၪ",
			"13": "<sup>13</sup> ယၧၩလၧဆၧမၩနဲၪ့အလးလၧအဂးနီၪလီၫ.- အၡၩ ခၭဆၧဖိၪလဖၪအီၪဖီၩ့ယၧၩဝၬဝၬတၭ, မၩထ့ဖၭယ လ့နီၪ,လီၫ့ကီၩ့ဝ့ၫအ့ၬ, မွဲအလူၫလၩ့ခွံၬယဒံၩလၧဂၪ့",
			"14": "<sup>14</sup> ခိၪအလီၩ့လီၫ.- မွဲအမၩလၩ့ဘျ့ၭယၧၩ လၧဆၧမၩ လၩ့ဘျ့ၭအဖၫ့ခိၪတၭ, စဲၪ့ၡိၫဆၧလၧယလီၩ့ဘဲၫၦဒုၭ",
			"15": "<sup>15</sup> ၥုၭအၥိၭနီၪလီၫ.- ယဆၭရၧၬအဆၧယၬ လၧယဖံၭ အလီၩ့တၭ, ယမၩစံၪစၪယနိၭ လၧဂၪ့ခိၪမုၬအကျၩ",
			"16": "<sup>16</sup> နီၪလီၫ.- ယမ့ၬဝီၩထၪ့လၧယမ့ၬထံၫလၩ့အကၠီၩ့, ဒဲ",
			"17": "<sup>17</sup> ဆၧၥံၫအလၩၡုၪအီၪလၧယမ့ၬဖံၭအလီၩ့တၭး- လၧ ယဆၧလတီၩလလီၩ့ဘၪ အကၠီၩ့နီၪမွဲအ့ၬး ဒဲယဆၧ",
			"18": "<sup>18</sup> ဘၩဆိၪဖၪနီၪဆံၫ့ဝ့ၫဒၪလီၫ.- ဂၪ့ခိၪဧ့, ထီးမၩလၩ့ ဘံၭခွံၬယၥွံၪလဂ့ၩး ဒဲယဆၧကိၭၡၭထၪ့နီၪ, မွဲအထီး",
			"19": "<sup>19</sup> အီၪလၧဆၧအီၪပွံၭအလးနးစီၪ့လဂ့ၩၬ- ဘိၩ့နဲၪ့ယီၩ ဒၪလ့ၬ,ယိခွါ, ယဆၧထိးအၥၭအီၪလၧမူၭခိၪအဖၧၩ့,",
			"20": "<sup>20</sup> ဒဲယၡၩထိးအၥၭအီၪလၧထၭနီၪလီၫ.- ယထံၩယၥိၭ မၩကြၩ့ထမးယၧၩတၭး ယမ့ၬၥၪလူၫလၩ့မ့ၬထံၫလၧ",
			"21": "<sup>21</sup> ယွၩအမ့ၬယၫး- ဘဲၫၥိၭအမိမၩတီၩမၩလီၩ့ၦၡၩလၧ ယွၩ,ဘဲၫၦၡၩမၩဝ့ၫလၧအထံၩအၥိၭ အၥိၭနီၪလီၫ.",
			"22": "<sup>22</sup> ထီးၡၩနံၪ့ၡၩလၩအ့ၪဖီၩ့ခွံၬတၭး ယမိလ့ၩလၧဖၧၩ့ ၥၭ,လၧယလဂဲၫထဲၩ့လၧၩ့ဘၪလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ယၥၪလူၬယူၭ, ယမုနံၩမုနၩၥံၪအီၪလၧၩ့အ့ၬး ၥွၪ",
			"2": "<sup>2</sup> ခိၪဖၧၩ့နီၪအီၪခိၭဝဲၩလၧယဂးလီၫ.- မွဲမၬ,ၦမၩကြၩ့ ထမးဆၧနီၪမၩထံၬထၬယၧၩတၭ, ယမ့ၬၥၪအီၪဝ့ၫလၧ",
			"3": "<sup>3</sup> အဝ့ၫၥံၪအဆၧမၩခိမၩဝီၩအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.- အီၪ က့ၪလၩ့လါဆၧပီၩ့လၩ့လမံၩ့တၭ, ကဲၪထၪ့နဝ့ၫဆၧ အုၩ့လၩ့လိၬလၧယၧၩဆံၭ. မွဲပလၫမိဖ့ၪလၫ့အစူၪ",
			"4": "<sup>4</sup> လၧယစူၪအဂးလဂၩလဲၪ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအ ၥၭနအီၪက့ၪကဒုၩခွံၬလၧဆၧကိၪ့ၥ့ၪကိၪ့ဘၪး မၩအ ၥၭဘဲၫနီၪတၭ, နမိအီၪက့ၪထၪ့ထီၫအဝ့ၫၥံၪဆ့အ့ၬ.",
			"5": "<sup>5</sup> ၦလၧအဖ့ၪလၫ့ခွံၬအထံၩအၥိၭလၧ ဆၧအၪ့ဂူၬန့အဂး နီၪ,အဝ့ၫဒၪအဖိၪအလံၩအမ့ၬၥၪဒၪလ့ၬ မိလူၬဝ့ၫဒၪ လီၫ.",
			"6": "<sup>6</sup> ယွၩအီၪက့ၪလၩ့ယၧၩ လၧဆၧချဲၩ့ဒီၩ့လၧၦခမျၧး",
			"7": "<sup>7</sup> ၥံၪအဂး ယကဲၪၦလၧဆၧထိၪဖျံၭအမ့ၬလီၫ.- ယမ့ၬ ခံၭလၧဆၧခိဆၧဝီၩအကၠီၩ့တၭး ယဂၩ့ထီးအလူၬၥံၪ",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫဆၧလၩၡုၪအၥိၭလီၫ.- လၧဆၧလမံၩ့ ယီၩအကၠီၩ့ ၦအတီၩအလီၩ့ထီၫမံၫထီၫမၪဝ့ၫတၭး ၦ လၧအဆၧမၪလအီၪဘၪ မိဘၪဆၧထိၪဂဲထုၪ့ထၫ့ဒၩၦ",
			"9": "<sup>9</sup> လၧအလဆံၫ့ဘၪလဖၪနီၪလီၫ.- အ့ၪမွဲၦအတီၩအ လီၩ့မိဖီၪ့ထၬအဖၧၩ့ၥၭ, ဒဲၦလၧအစူၪဆံၫ့ဝ့ၫနီၪအဂဲး",
			"10": "<sup>10</sup> အဘၭမိအၪထၪ့ဝ့ၫဆ့လီၫ.- အ့ၪမွဲနၥံၪဝ့ၫထီးအလူၬ ဂဲၫထဲၩ့တၭ, ဂဲၫလါဘိၩ့နဲၪ့ယီၩဘီၪး ၦလၧအကိၪ့ၥ့ၪ လၧနၥံၪအကျၩယဒၪနးဂၩအ့ၬ.",
			"11": "<sup>11</sup> ယမုနံၩလဖၪ ဖီၩ့ခွံၬယူၭ, ယဆၧကိၪ့လဖၪ, ဒဲယ ဆီၫ့မီၪ့ဆၧလၧယၥၭခံဖၧၩ့လဖၪ ဘၪဆၧမၩခါခွံၬဝ့ၫ",
			"12": "<sup>12</sup> လီၫ.- အဝ့ၫၥံၪအၪ့လဲၩမုနၩလၧမုဆၫအဂးတၭး ဆၧ",
			"13": "<sup>13</sup> ဖၩ့နီၪအီၪဘူၭလၧဆၧခံၭလီၫ.- ယိခွါ,ယယိလါလၧ ဖျႃဖၧၩ့နီၪမိကဲၪယဂံၪ့တၭး ယဒၩလၩ့ယလးမံၫလၧ",
			"14": "<sup>14</sup> ဆၧခံၭကျၩလီၫ.- ယစံၭယူၭ, ဆၧအုၪဆၧကျၪဧ့,နမွဲ",
			"15": "<sup>15</sup> ယဖါ,လိၪ့ဧ့,နမွဲယမိ, ဒဲယထၧၫ့ဖုဝဲမုၪလီၫ.- အ့ၪမွဲ ဘဲၫနီၪတၭ ယဆၧယိလါနီၪ, မိအီၪခီၫခီၫလဲၪး တၭယ",
			"16": "<sup>16</sup> ဆၧယိလါနီၪ, မွဲပလၫမိဒၪဘၪဝ့ၫလဂၩလဲၪ.- မွဲအမိ လ့ၩလၩ့ဝ့ၫလၧဖျႃဖၧၩ့အနိၪဘီၩ့ၥံၪအအီၪနီၪ, ထီးအ လးပမိအီၪပွံၭစီၪ့ဎးလၧဂၪ့ခိၪမုၬအကျၩနီၪလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ၦၡုအၫဖိၪစဘံလဒၭချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> နၥံၪမိအၪ့ဎၬဆၧချဲၩ့လဖၪဆံၭယံၬလဲၪး နၪၥ့ၪနၥံၪ",
			"3": "<sup>3</sup> ဝ့ၫဘီၪးလၧခဲၫ့ထဲၩ့တၭပမိချဲၩ့ထၪ့ဆၧလီၫ.- ဆၧအီၪ က့ၪပၧၩဘဲၫဆၧဖိၪဆၧဎါအၥိၭနီၪ, ဒဲၦလဆံၫ့ဘၪလၧ",
			"4": "<sup>4</sup> နၥံၪအမ့ၬယၫ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- ၦလၧအအဲၪ့ၡၫ့ လၩ့အနၫ့ဆါလၧအဆၧၥၭထၪ့အဖၧၩ့နီၪး လၧနဝ့ၫ ဒၪအကၠီၩ့နီၪ, မွဲဂၪ့ခိၪမိဘၪဆၧစဲၪ့ဒၪဝ့ၫ, ဒဲလိးၥံၪလဲၫ့ ၥံၪဘၪဆၧၥုၭခွံၬလၧအလးနီၪဆ့ဧၪ.",
			"5": "<sup>5</sup> မွဲမၬ, ၦအၧၩ့လဖၪအဆၧဖၩ့နီၪမိလၩ့ဖံၬခွံၬဝ့ၫ, ဒဲ",
			"6": "<sup>6</sup> အမ့ၪလၪနီၪမိဖၩ့ထၪ့လၧၩ့အ့ၬ.- ဆၧဖၩ့နီၪမိခံၭလၩ့ ဝ့ၫလၧအတဲၩဖၧၩ့တၭ, အမ့ၪဒိၩ့နီၪ မိလၩ့ဖံၬခွံၬဝ့ၫဒၪ",
			"7": "<sup>7</sup> လီၫ.- အဆၧခၫထၪ့ဆီၪ့လဖၪ မိလၩ့အဲၪ့ဝ့ၫဒၪတၭ, အဆၧဒုၭကိၪ့လၩ့ဒၪအၥၭနီၪ မိခွံၬလၩ့ခွံၬအဝ့ၫလီၫ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩမွဲအလၩ့ထံၩဖါလၧၡၬဖၧၩ့ လၧအခၪ့ဒၪ ဝ့ၫအကၠီၩ့, ဒဲအလ့ၩဆၧလၧဖျံၩခွၩ့ၥံၪအဖၫ့ခိၪလီၫ.",
			"9": "<sup>9</sup> ဖျံၩခွၩ့နီၪမိဖီၪ့အခၪ့နိးခဲၫ့တၭ, ထမျၬမိဖီၪ့ထၬခၧၫ့ဝ့ၫ",
			"10": "<sup>10</sup> ဒၪလီၫ.- ဖျံၩနီၪအီၪၥူၪဝ့ၫလၧဂၪ့ခိၪအဖၧၩ့တၭ, အ",
			"11": "<sup>11</sup> ခွၩ့အီၪလၧဖၧၩ့ၥၭဖၧၩ့နီၪလီၫ.- ဆၧၥၭမဲၪလဖၪအီၪ ဖီၩ့ဝၬဝၬနီၪ, ဒဲလီၩ့ဆီးဝ့ၫလၧအခၫထၪ့လဖၪ အဂၩ့",
			"12": "<sup>12</sup> ထံၭနီၪလီၫ.- အဂဲးအဘၭလၩ့ဘဲၩဝ့ၫလၧဆၧၥၭဝံအ ၥၭအကၠီၩ့တၭ, ဆၧမၩဂၭဂီၩ့ အီၪတဲၩ့ဝဲၩအၥၭလၧ",
			"13": "<sup>13</sup> အနဲၩ့ထံၭလီၫ.- အဆၧအၪ့ဆၫခွံၬအဎွံၪအနၧၩ့တၭ,",
			"14": "<sup>14</sup> ဆၧၥံၫအဖိၪဝဲၡါမိအၪ့ခွံၬအဂဲးအဘၭလီၫ.- အဆၧ ဒိၭနဲၩ့အၥၭနီၪ မိဘၪဆၧထ့ၭခွံၬဝ့ၫလၧအတဲၩဖၧၩ့, ဒဲအနၫ့ဆါဘၪဆၧၥိၫ့ဝ့ၫ လၧဆၧၥၭမဲၪအစဎွၩအအီၪ",
			"15": "<sup>15</sup> နီၪလီၫ.- ဆၧလၧအလမွဲဘၪအဆၧဒၪဝ့ၫမိအီၪလၧအ တဲၩဖၧၩ့တၭ, ဆၧမိဎွံၪကး လၧအအီၪဝ့ၫအလးနီၪ",
			"16": "<sup>16</sup> လီၫ.-လၧအဖၫ့လၬလခီၫအဝံလဖၪမိဎဲၫ့ထၬဝ့ၫတၭ, လၧအဖၫ့ခိၪလခီၫ, အထဲၩ့မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ",
			"17": "<sup>17</sup> လီၫ.- အဆၧနၪ့ထၪ့ထဲၩ့နီၪလၩ့မါလၧဂၪ့ခိၪချိၫ့ယီၩ တၭ,အမံၩ့လၧဆံၬၥံၪနၩၥံၪအလီၩ့ အီၪနးစီၪ့အ့ၬ.",
			"18": "<sup>18</sup> ဆၧမိနၫ့ထၪ့ခွံၬအဝ့ၫလၧဆၧဖၩ့အကျၩ, ထီၩ့လၧဆၧ ခံၭကျၩ,ဒဲမိဘၪဆၧနၫ့ထၪ့ခွံၬလၧဂၪ့ခိၪချိၫ့ယီၩလီၫ.",
			"19": "<sup>19</sup> မွဲအဖိၪအလံၩၥံၪအီၪလၧ ၦၡၩခမျၧးအကျၩနးစီၪ့အ့ၬ,",
			"20": "<sup>20</sup> ဒဲၦအီၪလၩ့ထးလၧအအီၪဝ့ၫ အလးနီၪနးဂၩအ့ၬ.- ၦ ၡၩလၧအဝ့ၫဒၪအလးခဲၫ့ မိထီၫမံၫထီၫမၪလၧအမုနံၩ အကၠီၩ့တၭးၦလၧအဝ့ၫဒၪ အဆိၩလဖၪမိၥၭမဲၪၥၭ",
			"21": "<sup>21</sup> ဖျဲၩ့ဆၧလီၫ.- မွဲမၬ,ၦၡၩအၧၩ့အီၪဝ့ၫအလးလဖၪနီၪ မွဲဘဲၫနီၪၥိၭတၭ, ၦလၧအလၥ့ၪယၫဘၪယွၩနီၪ, အလး မွဲဘဲၫနီၪၥိၭလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့စယိဘၭချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> နၥံၪမိမၩဆၫယၥၭ, ဒဲမၩလၩ့ဘျ့ၭယၧၩလၧဆၧချဲၩ့",
			"3": "<sup>3</sup> လဖၪနီၪဆံၭယံၬလဲၪး- ဆံၫဘျၩ့ယီၩနၥံၪဒုၪဒွ့ၪယၧၩ",
			"4": "<sup>4</sup> တၭ,နၥံၪမၩထုၬထုၩယၥၭး မွဲနၥံၪမ့ၬမဲအ့ၬဧၪ.- ယ အ့ၪမၩမၪဘၪဆၧတၡါတၭ, ယဆၧအမၪနီၪအီၪဝ့ၫ",
			"5": "<sup>5</sup> လၧယလီၩ့ဒၪယဝ့ၫလီၫ.- နအ့ၪမၩဖိၫလိၫတၡါနၥံၪ အၥၭထၫ့ဒုၪဒၩယၧၩတၭ, ထီးနီၪလဖၧၫ့နဲၪဖျီၪထၪ့",
			"6": "<sup>6</sup> ဆၧဒုၪဒွ့ၪယၧၩဘီၪ.- ဘိၩ့နဲၪ့ယီၩၥ့ၪယၫလၧယွၩ မၩကဒၪထဲၩ့ယမူၭတၭ, အၡၬနီၪမွဲအခွံၬဝၬဖီၩ့ယၧၩ လီၫ.",
			"7": "<sup>7</sup> ယိခွါ, ယကိၭၡၭထၪ့လၧဆၧမၩဆီၪ့ယၧၩအကၠီၩ့ တၭ,ဆၧလခိၭနၪဘၪယလူနီၪး ယကိၭၥီၫထၪ့တၭ,",
			"8": "<sup>8</sup> ဆၧစ့ၩရၫ့တီၩအီၪနးစီၪ့အ့ၬ.- ယွၩထနါထၬယူၭယ ဖၧၩ့ၥၭထီးယလ့ၩလဖိးဘၪး ဒဲမၩခံၭလၩ့ယူၭ ယ",
			"9": "<sup>9</sup> ဖၧၩ့ၥၭနီၪလီၫ.- အဝ့ၫဒၪဘဲၪ့လၩ့ခွံၬယူၭယဆၧလၩ ဆၧဖၩ့,ဒဲအမၩန့ထၪ့ခွံၬ ၥရဖူၩလၧယခိၪဎွံၪနီၪလီၫ.",
			"10": "<sup>10</sup> မွဲအမၩဂၭဂီၩ့ယၧၩဝၬဝၬတၭ, ယဂၭဂီၩ့ယဝ့ၫလူၬ ယူၭ,ယဆၧယိလါနီၪ မွဲအဒုၭခၨခွံၬဝ့ၫဘဲၫၥံၪ့လထံၭ",
			"11": "<sup>11</sup> အၥိၭနီၪလီၫ.- အၥၭထၪ့နီၪမွဲအဒုၭခဲၩထၪ့ထၫ့ဒၩ ယၧၩတၭးမွဲအအီၪက့ၪယၧၩဘဲၫအဒုၪအဒၩၥံၪ အ",
			"12": "<sup>12</sup> ၥိၭနီၪလီၫ.- အၡၩၥုၭဖိၪအဒီၪ့ၥံၪဂဲၫစီၪ့ဎးတၭး အဝ့ၫ ၥံၪမၩထၪ့အဖၧၩ့ၥၭလၧယအီၪတၭ, မၩထၪ့အတဲၩလ",
			"13": "<sup>13</sup> ဖၪအီၪဝၬဖီၩ့ယၧၩဝၬဝၬဆ့လီၫ.- မွဲအၥုၭခွံၬယထၧၫ့ဖုဝဲ ၥံၪယဲၩ့လၧယအီၪတၭး ၦလၧအၥ့ၪယၫယၧၩလဖၪ မၩအၥၭလၧယမ့ၬယၫ ဘဲၫၦလခီၫဘၩ့မုးဖိၪအၥိၭနီၪ",
			"14": "<sup>14</sup> လီၫ.- ယဘူၭယထံးၥံၪဂဲၫဘူၭယၧၩအ့ၬး ၦလၧအၥ့ၪ",
			"15": "<sup>15</sup> ယၫလိၬအၥၭလၧယၧၩ ၥၭနၪ့ခွံၬယူၭယၧၩလီၫ.- ၦ လၧအအီၪမွံၩလၧယဂံၪ့ဖၧၩ့, ယခ့ၫယၡၩမုၪၥံၪဒၪ လ့ၬ,အီၪက့ၪယၧၩဘဲၫၦလခီၫဘၩ့မုးဖိၪအၥိၭနီၪး ယ",
			"16": "<sup>16</sup> မွဲဘဲၫၦမွံၩလဂၩလၧအဝ့ၫၥံၪအမ့ၬၥၪဖၧၩ့လီၫ.- ယ ကိၭထၪ့ ယခ့ၫယၡၩတၭ, အဝ့ၫစံၭဆၧၫ့ယၧၩအ့ၬး",
			"17": "<sup>17</sup> တၭယအၪ့ကံၩ့အၪ့ယၫအဝ့ၫလၧယနိၭလီၫ.- ယမၫ နီၪအီၪက့ၪယၥၪ ဘဲၫဆၧၥၭလိၪအၥိၭတၭး ယအၪ့",
			"18": "<sup>18</sup> ကံၩ့အၪ့ယၫအဝ့ၫ လၧယဖိၪဒၪယဝ့ၫအကၠီၩ့လီၫ.- မွဲ မၬ, ဖိၪဒံၩဖိၪၥၪလဖၪမၩကြၩ့ထမးယၧၩတၭ, ယဂဲ",
			"19": "<sup>19</sup> ထုၪ့နီၪအဝ့ၫၥံၪချဲၩ့ထၪ့ထၫ့ဒုၪဒၩယၧၩလီၫ.- ယထံၩ ယၥိၭထီးအလူၬလဖၪ အီၪက့ၪယၧၩ ဘဲၫဆၧစံၪစၪအ ၥိၭတၭး ၦလၧယအဲၪဝ့ၫလဖၪနီၪကၠၪအၥၭထၫ့ဒုၪဒၩ",
			"20": "<sup>20</sup> ယၧၩလီၫ.- ယဎွံၪဘုၭထၬလိၬအၥၭလၧယဖံၭ ဒဲယ",
			"21": "<sup>21</sup> ယၪတၭယဖျ့ၭၥၫန့ၫလၧယၥွၫ(မဲၪ) အဖံၭလီၫ.- ယ ထံၩယၥိၭ, နၥံၪဝ့ၫဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭယၧၩ, ယၫ့ၥုၪ့ ယၫ့ၥၭယၧၩဆံၭး အဂဲးဘဲၫယီၩ ယွၩအစူၪနီၪ ထိၭ",
			"22": "<sup>22</sup> ဘၪယၧၩလီၫ.- နၥံၪမၩအၧၩ့မၩၥၫ့ယၧၩ ဘဲၫယွၩအ ၥိၭ,ဒဲယဖံၭယယၪလမၩမံၫ့ၥုၪ့မံၫ့ၥၭဘၪနၥံၪနီၪ, မွဲ အဂဲးဘဲၫၥ့ၪလဲၪ.",
			"23": "<sup>23</sup> ယဆိၫ့လၧယချဲၩ့ဆၧလဖၪ မိအီၪကွ့ၭနဲၪ့အၥၭ,ဒဲ",
			"24": "<sup>24</sup> လၧအဘၪဆၧဖျၩန့ဝ့ၫလၧလံၬဖၧၩ့နီၪဆံၭ.- ဒဲလၧ အဘၪဆၧကွ့ၭအၥၭလၧထၭဘီၩ့, ဒဲၡၬၥၧၫ့း ဘၪဆၧ ဖျၩန့ဝ့ၫလၧလိးအလီၩ့ အဆိၩဆိၩ အကၠၪကၠၪနီၪ",
			"25": "<sup>25</sup> ဆံၭ.- အဂဲးဘဲၫယီၩ ယၥ့ၪယၫၦလၧအဎွ့ၩန့ထဲၩ့ ယၧၩလဂၩနီၪ မၧၫ့ဝ့ၫတၭ, လၧခဲၫ့ထဲၩ့နီၪမွဲအမိဂဲၫ",
			"26": "<sup>26</sup> ဆၧၫ့ထုၪ့လၧဂၪ့ခိၪချိၫ့ယီၩး- ဒဲလၧယဖံၭယယၪယီၩ ဘၪဆၧမၩဂၭဂီၩ့ဝ့ၫအလးခဲၫ့, လၧယဖံၭယယၪလ",
			"27": "<sup>27</sup> အီၪဘၪနီၪ,ယမိဒၪဘၪယွၩဆ့လီၫ.- ထီးယလ့လဖၪ လူၬခွံၬဝ့ၫလၧယဖၧၩ့တၭ,ယမိဒၪဘၪအဝ့ၫဒၪလၧယ ဂးဒၪယဝ့ၫတၭ,ယမ့ၬၥၪဒၪယဝ့ၫမိဒၪဘၪတၭ, မွဲဂူၫ ဂၩအ့ၬ.",
			"28": "<sup>28</sup> မၩအၥၭဘဲၫနီၪတၭ, နၥံၪအ့ၪစံၭ, ပမၩအၧၩ့အဝ့ၫ နီၪမွဲအဂဲးဘဲၫၥ့ၪလဲၪတၭး ဆၧဂ့ၩအဝံနီၪအီၪလၧယ",
			"29": "<sup>29</sup> ဖၧၩ့လီၫ.- နၭၥံၪဖၩ့ၥံၪၥၭမဲၪနၥံၪဝ့ၫဆံၭး အဂဲးဘဲၫ ယီၩနၭၥံၪဖၩ့ၥံၪအဆၧမၩအၧၩ့နီၪ, အီၪဝ့ၫလၧၦၥၭ ထၪ့အဂး,ဘဲၫနၥံၪမိၥ့ၪယၫ လၧဆၧစ့ၩရၫ့နီၪအီၪဝ့ၫ လီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ ၦနၫအမၭဖိၪစဇိဖၫချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဆၧဆီၫ့မီၪ့လဖၪထိၪဂဲၩ ယၧၩဘဲၫယမိချဲၩ့ဆၧၫ့ဆၧ, အခိးမွဲယမိမၩချဲၫ့ဆ့",
			"3": "<sup>3</sup> လီၫ.- ဆၧအၪ့ၥီၪ့ဆီၪ့ဒုၭမ့ၬမဲယၧၩနီၪ, ယနါဂၧၫ့ယူၭ တၭ,ယနၪၥ့ၪဆၧအၥၭနီၪ ဒုၭစံၭဆၧၫ့ဆၧလီၫ.",
			"4": "<sup>4</sup> လၧဖျိၩ့, ခီၫလၧဆၧအီၪက့ၪၦၡၩလၧဂၪ့ခိၪချိၫ့ယီၩ ၦအၧၩ့ဖိၪၥံၪအဆၧၥုၪ့ဎွံၪၥၭယီၫနီၪ မွဲလယံၬဘၪ, ဒဲ ၦအၪ့လီၫဆၧ အဆၧၥုၪ့ထိၬၥၭထိၬ အီၪလဆိဖိၪနီၪ,",
			"6": "<sup>6</sup> ဆၧလမံၩ့ယီၩနၥ့ၪယၫနဝ့ၫအ့ၬဧၪ.- အဆၧထၪ့ထီၫ နီၪထၪ့ဘၭလါနၫ့လၧမူၭခိၪ, ဒဲအခိၪဎွံၪထၪ့ဘၭလါနၫ့",
			"7": "<sup>7</sup> လၧဆၧအုၪ့လဖၪး- ဘဲၫအဆၧဒိၪဆၧထီၫအီၪဝ့ၫအ ၥိၭ,အဆၧဂၭဂီၩ့နီၪမိဘၪဝ့ၫဘဲၫနီၪၥိၭ အဆိၩဆိၩအ ကၠၪကၠၪတၭး ၦလၧအဒၪဘၪဝဲၩဝ့ၫလဖၪနီၪ,မိစံၭ,အ",
			"8": "<sup>8</sup> ဝ့ၫဒၪအီၪခီၫခီၫလဲၪ.- ဘဲၫဆၧမံၫမးအၥိၭ, မွဲအယူၩ ခွံၬဝ့ၫတၭ, ဆၧဒၪဘၪဝ့ၫနးစီၪ့အ့ၬး တၭမွဲအမိလၩ့မါ ဝ့ၫဘဲၫဆၧဒၪဆၧလၧယၫ လၧမုနၩလခီၫ အၥိၭနီၪ",
			"9": "<sup>9</sup> လီၫ.- မ့ၬၥၪလၧအဒၪဘၪဝဲၩဝ့ၫနီၪ မိဒၪဘၪလၧၩ့ဝ့ၫ",
			"10": "<sup>10</sup> အ့ၬ,ဒဲအလးအကျဲၩနီၪယိဘၪလၧၩ့အဝ့ၫအ့ၬ.- ၦၡၪ့ ဖိၪယၬဖိၪၥံၪ မိမၩနၧၩ့မၩစၪအဖိၪခွၫလဖၪတၭ, အ ဝ့ၫဒၪအစူၪမိဖ့ၪထဲၩ့အဝ့ၫၥံၪ အဆၧဖိၪဆၧလံၩလီၫ.",
			"11": "<sup>11</sup> အဎွံၪလဖၪဎွ့ၩထၪ့လၧအၥၭဘၪ့လါနၫ့ဘိၩ,မွဲအမိမံၫ နၩ့လၧအၥိၭလၧဂၪ့ခိၪမုၬအကျၩနီၪလီၫ.",
			"12": "<sup>12</sup> ဆၧအၧၩ့နီၪဆၧၫ့လါနၫ့လၧအနိၭဖၧၩ့တၭ, မွဲအအီၪ",
			"13": "<sup>13</sup> က့ၪၥူၪခွံၬလါနၫ့ လၧအဖျ့ၩအဖၫ့လၬတၭး- လီၫ့ကီၩ့ လဖျါခွံၬဘၪဝ့ၫလါနၫ့နီၪး မွဲအအၪ့မိၩဝ့ၫလါနၫ့တၭး",
			"14": "<sup>14</sup> အဆၧအၪ့အီၪလၧအဂူၭဖိၫ့ဖၧၩ့နီၪ ကဲၪထၪ့ဆၧလၩ့ မဲၩဒၪဆၧတၭး ဂူၥၫ့အဒံၩ အီၪလၧအဝ့ၫဒၪ အဖၧၩ့",
			"15": "<sup>15</sup> လီၫၬ- အဝ့ၫယုလၩ့လါနၫ့ ဆၧလူဒိၪဎွ့ၩဒိၪၥံၪ, မိဘၪ ပၠိၭထၪ့ခွံၬဒီၭဝ့ၫး ယွၩမိဒုၭဂဲၫထၪ့ခွံၬအဝ့ၫၥံၪ လၧအ",
			"16": "<sup>16</sup> ဂူၭဖိၫ့ဖၧၩ့လီၫ.- မိအၪ့ဆူၭဂူၥၫ့ၥံၪအစုၪတၭး ဂူပွ့ၩ",
			"17": "<sup>17</sup> အဖျ့ၩမိမၩၥံၫအဝ့ၫလီၫ.- ထံၫချိၬလဖၪ, န့ၫစၩ့ဒဲဆၧ",
			"18": "<sup>18</sup> နူထံၫအချိၬလဖၪလၩ့ယွၩနီၪမိဒၪဘၪဝ့ၫအ့ၬ.- အမၩ ဆၧအၥၪနီၪ, မွဲအဘၪဖ့ၪထဲၩ့ဝ့ၫတၭ, အၪ့ဘၪဝ့ၫအ့ၬ မၩအၥၭဘဲၫဆၧလၧအအၪ့လီးဝ့ၫအၥိၭနီၪတၭ, မိၥုၪ့",
			"19": "<sup>19</sup> ထိၬၥၭထိၬ လၧအဖၧၩ့ဆ့အ့ၬ.- အဂဲးဘဲၫယီၩမွဲအ မၩအၧၩ့မၩၥၫ့,ဒဲစဲၪ့ဒၪခွံၬၦၡၪ့ဖိၪယၬဖိၪတၭ, အၪ့ဂူၬ",
			"20": "<sup>20</sup> န့ဆီၪ့ဂံၪ့လၧအလမၩထၪ့ဘၪဝ့ၫနီၪလီၫ.- မွဲမၬလၥ့ၪ ယၫဘၪဆၧအမုၬလၧအၥၭခံဖၧၩ့တၭ, ကယဲဆၧလၧ အဘၪအၥၭ ထီးအလူၬလဖၪနီၪ မွဲအမိန့ဘၪဖီၪ့ထၬ",
			"21": "<sup>21</sup> နးမံၩ့အ့ၬ.- လၧအၥၭဝံဆၧလိဖၭနီၪ, ဆၧဖီၩ့ဖျ့ၭဝ့ၫ နးမံၩ့အ့ၬး အခိးမွဲအဘၪ ဆၧဘီၪဆၧယီၫနီၪ အီၪဂုး",
			"22": "<sup>22</sup> ခၧၫ့ၥ့ၪအ့ၬ.- လၧအဆၧအၪလၨၪဎွ့ၩလၨၪအဖၧၩ့နီၪ မိဘၪဆၧအၡၪ့တၭး ၦၡၩအၧၩ့အစူၪထီးအလူၬမိအီၪ",
			"23": "<sup>23</sup> လၧအလီၩ့လီၫ.- ဘဲၫၥိၭအမိမၩဎွ့ၩအဂူၭဖိၫ့နီၪတၭ, ယွၩမိခွံၬလၩ့အဆၧၥၭထၪ့လၧအလီၩ့, ဒဲမၩဆၧၩ့လၩ့",
			"24": "<sup>24</sup> အဆၧအၪ့ဆၧအီၩလၧအလီၩ့လီၫ.- အ့ၪစဲၪ့ဂၭဖျ့ၭဖၩ့ ထၭနီၪ, ချံၪထီးဝီၩအဖျါ မိဘၪဆ့ၭဖျီၫ့အဝ့ၫဒၪလီၫ.",
			"25": "<sup>25</sup> ထုၭထၪ့ခွံၬဝ့ၫနီၪ, ဂဲၫထၪ့လၧအမိၡါဖၧၩ့, စူၪဝဲၩယုၩ့ ယဲနီၪဂဲၫထၪ့လၧအဒံၩဖၧၩ့နီၪၬ ဆၧမၩၥၭမဲၪနီၪအီၪ",
			"26": "<sup>26</sup> လၧအလီၩ့လီၫ.- ကယဲဆၧခံၭထီးအလူၬဘၪဆၧအီၪ က့ၪကီၪ့ဝ့ၫအီၪလၧအဎၧၩ့အဎီအဂးတၭး မ့ၪလၧၦလ အူၪခဲၩထၪ့ဘၪနီၪ မိအၪ့ခွံၬဝ့ၫတၭ, မိအၪ့ဂၭဂီၩ့ခွံၬ ကယဲဆၧအီၪလၩ့ထးလၧတဲၩဖၧၩ့ ထီးအလူၬလီၫ.",
			"27": "<sup>27</sup> မူၭခိၪမိဒုၭဖျီၪထၪ့အဆၧအၧၩ့, ဒဲဂၪ့ခိၪမိဆၧၫ့ထုၪ့ထၫ့",
			"28": "<sup>28</sup> ဒၩအဝ့ၫလီၫ.- တၭအဂံၪ့အဆၧအၪထၪ့နီၪမိစဲၪ့ဒၪခွံၬ တၭ,မိယွၩလၩ့ခွံၬဝ့ၫ, လၧယွၩအဆၧၥၭထၪ့အမုနံၩ",
			"29": "<sup>29</sup> အဖၧၩ့နီၪလီၫ.- အယီၩမွဲၦအၧၩ့အဆၧန့ၥၫလၧယွၩ အစူၪဖၧၩ့တၭ, မွဲဆၧလၧၦၥ့ၪဆၧလူၬလဂၩနီၪဖၭဝဲၩ လၧအဂးလီၫ."
		},
		"21": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စယိဘၭချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> ဆၧလၧယချဲၩ့ထၪ့ယီၩ ခိၭနၪနၥံၪဝ့ၫထံၫထံၫဆၭ ဆၭဘီၪး ဒဲဆၧလမံၩ့ယီၩ မွဲအမၩမုၬထၪ့နၥံၪအၥၭ",
			"3": "<sup>3</sup> ဆံၭ.- ဒုၭချဲၩ့ထၪ့ယၧၩနးထံၪတၭ, ယချဲၩ့ဆၧအလး",
			"4": "<sup>4</sup> ခဲၫ့နီၪ,မၩကြၩ့ထမးကဒၪဘီၪ.- ယဝ့ၫဒၪယီၩမွဲယဂဲး လိၬတ့ၭလိၬလၧၦၡၩဆ့ဧၪး ယၥူၭဝံၪၥူၭလၩလကြၨၭ",
			"5": "<sup>5</sup> ဘၪနီၪမွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- ယိနဲၪ့ယၧၩတၭ, ထီၫမံၫ",
			"6": "<sup>6</sup> ထီၫမၪဘီၪး အီၪက့ၪစူၪလၧနိၭအလီၩ့ဆံၭ,- အဂဲးဘဲၫ ယီၩ ထီးယနၪ့ထၪ့ထဲၩ့တၭ, ယၥၭမဲၪယဝ့ၫး ဒဲယဖံၭ ယယၪဝၭထိၬဝၭတ့ၭဝ့ၫဒၪလီၫ.",
			"7": "<sup>7</sup> တၭၦအၧၩ့ဖိၪၥံၪမၧၫ့ဝ့ၫ, ၥၭၡါထၪ့ဝ့ၫနီၪလကၭဘၪ တၭ,န့ဘၪအစီၩ့အမၩ့ဖၭဒိၪနီၪ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ.",
			"8": "<sup>8</sup> အဝ့ၫၥံၪအချံၫအၥၪအီၪဂုးခၧၫ့လၧအမ့ၬယၫတၭ, အ",
			"9": "<sup>9</sup> ဖိၪအလံၩအီၪဝ့ၫလၧအမ့ၬယၫနီၪဆ့လီၫ.- အဝ့ၫၥံၪ အဂံၪ့လဖၪအီၪလၧဆၧမုၬဆၧဎၩ့တၭ, ၥၭမဲၪဆၧနး မံၩ့အ့ၬးဒဲယွၩအနိၪဖျ့ၪ အီၪလၧအဝ့ၫၥံၪ အလီၩ့ဆ့",
			"10": "<sup>10</sup> အ့ၬ.- အချီၥံၪဒၧၩ့ထၪ့တၭ, ဂၭဂီၩ့အ့ၬး အချီမိၥံၪဖိၪ",
			"11": "<sup>11</sup> ဆါန့အဖိၪတၭ,လၩ့လၫ့အ့ၬ.- အဝ့ၫၥံၪဖျါလၩ့အဖိၪ ဘဲၫဆၧအဒီၪ့အၥိၭတၭ, ဖိၪဒံၩဖိၪၥၪၥံၪ ဂဲထုၪ့လံနီၪ",
			"12": "<sup>12</sup> လီၫ.- အဝ့ၫၥံၪ ကိၭၡၭထၪ့ အီၪလၧစံၩ့စံၩ့ဒဲၥၫ့ထီး တၭ,လၧပံၩအၥီၫအကၠီၩ့နီၪ အဝ့ၫၥံၪၥုၪ့ထိၬၥၭထိၬ",
			"13": "<sup>13</sup> ဆ့လီၫ.- အဝ့ၫၥံၪအမုနံၩလဖၪ အီၪလၧဆၧကဲၪထၪ့ ကဲၪထီၫတၭ, လၧလဆိဖိၪအထးဖၧၩ့နီၪလ့ၩလၩ့လၧ",
			"14": "<sup>14</sup> ဖျႃဖၧၩ့လီၫ.- အဝ့ၫၥံၪစံၭယွၩ, စဲၪ့ထၪ့ခွံၬလၧပအီၪ ယီၩဘီၪးအဂဲးဘဲၫယီၩ နဖၧၩ့ၥၭၥံၪအဂဲးအကၠီၪ့နီၪ",
			"15": "<sup>15</sup> ဆၧမိၥ့ၪယၫဘၪပၥၭအ့ၬ.- ၦၥ့ၪဆၧလူၬလၧပကြၨၭ မၩအဆၧနီၪ, မွဲဆၧနီၪလမံၩ့လဲၪး ပအၪ့ကံၩ့အၪ့ယၫ လါနၫ့အဝ့ၫၥံၪတၭ, မွဲအန့ကၩဆၧနီၪလမံၩ့လဲၪ.",
			"16": "<sup>16</sup> ယိခွါ, အဝ့ၫၥံၪအဆၧဂ့ၩနီၪအီၪလၧအစူၪဖၧၩ့",
			"17": "<sup>17</sup> အ့ၬးၦအၧၩ့အဆၧဒုၭကိၪ့နီၪအီၪယဲၩ့လၧယၧၩလီၫ.- ၦ အၧၩ့အမ့ၪဒိၩ့နီၪ လၩ့ဖံၬခွံၬဝ့ၫ, ဎွ့ဘျၩ့ဎွ့ဘျၩ့လဲၪး ဒဲ အဝ့ၫၥံၪအဆၧဂၭဂီၩ့နီၪလၩ့ဘၪအလီၩ့တၭး ယွၩလၧ အဆၧၥၭထၪ့အဖၧၩ့နီၪ အၪ့နၩ့ဖၭဖ့ၪလၫ့ဆၧၡၪ့ဆၧ",
			"18": "<sup>18</sup> နၭလဖၪလီၫ.- အဝ့ၫၥံၪမၩအၥၭဘဲၫလီခၫ့လၧလံၩအ မ့ၬယၫအၥိၭနီၪ, ဒဲဘဲၫဖ့ၫလၧလံၩၥဝံၬ ဖျဲးန့ခွံၬဝ့ၫအ",
			"19": "<sup>19</sup> ၥိၭနီၪလီၫ.- မွဲယွၩမိအီၪက့ၪကီၪ့အဆၧမၩအၧၩ့လၧ အဖိၪအလံၩအဂးနီၪဆ့ဧၪး မွဲအဝ့ၫဒၪဖ့ၪထဲၩ့ဝ့ၫတၭ,",
			"20": "<sup>20</sup> မိၥ့ၪယၫဝ့ၫဒၪလီၫ.- အမ့ၬၥၪမိဒၪဘၪအဆၧဂၭဂီၩ့",
			"21": "<sup>21</sup> တၭ,မွဲအအီၩၦၥ့ၪဆၧလူၬအဆၧၥၭထၪ့နီၪဆံၭ.- အ ဂဲးဘဲၫယီၩ ထီးအမုၥံၪလၩၥံၪအဆၧဝံဆၧနၬနီၪဘၪ ဆၧဒၪ့ထ့ၬခွံၬဝ့ၫတၭ, မွဲအမုၬလၩအၥၭလၧအဂံၪ့လၧ အလးခဲၫ့နီၪမိၥ့ၪဘဲၫၥ့ၪလဲၪ.",
			"22": "<sup>22</sup> ယွၩလၧအစ့ၩရၫ့ဆၧထၪ့ထီၫနီၪ, မွဲၦဒုၭၥ့ၪယၫအ",
			"23": "<sup>23</sup> ဝ့ၫဒၪလၧဆၧလမံၩ့မံၩ့နီၪမိၥ့ၪဆ့ဧၪး- တၭၦလဂၩၥံၫ ဝ့ၫလၧအဆၧကဲၪထၪ့ကဲၪထီၫ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩအဖၧၩ့",
			"24": "<sup>24</sup> နီၪမုၬလၩဝ့ၫလၧဆၧမံၫ့ၥုၪ့မံၫ့ၥၭဂ့ၩဘၪစဲၪတၭး- အ ဂုၬဖၩၥံၪဘီၪ့ဝ့ၫၥိၪဝ့ၫ, ဒဲအဎွံၪလဖၪဘၪစီၪလၧအခံအ",
			"25": "<sup>25</sup> ၥိၪနီၪလီၫ.- တၭအဂူၫဂၩလဂၩၥံၫဝ့ၫ လၧဆၧခိဆၧ ဝီၩအဖၧၩ့, ဒဲထဲးယိဘၪ ဆၧမုၬဆၧလၩနးဆိၭအ့ၬ.",
			"26": "<sup>26</sup> တၭအဝ့ၫၥံၪမံၫနၩ့ၡီၩ့ လၧဂၪ့ခိၪမုၬအကျၩနီၪ, ဒဲလိၪ့",
			"27": "<sup>27</sup> ၥံၪမၩဘံၭခွံၬဝ့ၫဒၪနီၪလီၫ.- ယိခွါ,နၥံၪဆီၫ့မီၪ့ဆၧလ ဖၪ,ဒဲနၥံၪကိၪ့ထၪ့လိၬနၥံၪအၥၭ လၧနၥံၪမိမၩနၧၩ့မၩ စၪယၧၩနီၪ, ယၥ့ၪယၫယဝ့ၫဆ့လီၫ.",
			"28": "<sup>28</sup> အဂဲးဘဲၫယီၩနၥံၪစံၭ, ၦဒိၪဖၭဒိၪအဂံၪ့အီၪဝ့ၫခီၫခီၫ",
			"29": "<sup>29</sup> လဲၪး ဒဲတဲၩလၧၦအၧၩ့အီၪဝ့ၫနီၪမွဲခီၫခီၫလဲၪ.- ၦၡၩ လၧအလဲးလီၩ့လၧဖၧၩ့ၥၭနီၪ, မွဲနၥံၪအၪ့စၪ့ဘၪဆ့ဧၪး",
			"30": "<sup>30</sup> ဒဲအဆၧမၩနဲၪ့နီၪ, မွဲနၥံၪၥ့ၪယၫဘၪအ့ၬဧၪ.- မွဲလၧၦ အၧၩ့ဖိၪဘၪဆၧခိၭထၬဝ့ၫ ထီးဆၧဂၭဂီၩ့အမုနံၩနီၪး အဝ့ၫၥံၪဘၪဆၧမီၩ့ဝ့ၫ ထီးလၧဆၧၥၭထၪ့အမုနံၩနီၪ",
			"31": "<sup>31</sup> လီၫ.- မွဲပလၫမိလီၩဖျီၪထၪ့ ၦၡၩအဖၧၩ့ၥၭအဂဲးအ ကၠီၪ့လၧယမ့ၬယၫလဂၩလဲၪး ဒဲဆၧလၧအမၩဝ့ၫနီၪ",
			"32": "<sup>32</sup> မွဲပလၫမိဖ့ၪထဲၩ့လဂၩလဲၪ.- မွဲလါနၫ့တၭ,ၦၡၩဆိၬ လၩ့ဝ့ၫလၧဆၧၥွၪခိၪအဖၧၩ့နီၪ, ဒဲဆၧခိၭထၬဝ့ၫလၧၥွၪခိၪ",
			"33": "<sup>33</sup> ဖၧၩ့နီၪလီၫ.- ခိၪလီၩ့ဆူၭအဂၪ့ခိၪအလီၪ့လဖၪမိဆၧၫ့ လၧအဝ့ၫဒၪအဂး ဒဲၦထီးအလူၬ မိထုၭလၩ့ဖိၬအခဲၫ့, ဘဲၫၦအီၪဝဲၩဝ့ၫလၧဆၧဝံထၪ့နၬထၪ့ဝ့ၫလၥ့ၪဘၪလီၫ.",
			"34": "<sup>34</sup> လၧနၥံၪချဲၩ့ဆၧၫ့ဆၧအဖၧၩ့နီၪ မွဲန့ၫဆၧအၪ့လီၫတၭ, မွဲနၥံၪမၩမုၬထၪ့ယၧၩ ပျီၩပျီၩဘဲၫၥ့ၪလဲၪ."
		},
		"22": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ ၦတံမၫဖိၪ စအံၫလဲဖၭချဲၩ့ဆၧၫ့ဝ့ၫ တၭ,စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> မွဲၦၡၩဒုၭန့ဘၪယွၩ လၧဆၧလမံၩ့မံၩ့မိၥ့ၪဧၪး အ ဂဲးဘဲၫယီၩ ၦကိၪ့ဆၧၥ့ၪနီၪန့ဘၪဆၧန့ၫအနၫ့ဆါဒၪဝ့ၫ",
			"3": "<sup>3</sup> အဂးလီၫ.- လၧနမွဲၦအတီၩအလီၩ့အကၠီၩ့နီၪ, မွဲအ မၩမုၬထၪ့ ၦၥ့ၪဆၧလူၬအၥၭ လမံၩ့မံၩ့ဆ့ဧၪး နမၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့နဖၧၩ့ၥၭနီၪ, မွဲအဒုၭအၪထၪ့အဝ့ၫဒၪ",
			"4": "<sup>4</sup> အဆၧဂ့ၩနီၪဆ့ဧၪ.- လၧအၥၭမဲၪနၧၩအကၠီၩ့နီၪ, မွဲအ မိအၪ့ၥီၪ့နၧၩဆ့ဧၪး မွဲအမိနုၬလၧဆၧစ့ၩရၫ့အဖၧၩ့ လၧနၥိၭဆ့ဧၪ.",
			"5": "<sup>5</sup> နဝ့ၫဒၪနဆၧဒဲၩဘၭဖၭဒိၪမွဲအ့ၬဧၪး ဒဲနဆၧအၧၩ့လ",
			"6": "<sup>6</sup> ဖၪနီၪ,အထုၬအီၪအ့ၬ.- အဂဲးဘဲၫယီၩနမၩန့ဆၧပီၩ့ လၩ့လၧနထၧၫ့ဖုဝဲပျီၩပျီၩတၭး နဘဲၪ့လၩ့ခွံၬၦအီၪ",
			"7": "<sup>7</sup> ဘိၪ့အကီၩ့အၥိၭလဖၪနီၪလီၫ.- ၦလၧအၥၭလၩ့ဘဲၩ လဖၪနီၪ, နဒုၭအီၩဘၪအထံၫအ့ၬး ဒဲၦလၧအၥၭဝံအ",
			"8": "<sup>8</sup> ၥၭလဖၪနီၪနဒုၭအၪ့ဘၪအကိၪဆ့အ့ၬ.- အ့ၪမွဲၦလၧ အဆီၪ့လဂၩနီၪအီၪလၧထံၫၥံၪခးၥံၪတၭ, ၦန့ဘၪအ",
			"9": "<sup>9</sup> လၩအဖၩ့နီၪအီၪလၧအဖၧၩ့ဆ့လီၫ.- ၦမုၪမဲၫလဖၪန ဖျါခွံၬပျီၩပျီၩတၭ, ၦဖိၪဎွ့ၪလဖၪ အစူၪနီၪ ခါဝ့ၫဒၪ",
			"10": "<sup>10</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဖျံၩခွၩ့အီၪဖီၩ့နၧၩဝၬဝၬ,",
			"11": "<sup>11</sup> ဒဲဆၧၥၭမဲၪၡုၭ ဒုၭထီၫမံၫထီၫမၪနၧၩလီၫ.- ဒဲဆၧခံၭ ၥၧၫ့လၧနလဒၪဘၪး ဒဲထံၫလုၬဘံၭဆၧနီၪ မိမၩလၩ့ ဘံၭခွံၬနၧၩလီၫ.",
			"12": "<sup>12</sup> ယွၩအီၪလၧမူၭခိၪအဆၧထၪ့ထီၫနီၪမွဲအ့ၬဧၪး တၭ ယိခွါၡၪၥံၪအဆၧထၪ့ထီၫနီၪ, မွဲအထီၫမၬကလဲၪၬ",
			"13": "<sup>13</sup> တၭနဝ့ၫဒၪနစံၭ, ယွၩၥ့ၪယၫဝ့ၫဘဲၫၥ့ၪလဲၪး အဝ့ၫဒၪ",
			"14": "<sup>14</sup> စ့ၩရၫ့ဖျီၫ့ဆၧအုၪ့တၪ့နီၪဘၪမိၥ့ၪဆ့ဧၪ.- ဆၧအုၪ့လ ဖၪချႃၬဘံၭအဝ့ၫဒၪတၭ, ဒၪဘၪဆၧအ့ၬး မွဲအလ့ၩဆၧ",
			"15": "<sup>15</sup> လၧမူၭခိၪအဖၫ့ခိၪနီၪလီၫ.- ဖၧၩ့ၥၭလးလံၩလၧၦၡၩ",
			"16": "<sup>16</sup> အၧၩ့လဲးလီၩ့နီၪမွဲနမိဖိၬဘၪဆ့ဧၪး- ၦလၧအဘၪဆၧ မၩဂၭဂီၩ့ဝ့ၫ, ဘိၩ့အဆၧၫ့အထီလချႃၭဘၪဒံၭဘၪနီၪ,",
			"17": "<sup>17</sup> ထံၫမၩလုၬဘံၭခွံၬအဝ့ၫၥံၪလီၫ.- ၦလဖၪနီၪစံၭယွၩး စဲၪ့ထၪ့ခွံၬ လၧပအီၪယီၩဆံၭး ဒဲၦၥ့ၪဆၧလူၬနီၪ မၩ",
			"18": "<sup>18</sup> လၧအဝ့ၫၥံၪအဂးဘဲၫၥ့ၪလဲၪ.- မွဲလါနၫ့တၭ,ယွၩမၩ ဎွ့ၩအဝ့ၫၥံၪအဂံၪ့လၧဆၧဂ့ၩလဖၪတၭ, အ့ၪမွဲၦအၧၩ့",
			"19": "<sup>19</sup> အဆၧဒုၭကိၪ့နီၪမွဲအအီၪယဲၩ့လၧယၧၩယီၩဆံၭ.- ၦ အတီၩအလီၩ့လဖၪဒၪဘၪဝ့ၫတၭ, ၥုၪ့ထိၬၥၭထိၬဝ့ၫ ဒဲၦလၧဆၧမၪလအီၪဘၪနီၪ, မၩကြၩ့ထမးအဝ့ၫၥံၪ",
			"20": "<sup>20</sup> လီၫ.- မွဲမၬ,ပဒုၪပဒၩဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫတၭ, အဝ့ၫ ၥံၪအဆၧအီၪလၩ့ထးနီၪ, မွဲမ့ၪအၪ့ခွံၬဝ့ၫဒၪလီၫ.",
			"21": "<sup>21</sup> မၩၥ့ၪယၫနၥၭလၧယွၩတၭ အီၪမုၬလၩနဝ့ၫဘီၪး",
			"22": "<sup>22</sup> လၧဆၧနီၪအကၠီၩ့ ဆၧဂ့ၩမိလၩ့ဘၪနၧၩလီၫ.- ဒိၭန့ ဆၧၥီၪ့ဆၧၥၫ့လၧအဝ့ၫဒၪအနိၭတၭ, အီၪက့ၪကီၪ့အ",
			"23": "<sup>23</sup> ဆၧချဲၩ့လဖၪလၧနၥၭခံဖၧၩ့နီၪဆံၭ.- နဝ့ၫဒၪနအ့ၪဂဲၫ ထဲၩ့ကဒၩထဲၩ့ လၧၦၥ့ၪဆၧလူၬအအီၪ, ဒဲၥုၭခွံၬဆၧ အၧၩ့ယဲၩ့ လၧနအီၪအလးတၭး နမိဘၪဆၧကဲၪထၪ့",
			"24": "<sup>24</sup> ကဲၪထီၫဝ့ၫလီၫ.- ခွံၬလၩ့ထီၫ့လၧဂၪ့ခိၪမုၬအကျၩ,ဒဲ အိဖၧၫအထီၫ့နီၪလၧထံၫချိၬအလိးၥံၪအကျၩနီၪဘီၪ.",
			"25": "<sup>25</sup> အဂဲးဘဲၫယီၩ ၦၥ့ၪဆၧလူၬမိကဲၪထၪ့နထီၫ့, ဒဲစ့ၩအီၪ",
			"26": "<sup>26</sup> ကီၪ့လၧနဂးလီၫ.- ထီးနီၪလဖၧၫ့နမိမုၬလၩနၥၭလၧၦ ၥ့ၪဆၧလူၬအဖၧၩ့တၭ, နမိမိၬထၪ့နမ့ၬလၧယွၩလီၫ.",
			"27": "<sup>27</sup> နမိအၪ့ကံၩ့အၪ့ယၫအဝ့ၫတၭ, မွဲအမိခိၭနၪနၧၩ,ဒဲနမိ မၩလၧၫ့ထၪ့ဎွ့ၩထၪ့နဆၧဆိၪလၩ့နၥၭလဖၪနီၪလီၫ.",
			"28": "<sup>28</sup> နမိဖၭဝဲၩဆၧလမံၩ့မံၩ့တၭ, ဆၧမိအီၪဂုးခၧၫ့ဝ့ၫဒၪး ဒဲ",
			"29": "<sup>29</sup> ဆၧဖၩ့မိဒုၭဖၩ့ထၪ့နဖၧၩ့ၥၭလဖၪလီၫ.- ၦၡၩအ့ၪ ဘၪဆၧဆၪ့လၩ့တၭ, နမိစံၭ,ဆၧဆိၬထၪ့ဝ့ၫဒၪဖီၩၬ ဒဲၦ လၧအၥၭဆၧၩ့လဖၪနီၪ, မွဲအမိထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫ",
			"30": "<sup>30</sup> လီၫ.- အဝ့ၫဒၪမိမၩဖီၩ့မၩဖျ့ၭၦလၧအဆၧမၪအီၪဒၪ လ့ၬ,ဒဲထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫလၧနစူၪဆံၫ့အကၠီၩ့လီၫ."
		},
		"23": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့စယိဘၭချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> လၧမုဆၫလနံၩယီၩဒၪလ့ၬ ယဆၧၥူၭဝံၪၥူၭလၩယီၩ မွဲဆၧခိဆၧဝီၩတၭ, ဆၧအစူၪလၧယလီၩ့ဎၧၫ့နဲၪ့ယ",
			"3": "<sup>3</sup> ဆၧဂၪ့အုၩ့ဂၪ့ထိၬလဖၪလီၫ.- ယဆိၫ့ၥ့ၪယၫလးလၧ ယဒၪဘၪယွၩ ဘဲၫၥိၭယမိထီၩ့လၧအလးဆီၩ့ဆီနီၪ",
			"4": "<sup>4</sup> လီၫ.- ယမိတဲၩ့ဝဲၩယမူၭလၧအမ့ၬယၫ, ယမိမၩဎွ့ၩ",
			"5": "<sup>5</sup> ယနိၭလၧအဂဲးအကၠီၪ့တၭး-ယမိၥ့ၪယၫဆၧချဲၩ့လ ဖၪလၧအဝ့ၫဒၪ မိစံၭဆၧၫ့ယၧၩ, ဒဲယိနဲၪ့ဆၧလၧအ",
			"6": "<sup>6</sup> လီၩဘၪယၧၩနီၪဆ့လီၫ.- တၭအဝ့ၫဒၪလၧအစီၩ့ဒိၪ အမၩ့ဒိၪနီၪမိဂဲးလိၬတ့ၭလိၬယၧၩဆ့ဧၪး မွဲအ့ၬၬ မွဲအ",
			"7": "<sup>7</sup> မိခိၭနၪတၡါယၧၩလီၫ.- ထီးနီၪလစီၪ့, ၦအတီၩအ လီၩ့ချဲၩ့ခွးလၧအဝ့ၫဒၪၥ့ၪတၭး ယမိဖီၩ့ဖျ့ၭ ၦစ့ၩရၫ့",
			"8": "<sup>8</sup> ယၧၩအဆိၩအကၠၪလီၫ.- ယိခွါ, ယလ့ၩစိၩလၧမုထၪ့ လခီၫတၭ, မွဲအအီၪထီးနီၪအ့ၬး ဒဲလၧမုနုၬလခီၫတၭ,",
			"9": "<sup>9</sup> ယဒၪဘၪအဝ့ၫနးစီၪ့အ့ၬး- လၧမုဖၩထီးအမၩဆၧအ လးလါနၫ့နီၪ, ယဒၪဘၪအဝ့ၫအ့ၬးလၧမုခံၫ့လခီၫနီၪမွဲ အချႃၬဘံၭခွံၬအၥၭတၭ, ယဒၪဘၪအဝ့ၫဆ့အ့ၬ.",
			"10": "<sup>10</sup> မွဲလါနၫ့တၭ, အဝ့ၫဒၪၥ့ၪယၫဖၧၩ့ၥၭလၧယဖိၬနီၪး ထီးအဝ့ၫဒၪအ့ၪမၩခွါယူၭယၧၩဂီၩ့တၭ, ယမိဂဲၫထၪ့",
			"11": "<sup>11</sup> ဘဲၫထီၫ့အၥိၭနီၪလီၫ.- ယခၪ့ဖီၪ့ထၬယူၭအဝ့ၫဒၪအ ခၪ့လးတၭ,ယထီးန့အဖၧၩ့ၥၭ, ဒဲဂၭဖျိၭဝ့ၫနးစီၪ့အ့ၬ.",
			"12": "<sup>12</sup> အဝ့ၫဒၪအနိၭဖျံၩအဆၧမၪလူၬနီၪ ယအီၪက့ၪခွံၬအ့ၬး အဝ့ၫဒၪအနိၭအဆၧချဲၩ့လဖၪနီၪ, ယအီၪက့ၪဂ့ၩနဲၪ့ ယဆၧဒၪယဝ့ၫလီၫ.",
			"13": "<sup>13</sup> အဝ့ၫဒၪအီၪဒၪဆၧလမံၩ့ဎးတၭ, မွဲပလၫဒုၭကၠၪထဲၩ့ အၥၭမိၥ့ၪလဂၩလဲၪး ထီးဒၪအမိမၩဘၪအၥၭလမံၩ့",
			"14": "<sup>14</sup> မံၩ့နီၪ,မွဲအမၩဒၪဝ့ၫလီၫ.- မွဲမၬ, ထီးဒၪအဖၭဝဲၩဆၧ လမံၩ့မံၩ့လၧယဂးယီၩ, မွဲအမိမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့",
			"15": "<sup>15</sup> ဝ့ၫးဒဲအဆၧဘဲၫနီၪၥိၭအီၪဝ့ၫအၪအၪလ့ၬဆ့လီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, ယဝၭထိၬယဝ့ၫလၧအမ့ၬယၫတၭး",
			"16": "<sup>16</sup> ယဆီၫ့မီၪ့ဆၧတၭ,ယၥၭမဲၪယဝ့ၫလီၫ.- ယွၩမၩလၩ့ ဖူၬယၥၭတၭ, ၦၥ့ၪဆၧလူၬနီၪ မၩခိမၩဝီၩယၧၩလီၫ.",
			"17": "<sup>17</sup> အဂဲးဘဲၫယီၩ မွဲလၧဆၧခံၭတၪ့ချႃၬဘံၭ ယၧၩလါနၫ့ တၭ,လၧဆၧခံၭအကၠီၩ့နီၪယကြၨၭအုၭအၭအ့ၬ."
		},
		"24": {
			"1": "<sup>1</sup> ဆၧအဆၧၫ့အထီလဖၪ အ့ၪလအီၪၥူၪခွံၬဘၪလၧၦ ၥ့ၪဆၧလူၬ, ၦလၧအၥ့ၪယၫအဝ့ၫဒၪနီၪ,ယဒၪဘၪအ",
			"2": "<sup>2</sup> မုနံၩလဖၪမွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- ဂၪ့ခိၪအဆၧမၩနဲၪ့နီၪ အဝ့ၫၥံၪၥုၭခွံၬတၭ, မွဲအအၪ့ဂူၬဆီၪ့ၥိၪၥံၪဘ့ၪၥံၪအ",
			"3": "<sup>3</sup> ဒီၪ့လဖၪတၭ, ဘုၪအၪ့ဘုၪအီၩအဝ့ၫၥံၪလီၫ.- ၦဖိၪဎွ့ၪ အကၥ့ၪယီၩ့နီၪအဝ့ၫၥံၪနၫ့ခွံၬဝ့ၫတၭ, ၦမုၪမဲၫအချီဖၫ",
			"4": "<sup>4</sup> မၩန့ဝ့ၫလၧဆၧပီၩ့လၩ့အဂးလီၫ.- အဝ့ၫၥံၪနၫ့ထၪ့ခွံၬ ၦၡၪ့ဖိၪယၬဖိၪလၧဖၧၩ့ၥၭ, ကယဲထံၫဖိၪခးဖိၪၥံၪလၧ အဘၪဆၧမၩအၧၩ့မၩနၭဝ့ၫနီၪ ဘၪအီၪက့ၪၥူၪခွံၬအ",
			"5": "<sup>5</sup> ၥၭလီၫ.- ယိခွါ, ဘဲၫကၥ့ၪယီၩ့မံၩ့လၧမံၩ့လၬကျၩအ ၥိၭနီၪ,အဝ့ၫၥံၪလ့ၩထၪ့ လၧအမၩဆၧအလး အၪ့ဎၬ အၪ့ဂူၬန့ဆၧတၭး မံၩ့လၬကျၩနီၪအီၪလၧဆၧအၪ့လၧ",
			"6": "<sup>6</sup> အဖိၪအလံၩအဂးလီၫ.- လၧဂၪ့ခိၪအဝၩ့လဖၪမွဲအကူၭ ဘုၪၥံၪဂူၫၥံၪ, ဒဲအၪ့ထုၫ့န့ ဆၧလၧၦအၧၩ့ အစဘံၭအ",
			"7": "<sup>7</sup> လးလဖၪနီၪလီၫ.- မုနၩလခီၫအဝ့ၫၥံၪမံၫနၩ့ အီၪဘိၪ့ အကီၩ့အၥိၭလအီၪဘၪတၭး လၧဆၧဂီးအကျၩနီၪဆၧ",
			"8": "<sup>8</sup> အခိၪမၩဘံၭဝ့ၫအီၪနးမံၩ့အ့ၬ.- ဘၪစီၪလၧဆၧဆၧၩ့ ဂဲၫလၧခိၪလီၩ့နီၪ, လၧဆၧဖလ့ၬအလးလအီၪဘၪ",
			"9": "<sup>9</sup> တၭ,မွဲအဖီၪ့ထၬလိးၥံၪလဲၫ့ၥံၪနီၪလီၫ.- ၦဖိၪဎွ့ၪဘၪ ဆၧအၪ့ဂူၬန့ခွံၬလၧနူအအီၪ, ဒဲမၩန့ဆၧပီၩ့လၩ့လၧၦ",
			"10": "<sup>10</sup> ၡၪ့ဖိၪယၬဖိၪလဖၪနီၪလီၫ.- အဝ့ၫၥံၪစဲၪ့ဝံၩ့ဝၩ့အီၪဘိၪ့ လၧအကီၩ့အၥိၭလအီၪဘၪနီၪတၭး လၧအၥၭဝံအၥၭ",
			"11": "<sup>11</sup> အဘိၩ့ဘၭနီၪဆိၬၦဂူၫဂၩအဘုၪ့လၧၫ့ၥံၪး- ဘၪဂူၬန့ ၥိၪ,ဒဲယဲးစဘံၭၥၪတၭ, ထိးဆၧၥူၫအီၩအၥၭနီၪလီၫ.",
			"12": "<sup>12</sup> ၦၡၩၥံၪဂၪ့အုၩ့ဂၪ့ထိၬလၧဒိၩ့ဖၧၩ့တၭ, ၦလၧအဘၪ ထံၭဆၫကိၭၡၭထၪ့လါနၫ့နီၪ, ယွၩအီၪက့ၪဆၧမၪလၧ အလီၩ့ဆ့အ့ၬ.",
			"13": "<sup>13</sup> ၦလၧအပိၩ့ထၪ့ထၫ့ဒုၪဒၩဆၧဖၩ့နီၪ အီၪဝ့ၫလနၩ့နၩ့ တၭ, မွဲအလၥ့ၪယၫဘၪအဂဲးအကၠီၪ့တၭး အီၪဂုးခၧၫ့",
			"14": "<sup>14</sup> လၧအဖၧၩ့ၥၭလဖၪနီၪအ့ၬ.- လၧမုဆဲၪ့ထၪ့နီၪၦမၩၥံၫ ၦၡၩဂဲထုၪ့တၭး မၩၥံၫၦၡၪ့ဖိၪယၬဖိၪတၭး လၧမုနၩ",
			"15": "<sup>15</sup> လခီၫ,မၩဝ့ၫဘဲၫၦအၪ့ဂူၪဆၧအၥိၭနီၪလီၫ.- ၦလၧအ မၩမၪၦမၫနီၪအမ့ၬၥၪခိၭဆိၫ့မုဂၪလၩ့ဝ့ၫတၭ, ဒဲအချႃၬ ဘံၭခွံၬအမ့ၬတၭ, စံၭဝ့ၫ, ၦမ့ၬၥၪမိဒၪဘၪယၧၩနးစီၪ့",
			"16": "<sup>16</sup> အ့ၬၬ- လၧဆၧခံၭကျၩနီၪအဝ့ၫၥံၪဘုၪ့ဖိးဂံၪ့ၥံၪတၭး လၧမုဆၫလခီၫနီၪ ကၭဘံၭထၬအၥၭ, လၥ့ၪယၫဘၪ",
			"17": "<sup>17</sup> ဆၧဖၩ့လီၫ.- အဂဲးဘဲၫယီၩမုဂီၩလခီၫနီၪလၧအဝ့ၫၥံၪ ထီးအလူၬအဂးမၩအၥၭဘဲၫ ဆၧၥံၫအလၩၡုၪအၥိၭ နီၪတၭး အဂဲးဘဲၫယီၩ ဆၧမၩၥၭမဲၪနီၪဘၪဆဲၫ့လၧ ဆၧၥံၫအလၩၡုၪတၭ, မွဲအဝ့ၫၥံၪၥ့ၪယၫယုၩယါဝ့ၫနီၪ လီၫ.",
			"18": "<sup>18</sup> မၩအၥၭဘဲၫဆၧဎွံၫလဲၪ့ကဲၪ့ လၧထံၫဖံၭခိၪအၥိၭ တၭ,အဝ့ၫၥံၪအလးလၧဂၪ့ခိၪချိၫ့ယီၩ ဘၪဆိၪအၧၩ့ဝ့ၫ",
			"19": "<sup>19</sup> တၭယိဝ့ၫလၧစဘံၭမုၥံၪအလးအကျဲၩဆ့အ့ၬ.- ဆၧ ဒုၭလၩ့ၥံၭ, ဒဲဆၧခိမၩဎဲၫ့ထၪ့လူၬခွံၬ မူၭခိၪဖီၫအထံၫး ဘဲၫနီၪၥိၭဆ့ဖျႃဖၧၩ့နီၪ မၩၦလၧအမၩဒဲၩဘၭဆၧနီၪ",
			"20": "<sup>20</sup> လီၫ.- ဆၧဒၧၩ့လးၥၭနၪ့ခွံၬအဝ့ၫတၭ, လိၪ့ၥံၪအၪ့အွံၪ မၬတၭ, ဆၧမိနၪ့ထၪ့ထဲၩ့လၧၩ့အဝ့ၫနးစီၪ့အ့ၬး ဆၧ အၧၩ့နီၪဘၪဆၧခါခွံၬဝ့ၫဘဲၫၥံၪ့အၥိၭနီၪလီၫ.",
			"21": "<sup>21</sup> မွဲအမၩအၧၩ့ ၦထူၬဖိၪ လၧအလထၪ့ဖိၪဘၪတၭ,",
			"22": "<sup>22</sup> မၩဘိၭမၩဆၧၩ့ၦမုၪမဲၫဆ့အ့ၬ.- မွဲအမၩဂၭဂီၩ့ၦအ ဆီၪ့လၧအစီၩ့အမၩ့နီၪတၭ, ဂဲထုၪ့တၭ, ၦၡၩၥၭမၧၫ့",
			"23": "<sup>23</sup> အီၪဂုးခၧၫ့ဝ့ၫနးဂၩအ့ၬး- ယွၩဒုၭအီၪဂုးခၧၫ့အလး တၭ,အဝ့ၫၥံၪမုၬလၩဒၪဆၧဘဲၫနီၪတၭး အဝ့ၫဒၪအ မ့ၬၥၪအီၪလၧအဝ့ၫၥံၪ အဖၧၩ့ၥၭလဖၪ အလီၩ့လီၫ.",
			"24": "<sup>24</sup> အဝ့ၫၥံၪထၪ့ဘၭထီၫထီၫတၭး လဆိဖိၪနီၪ, အဝ့ၫၥံၪ လၩ့မါပံၭလီၫ. ဘၪဆၧဆၪ့လၩ့ဝ့ၫတၭ, ဘၪဆၧဒုၭ အီၪကီၪ့ဘဲၫဂူၫဂၩအၥိၭ, ဘၪဆၧကူၭထ့ၬခွံၬဘဲၫဘုၪ",
			"25": "<sup>25</sup> ဆဲၩထီၫဝ့ၫအၥိၭနီၪလီၫ.- အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ၦလၧအမိအီၪက့ၪယၧၩလၧၦအဘျံၭအဘျၪ,ဒဲဒုၭကဲၪ ယဆၧချဲၩ့လၧဆၧပျီၩပျီၩနီၪ, မွဲပလၫလဂၩလဲၪ."
		},
		"25": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ၦရှုအၫဖိၪစဘံလဒၭချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> ယွၩပၧၩ့ဆၧဒဲဒုၭၥၭမဲၪဆၧတၭ,မွဲအမၩမုၬမၩဎၩ့",
			"3": "<sup>3</sup> ဆၧလၧအလးထၪ့ထီၫလဖၪနီၪလီၫ.- အဝ့ၫဒၪအၥုၭ မုလဖၪအီၪလၧဆၧဝံထၪ့နၬထၪ့မိၥ့ၪဆ့ဧၪး ၦလၧအ ဝ့ၫဒၪအဆၧဖၩ့နီၪ လဖၩ့ဒိၭဘၪဝ့ၫ, မွဲၦလဂၩလဲၪ.",
			"4": "<sup>4</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦၡၩအီၪက့ၪတီၩအီၪက့ၪလီၩ့အ ၥၭလၧယွၩအမ့ၬယၫမိၥ့ၪဘဲၫၥ့ၪလဲၪး ဒဲၦလၧအအီၪ",
			"5": "<sup>5</sup> ဖျဲၪလၧၦမုၪနီၪ,မွဲအမိဆံၫ့ထၪ့ဝ့ၫဘဲၫၥ့ၪလဲၪ.- ယိခွါ, လၩနီၪဒၪလ့ၬလဖၩ့ထၪ့ဘၪး ဒဲၡၪလဖၪနီၪဆံၫ့ဝ့ၫ လၧ",
			"6": "<sup>6</sup> အဝ့ၫဒၪအမ့ၬၥၪဖၧၩ့ဆ့အ့ၬ.- ၦၡၩလၧအမွဲၥံၪ့မု, ဒဲၦ ၡၩအဖိၪခွၫလၧအမွဲလိၪ့နီၪ, နၭနဲၪ့အနီၪဆံၭဒိၪလဲၪ."
		},
		"26": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စယိဘၭချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ၦလၧအစီၩ့အမၩ့လအီၪဘၪနီၪ, နမၩဘိၭမၩဆၧၩ့ ဝ့ၫ,ဒဲၦစူၪဒူၪလၧအဂဲးအဘၭလအီၪဘၪတၭ, နဒုၭဆီၪ့",
			"3": "<sup>3</sup> ထၪ့ဝ့ၫဘဲၫၥ့ၪလဲၪ.- ၦလၧအဆၧကိၪ့လအီၪဘၪနီၪန ဒုၭကိၪ့ဝ့ၫတၭ, နဒုၭနၪၥ့ၪဆၧအဂဲးအကၠီၪ့ အၪမၬက",
			"4": "<sup>4</sup> လဲၪၬ- နချဲၩ့ဆၧလၧၦလဂၩလဲၪး မွဲပလၫအၥၪဂဲၫထၪ့ လၧနစူၪဖၧၩ့လဂၩလဲၪ.",
			"5": "<sup>5</sup> ၦအလၩၥံၪဝၭထိၬ လၧဆၧအဖၫ့လၬး ဒဲထံၫလဖၪ",
			"6": "<sup>6</sup> ဒဲဆၧအမၧၫ့အီၪဝ့ၫလၧအဖၧၩ့နီၪလီၫ.- ဖျႃဖၧၩ့အီၪ ဘိၪ့လၧအဝ့ၫဒၪအမ့ၬယၫ, ဒဲဆၧမၩဂၭဂီၩ့အီၪလၧ",
			"7": "<sup>7</sup> ဆၧလုၬဘံၭဝ့ၫနးမံၩ့အ့ၬ.- အဝ့ၫဒၪထုၭလၩ့ပၠၪမုဖၩ လၧဆၧအလးအီၪပျၩ့မုထုအဖၫ့ခိၪး အဝ့ၫဒၪဘျၭလၩ့",
			"8": "<sup>8</sup> ဆဲၩဂၪ့ခိၪလၧဆၧလမွဲဘၪဆၧနးမံၩ့အလီၩ့လီၫ.- အ ဝ့ၫဒၪဘီၪ့ဘံၭထၬထံၫၥံၪ လၧဆၧအုၪ့တၪ့လဖၪအဖၧၩ့",
			"9": "<sup>9</sup> တၭ,ဆၧအုၪ့နီၪယၬဝ့ၫလၧအဖၫ့လၬနီၪဆ့အ့ၬ.- အ ဝ့ၫဒၪမၩဘံၭခွံၬ လးဆီၩ့ဆီအမ့ၬတၭ, ပၠၪလၩ့ဆၧ",
			"10": "<sup>10</sup> အုၪ့လၧအဖၫ့ခိၪနီၪလီၫ.- မွဲအဒုၭဝၩ့ထၬထံၫလဖၪ အထုၬ, ထီးအလးလၧဆၧဖၩ့လူၬဝ့ၫ လၧဆၧခံၭကျၩ",
			"11": "<sup>11</sup> လီၫ.- မူၭခိၪအထုၪ့လဖၪဝၭထိၬဝ့ၫတၭး လၧအဝ့ၫဒၪ အဆၧအၪ့ၥီၪ့အကၠီၩ့နီၪ, ထီၫမံၫထီၫမၪဝ့ၫဒၪဆ့လီၫ.",
			"12": "<sup>12</sup> အဝ့ၫဒၪဒုၭအီၪဂုးဖုး မၫဆမံၭလၧအစီၩ့အမၩ့တၭး လၧအဆၧကိၪ့ၥ့ၪအကၠီၩ့ မၩဂၭဂီၩ့ခွံၬဆၧအထၪ့ထီၫ",
			"13": "<sup>13</sup> နီၪလီၫ.- မၩဎံၫမၩလၩမူၭခိၪလၧအၥၭတၭး အစူၪ",
			"14": "<sup>14</sup> တဲၩ့န့ၡီၩ့အဖျဲၪလီၫ.- ယိခွါ, အနီၪလဖၪမွဲအဖၧၩ့ၥၭ နဲၩ့ထံၭၥံၪတၭ, ဆၧချဲၩ့ဘံၪၥွံၫလၧပနါဂၧၫ့နီၪ, မွဲအ ဆံၭမၬကလဲၪၬ အ့ၪမွဲအစီၩ့အမၩ့အလၫ့ဎွံၩ့ အဂဲးအ ကၠီၩ့နီၪ, မွဲပလၫနၪမိၥ့ၪလဂၩလဲၪ."
		},
		"27": {
			"1": "<sup>1</sup> တၭစယိဘၭချဲၩ့ဒံၭဆၧနီၪ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> ယွၩလၧအမၩန့ခွံၬယဆၧစ့ၩရၫ့နီၪ မၧၫ့ဝ့ၫ,ဒဲၦၥ့ၪ",
			"3": "<sup>3</sup> ဆၧလူၬလၧအမၩဆၫယၥၭတၭ,- လၧယၥၪအီၪဝ့ၫ လၧယဖၧၩ့အဘိၩ့ဘၭနီၪး ဒဲယွၩအၥၭအီၪဝ့ၫလၧယ",
			"4": "<sup>4</sup> နၫဖူၫဖၧၩ့နီၪတၭး- ယနိၭဖျံၩလဖၪ မိချဲၩ့အၧၩ့ဘၪ",
			"5": "<sup>5</sup> အ့ၬး ဒဲယဖျ့ၩနီၪမိအၪ့လီၫန့ဆၧဆ့အ့ၬ.- နၥံၪမွဲၦအ တီၩနီၪယအုၩ့လၩ့လၩလါအ့ၬး ယလချႃၭၥံၫဒံၭဘၪ နီၪ, ယအီၪက့ၪခွံၬယဆၧလၧၫ့ဆၧဎွ့ၩနီၪဆ့အ့ၬ.",
			"6": "<sup>6</sup> ယဆၧတီၩဆၧလီၩ့ ယမိဖီၪ့ထၬဒဲဖျါခွံၬနးစီၪ့အ့ၬး လ ဆိၩဒၪယၧၩယီၩ ယၥၭအီၪက့ၪဆၧမၪလၧယလီၩ့ အ့ၬ.",
			"7": "<sup>7</sup> ယဒုၪယဒၩနီၪ မွဲအအီၪဘဲၫၦအၧၩ့အၥိၭ,ဒဲၦလၧအ ဂဲထုၪ့ထၫ့ဒၩယၧၩ ဘဲၫၦလတီၩလလီၩ့ဘၪအၥိၭနီၪ",
			"8": "<sup>8</sup> ဆံၭ.- အဂဲးဘဲၫယီၩၦအၪ့လီၫဆၧလဂၩနီၪန့ဘၪဆၧ လါနၫ့,ထီးယွၩအ့ၪဒၪ့ထ့ၬခွံၬဝ့ၫတၭ, မွဲအဆၧယိလါ",
			"9": "<sup>9</sup> နီၪအိၭနီၪလဲၪ.- ထီးအဘၪဆၧခိဆၧဝီၩနီၪ အ့ၪကိၭ",
			"10": "<sup>10</sup> ၡၭထၪ့တၭ,မွဲယွၩမိဒိၭအနါဆ့ဧၪ.- မွဲအမိမုၬလၩ အၥၭလၧၦၥ့ၪဆၧလူၬအစူၪဖၧၩ့နီၪဆ့ဧၪး မွဲအမိကိၭ ၡၭထၪ့ယွၩကိၭအဆၧၫ့အထီဒ့ၭဆ့ဧၪ.",
			"11": "<sup>11</sup> ယမိၥီၪ့လိၪနၥံၪ လၧယွၩအစူၪ အဂဲးအကၠီၪ့တၭး ဆၧလၧအအီၪ လၧၦၥ့ၪဆၧလူၬနီၪ ယအီၪက့ၪၥူၪခွံၬ",
			"12": "<sup>12</sup> အ့ၬး- ယိခွါ,နၥံၪအနၫ့ဆါဒၪနၥံၪဝ့ၫ ဒၪဘၪကိၭဂၩ ဒ့ၭး အခိးမွဲနၥံၪချဲၩ့ဆၧပျီၩပျီၩနီၪ, မွဲအဂဲးဘဲၫၥ့ၪ လဲၪ.",
			"13": "<sup>13</sup> နၥံၪစံၭ, ၦအၧၩ့အဆၧလၧအန့ဘၪလၧယွၩ, ဒဲ ၦလၧအမၩၥၫ့ဆၧန့ၥၫ လၧၦၥ့ၪဆၧလူၬအစူၪဖၧၩ့လ",
			"14": "<sup>14</sup> ခီၫနီၪ,မွဲအယီၩး- အဖိၪအလံၩအ့ၪအၪထၪ့နီၪ မွဲလၧ နၭအဂးတၭ, ဒဲအဆၨၩအဆၬနီၪအၪ့ကိၪ ဘျဲၩအၪ့ဆ့",
			"15": "<sup>15</sup> အ့ၬး- ၦလၧအအီၪလၩ့ထးဝ့ၫလဖၪနီၪ, ဆၧၥံၫဒိၪမိ ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫး ဒဲအမုၪမဲၫလဖၪ မိဂၪ့ဘၪအ့ၬ.",
			"16": "<sup>16</sup> အဝ့ၫဒၪအ့ၪအီၪက့ၪကီၪ့စ့ၩ ဘဲၫဂၪ့ခိၪမုၬအၥိၭလါနၫ့,",
			"17": "<sup>17</sup> ဒဲတဲၩ့ဝဲၩဆၧကီၩ့ဆၧၥိၭ ဘဲၫကဖံၬအၥိၭ,- မွဲအတဲၩ့ ဝဲၩလါနၫ့တၭ,ၦအတီၩအလီၩ့မိၥိၭထၪ့ဝ့ၫတၭ, အစ့ၩ နီၪၦလၧအဆၧမၪလအီၪဘၪ မိအၪ့နၩ့ဖၭဝ့ၫဒၪလီၫ.",
			"18": "<sup>18</sup> အဝ့ၫဒၪမၩအဂံၪ့အဎၫ့ ဘဲၫဆၧအဎိၩ့အဎါအၥိၭနီၪ,",
			"19": "<sup>19</sup> ဒဲအတဲၩနီၪ ဘဲၫၦခိၭဆၧဖိၪအၥိၭနီၪလီၫ.- ၦၥထံၫ မံၫနၩ့လါနၫ့တၭ, ဘၪဆၧအီၪက့ၪကီၪ့ဝ့ၫအ့ၬး လဖျၭ",
			"20": "<sup>20</sup> မ့ၬအထးဖၧၩ့နီၪ မွဲအအီၪလၧၩ့အ့ၬ.- ဆၧဒုၭၥၭမဲၪ ဘဲၫထံၫလဖၪအၥိၭနီၪ မိချႃၭန့အဝ့ၫဒၪတၭး လၧမုနၩ",
			"21": "<sup>21</sup> လခီၫနီၪ, လံၩၥဝံၭဖျဲးန့ခွံၬဝ့ၫဒၪလီၫ.- လံၩမုထၪ့ဆိၬ န့ခွံၬအဝ့ၫတၭ,လၩ့မါပံၭး မွဲကဒၪယူၭ, လံၩလဖုၬနၫ့",
			"22": "<sup>22</sup> ထၪ့ခွံၬအဝ့ၫ လၧအလးနီၪလီၫ.- ယွၩစ့ၩရၫ့ဝ့ၫတၭ, ယၫ့ၥၭဝ့ၫအ့ၬး အဝ့ၫဒၪစဲၪ့ဖျိၭအ့ၪၥ့ၪတၭ, မွဲအမိစဲၪ့",
			"23": "<sup>23</sup> ထၪ့ခွံၬလၧအစူၪဖၧၩ့နီၪလီၫ.- ၦၡၩၥံၪဒဲၩအစူၪလၧ အမ့ၬယၫနီၪ, ကိၭဎီခွံၬအဝ့ၫလၧအလးဖၧၩ့ လၧဆၧ ဒုၪဒွ့ၪအၥီၫလီၫ."
		},
		"28": {
			"1": "<sup>1</sup> မွဲမၬ,စ့ၩအကၠီၪ့အီၪဝ့ၫ, ဒဲထီၫ့လၧၦၥိၫ့ဝ့ၫနီၪအလး",
			"2": "<sup>2</sup> အီၪဝ့ၫဆ့လီၫ.- ၦမၩန့ထၭလၧဂၪ့ခိၪမုၬအကျၩတၭ,",
			"3": "<sup>3</sup> လိးလမံၩ့ဖံၪထၪ့နီၪကဲၪထၪ့ထီးဝီၩနီၪလီၫ.- မွဲအအီၪ က့ၪဆၧခံၭအထုၬတၭ, အၪ့ဎူၫအၪ့ဎၬၥ့ၪယၫဆၧထီး အထုၬ,လိးၥံၪလဲၫ့ၥံၪ, ဆၧခံၭတၪ့,ဒဲဆၧၥံၫအလၩၡုၪ",
			"4": "<sup>4</sup> လီၫ.- ထီးၦၡၩလအီၪဘၪအလးနီၪ, အဝ့ၫဒၪခုၪ့ဆၧ ဖၧၩ့ဆ့ၭလၩ့ဆၧဘီၩ့လဘီၩ့း ခၪ့လယဲးလၩ့ဘၪနီၪ, လၩ့ဆဲၩဝ့ၫတၭ, ယဲၩ့လၧၦၡၩနီၪဝၭဝ့ၫဘဲၫနီၪလီၫ.",
			"5": "<sup>5</sup> ဆၧအၪ့ဂဲၫထၪ့လၧဂၪ့ခိၪအဖၧၩ့, ဒဲလၧအဖၫ့လၬဆၧ",
			"6": "<sup>6</sup> မၩဂၭဂီၩ့လၧမ့ၪလီၫ.- အလိးၥံၪလဲၫ့ၥံၪနီၪမွဲထၫ့မျါနံၩ",
			"7": "<sup>7</sup> လၩအလး, ဒဲထီၫ့ခိလီၪ့နီၪအီၪဝ့ၫဆ့လီၫ.- အဖၧၩ့ ၥၭနီၪထိၪဖိၪလံၪဖိၪၥံၪၥ့ၪယၫနးဘံၪ့အ့ၬး ဒဲလၫ့က",
			"8": "<sup>8</sup> ထၬအမ့ၬၥၪဒၪဘၪဆ့အ့ၬး- ဆၧဖိၪဆၧဎါအမံၩ့လၧ အၥၭဒူၩနီၪယဲးလၩ့ဝ့ၫအ့ၬ, ဒဲဆၬလၥၧၫ့အဒဲၩ့နီၪလ့ၩ",
			"9": "<sup>9</sup> ဘၪဝ့ၫဆ့အ့ၬး- ၦၡၩယူၬစိၩအစူၪလၧလိးမ့ၪအလီၩ့ တၭ,မွဲအမၩလၩ့ခၨခွံၬ ခိၪလီၩ့ၥံၪထီးအခၪ့ထံၭနီၪ",
			"10": "<sup>10</sup> လီၫ.- မွဲအမၩထံၫချိၬၥံၪလၧလိးကျၩနီၪ, ဒဲအမ့ၬၥၪ",
			"11": "<sup>11</sup> ၥံၪဒၪဘၪကယဲဆၧအဂ့ၩ ကိၭအမံၩ့ဒ့ၭနီၪလီၫ.- အ ဝ့ၫဘီၪ့ဘံၭထၬ ထံၫချိၬၥံၪ ဘဲၫၥိၭအထီးလၩ့ဆၩ့လ ဂ့ၩတၭး ဆၧလၧအအီၪၥူၪဝ့ၫလဖၪ ဆိၬထၪ့ဝ့ၫလၧ ဆၧဖၩ့အကျၩနီၪလီၫ.",
			"12": "<sup>12</sup> အ့ၪမွဲဆၧကိၪ့ၥ့ၪကိၪ့ဘၪနီၪဆၧမိဒၪန့ဝ့ၫခီၫခီၫလဲၪး",
			"13": "<sup>13</sup> ဒဲဆၧနၪၥ့ၪဆၧအဂဲးနီၪ, အလးအီၪခီၫခီၫလဲၪ.- အ ဎွ့ၩနီၪၦၡၩၥ့ၪယၫဝ့ၫအ့ၬ ဒဲလၧၦၡၩမၧၫ့ဝ့ၫအခးဖၧၩ့",
			"14": "<sup>14</sup> နီၪၦဒၪန့ဝ့ၫဆ့အ့ၬ.- ဆၧယိၬနီၪစံၭဝ့ၫ, အီၪလၧယ ဖၧၩ့အ့ၬးဒဲမၫဆမံၭစံၭဝ့ၫ, အီၪလၧယဖၧၩ့ဆ့အ့ၬ.",
			"15": "<sup>15</sup> ၦဎွ့ၩဝ့ၫလၧထီၫ့နီၪန့အ့ၬး ဒဲစ့ၩနီၪၦခံၫ့န့လၧအဎွ့ၩအ",
			"16": "<sup>16</sup> ဂးၥ့ၪဆ့အ့ၬ.- ခံၫ့ဝ့ၫန့ၫဎီၩ့ လၧအိဖၧၫအထီၫ့နီၪၥ့ၪ အ့ၬ,ထၫ့မျါမဟူၩယၩမွဲဂ့ၩ, ထၫ့မျါနံၩလၩမွဲဂ့ၩ, ဎွ့ၩန့",
			"17": "<sup>17</sup> ဝ့ၫၥ့ၪအ့ၬ.- ထီၫ့ဒဲလိးဖျီၪၥလၩနီၪၦယိဎီၩ့လၧအနီၪ ၥ့ၪအ့ၬ. လၧဆၧအဎၧၩ့အဎီထီၫ့ဆံၫ့ၥံၪနီၪ, ၦဎွ့ၩန့ဝ့ၫ",
			"18": "<sup>18</sup> ၥ့ၪအ့ၬ.- ၦကိၭထၪ့လိးနိၩ့ဒဲလိးဖျီၪၥလၩအမံၩ့နီၪၥ့ၪ အ့ၬးတၭဆၧန့ဘၪဆၧကိၪ့ၥ့ၪကိၪ့ဘၪနီၪ မွဲဂ့ၩနဲၪ့မ",
			"19": "<sup>19</sup> နံၬထၫ့မျါလဖၪနီၪလီၫ.- ကုၡၫအမနံၬဘၩ့အူၥပၫယၫ နီၪၦယိဎီၩ့လၧအဝ့ၫနီၪၥ့ၪအ့ၬး ခံၫ့ဝ့ၫန့ၫဎီၩ့ ထီၫ့ဆံၫ့",
			"20": "<sup>20</sup> နီၪၥ့ၪအ့ၬ.- တၭဆၧကိၪ့ၥ့ၪကိၪ့ဘၪနီၪ, မွဲအအီၪထၪ့ ခီၫခီၫလဲၪး ဒဲဆၧနၪၥ့ၪဆၧအဂဲးအကၠီၪ့နီၪ မွဲအလး",
			"21": "<sup>21</sup> အီၪခီၫခီၫလဲၪ.- မွဲအအီၪၥူၪခွံၬဝ့ၫ လၧၦမၧၫ့ဝ့ၫ ထီး အလူၬအမ့ၬၥၪနီၪ, ဒဲဆၧချႃၬဘံၭခွံၬဝ့ၫ လၧထိၪၥံၪ",
			"22": "<sup>22</sup> လံၪၥံၪလၧမူၭဖိၭဖၫ့နီၪလီၫ.- ဆၧမၩဂၭဂီၩ့,ဒဲဆၧၥံၫ နီၪစံၭဝ့ၫး ပနါဂၧၫ့အမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့ လၧပနါဖၧၩ့",
			"23": "<sup>23</sup> ၥံၪလီၫ.- ယွၩၥ့ၪယၫဖၧၩ့ၥၭ ဖိးလၧအအီၪး ဒဲအလးနီၪ",
			"24": "<sup>24</sup> အဝ့ၫဒၪၥ့ၪယၫဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫဒၪယိဖိး ထီၩ့လၧဂၪ့ခိၪအထုၬနီၪး ဒဲကယဲဆၧထီးအလူၬ အီၪ လၧမူၭခိၪအဖၫ့လၬယီၩ, မွဲအဒၪဘၪကိၭအမံၩ့ဒ့ၭဆ့",
			"25": "<sup>25</sup> လီၫ.- ထီးအမၩလံၩအလယၧးနီၪး ဒဲအတိၪ့န့ထံၫလ",
			"26": "<sup>26</sup> ဖၪဆ့တၭး- ထီးအစ့ၩရၫ့ဒုၭအီၪထၪ့ဆၧဆၧၩ့အထူၫ",
			"27": "<sup>27</sup> အရူၫ,ဒဲမၩဖၧၩ့ၥၭလၧလၫ့ဎွံၩ့အမ့ၪလၪအဂး- ထီး နီၪလဖၧၫ့မွဲအဒၪဘၪဝ့ၫတၭ, ဒုၭဖျီၪထၪ့ဝ့ၫး ဒဲအီၪက့ၪ",
			"28": "<sup>28</sup> ဂုးခၧၫ့ဝ့ၫတၭ,အၪ့ဎူၫအၪ့ဎၬၥ့ၪယၫဝ့ၫဒၪလီၫ.- တၭ အဝ့ၫစံၭၦၡၩ, ‘ယိခွါ, ဆၧၥၭမဲၪကဆါနီၪ, အနီၪမွဲ ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪလီၫ. ဒဲစဲၪ့ဒၪခွံၬဆၧအၧၩ့နီၪ, မွဲဆၧ ၥုၪ့ဖၭၥၭဖၭလီၫ.’"
		},
		"29": {
			"1": "<sup>1</sup> စယိဘၭချဲၩ့ဒံၭဆၧတၭး စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> ယဆိၫ့အီၪဘဲၫလၩလၧအဖီၩ့ခွံၬလဖၪအၥိၭနီၪး ဒဲ လၧမုနံၩလဖၪ လၧယွၩယိထဲၩ့ခွါထဲၩ့ ယၧၩတၭး",
			"3": "<sup>3</sup> ထီးအမ့ၪဒိၩ့ဖၩ့ထၪ့ လၧယခိၪဎွံၪအဖၫ့ခိၪး လၧအဝ့ၫ",
			"4": "<sup>4</sup> ဒၪအဆၧဖၩ့အကၠီၩ့နီၪ ယလ့ၩဖျီၫ့ဆၧခံၭလီၫ.- ဘဲၫ ယအီၪလၧ ယဂဲးယဘၭ မုနံၩလဖၪ အၥိၭတၭး အ ဆၧၫ့အထီလၧယွၩဖံၭၥိၭလိၬအၥၭလၧယၧၩ လၧယ",
			"5": "<sup>5</sup> တဲၩဖၧၩ့နီၪး- လၧၦၥ့ၪဆၧလူၬအီၪလၧယၥိၭအဘိၩ့",
			"6": "<sup>6</sup> ဘၭနီၪ,ဒဲယဖိၪယလံၩအီၪဖီၩ့ယၧၩဝၬဝၬး- လၧယ လ့ၩဆၧလၧဆၧနူထံၫလၩ့ဒၭအကျၩ ဒဲလိးၥံၪလဲၫ့ၥံၪ လူၫလၩ့န့ယၧၩလၧၥိၪအချိၬလဖၪလီၫ.",
			"7": "<sup>7</sup> လၧယလ့ၩထၪ့လၧဒိၩ့အတရၫ့နီၪ, ဒဲအီၪက့ၪယ",
			"8": "<sup>8</sup> လးဆၧၫ့နၩ့လၧဆၧအီၪကီၪ့အလးတၭး- ဖိၪၥၪခွၫဒၪ ဘၪယၧၩနီၪအီၪက့ၪၥူၪခွံၬအၥၭတၭ, ၦၥၭၡါၥံၪဂဲထုၪ့",
			"9": "<sup>9</sup> တၭ,ဆၧၫ့ထုၪ့ဝ့ၫဒၪလီၫ.- ၦဒိၪဖၭဒိၪၥံၪချဲၩ့ဆၧအ့ၬ တၭ,မွဲအဝ့ၫၥံၪအီၪက့ၪအစူၪ လၧအနိၭအလီၩ့လီၫ.",
			"10": "<sup>10</sup> ၦအခိၪၥံၪအလူၥီၫလၩ့မါပံၭတၭ, အဝ့ၫၥံၪအဖျ့ၩဘုၭ",
			"11": "<sup>11</sup> ထၬလၧအထၫချၭနီၪလီၫ.- လၧနါနီၪနါဂၧၫ့တၭ, မွဲအ ဆိၪဂ့ၩယၧၩ, ဒဲမ့ၬၥၪနီၪဒၪဘၪတၭထိးအၥၭလၧယ",
			"12": "<sup>12</sup> ဂးလီၫ.- အဂဲးဘဲၫယီၩ ၦၡၪ့ဖိၪယၬဖိၪ ကိၭၡၭထၪ့ တၭ,ယမၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪ, ဒဲဖိၪဎွ့ၪနီၪဆ့, ဒဲၦလၧ",
			"13": "<sup>13</sup> ဆၧမၩဆၧၩ့ဝ့ၫလအီၪဘၪနီၪဆ့လီၫ.- ၦလၧအဘူၭ ကၪအမိဘၪဆၧဂၭဂီၩ့ အဆၧဆိၪဂ့ၩလၩ့ဘၪယၧၩ တၭးၦမုၪမဲၫအၥၭနီၪ ယဒုၭၥံၫကျံၩလၧဆၧၥၭထိၬအ",
			"14": "<sup>14</sup> ဖၧၩ့နီၪလီၫ.- ယကီၩ့ထၪ့ၥိၭထၪ့ဆၧတီၩဆၧလီၩ့တၭ, မွဲအကဲၪထၪ့ယကီၩ့ယၥိၭဆ့း ယဆၧတီၩဆၧလီၩ့",
			"15": "<sup>15</sup> မၩအၥၭဘဲၫဝိၬလိၫ့ ဒဲခိၪဖုၪ့အၥိၭနီၪလီၫ.- ယကဲၪ မ့ၬၥၪလၧၦမ့ၬဘျီၪအဂး, ဒဲခၪ့လၧၦခၪ့ဂၭဂီၩ့အဂး",
			"16": "<sup>16</sup> လီၫ.- လၧၦၡၪ့ဖိၪယၬဖိၪအဂးနီၪ, ယကဲၪအဖါတၭး ၦလၧယလၥ့ၪယၫဘၪအမူၭနီၪ, ယအၪ့ဎူၫအၪ့ဎၬၥ့ၪ",
			"17": "<sup>17</sup> ယၫလီၫ.- ဒဲယမၩခါ ၦအၧၩ့ဖိၪအခၪလၬဎွံၪ, ဒဲယ",
			"18": "<sup>18</sup> အၪ့ဂူၬန့ခွံၬဆၧလၧအအဲၪ့ထၬဝ့ၫနီၪလီၫ.- တၭယစံၭး ယၥၭမိစဲၪ့ထၪ့ခွံၬလၧယၥွံၫဖၧၩ့တၭ, ယမိမၩအၪထၪ့",
			"19": "<sup>19</sup> ယမုနံၩလဖၪဘဲၫမ့ၭအၥိၭတၭး- ယဝံနီၪဘၪလၧထံၫ ၥံၪ,ဒဲဆၩ့ထံၫနီၪအီၪလၧယထဲၩ့လဖၪ အလီၩ့ၥၫ့နၩ",
			"20": "<sup>20</sup> ချီၩ့တၭး- ယလၩယဖၩ့ၥၫ့ထၪ့လၧယဖၧၩ့, ဒဲယချံၪ ဘၪဆၧမၩဆီၪ့ထၪ့လၧယစူၪဖၧၩ့နီၪလီၫ.",
			"21": "<sup>21</sup> ၦၡၩခိၭနၪယလူး ဒဲအီၪခိၭဆၧတၭးအီၪလၩ့မါပံၭ",
			"22": "<sup>22</sup> လၧယမိကိၪ့ထၪ့ဆၧအဂးလီၫ.- ယချဲၩ့ဆၧဂီၩ့တၭ, အဝ့ၫၥံၪစံၭဆၧနးမံၩ့အ့ၬး ဒဲယဆၧချဲၩ့နီၪလၩ့ဘၪအ",
			"23": "<sup>23</sup> ဝ့ၫၥံၪလီၫ.- မွဲကဒၪယူၭ, အဝ့ၫၥံၪအီၪခိၭယၧၩ, ဘဲၫ လၧဆၧမိဆၧၩ့လၩ့အဂးအၥိၭနီၪ, ဒဲအၩ့ထၪ့အနိၭ",
			"24": "<sup>24</sup> ဘဲၫလၧဆၧဆၧၩ့အလးခဲၫ့အဂးအၥိၭနီၪလီၫ.- ယနံ ဘၪအဝ့ၫၥံၪမိလံၬတၭ,မွဲအနဲၩဝါအ့ၬ, ဒဲယမ့ၬအဖၩ့",
			"25": "<sup>25</sup> နီၪအဝ့ၫၥံၪမၩလၩ့ယၧၫ့ဝ့ၫၥ့ၪအ့ၬ.- ယရွံန့အဝ့ၫၥံၪ အဖၧၩ့ၥၭဒဲဆၧၫ့နၩ့ဘဲၫအခိၪအၥိၭ, ဒဲအီၪဘဲၫစဎွၩ လၧၥုၭမုခမျၧးအကျၩအၥိၭ လၧၦၥုၪ့အုၭၥၭအုၭဆၧ အကျၩနီၪ,ဘဲၫၦချဲၩ့မုၬထၪ့ဆၧလဂၩအၥိၭနီၪလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ၦလၧအၥၭဘၪ့နဲၪ့ယၧၩလဖၪနီၪ, ချဲၩ့ကြၩ့ထမးယၧၩတၭ, အဝ့ၫၥံၪအဖါလဖၪဘဲၫၥိၭ ယမိအီၪက့ၪဝ့ၫလၧယၥိၪၥံၪဘ့ၪၥံၪ အဒီၪ့အထွံၪကျၩ",
			"2": "<sup>2</sup> နီၪယဒူၩယၪ့အ့ၬ.- အဝ့ၫၥံၪအစူၪအဂဲးအဘၭဒၪလ့ၬ နီၪ,မွဲအန့ကၩဆၧနီၪလၫလၧယဂးလမံၩ့လဲၪ. ၦလၧ",
			"3": "<sup>3</sup> အဂဲးအဘၭမိလူၬဝ့ၫ လၧဆၧၡၪ့ဆၧနၭအဂးနီၪ,- ဒဲ လၧဆၧၥၭဝံလၩ့ဒိၩအကၠီၩ့နီၪဎွ့လၩ့ဝ့ၫတၭ, အၪ့ဆၧ လၧမံၩ့လၬကျၩလၧဆၧအီၪယူဝ့ၫ အဆၧခံၭနီၪလီၫ.",
			"4": "<sup>4</sup> မၩန့ဆၧဒိၭဆၧလၪလၧဆၧၡိၬကျၩနီၪ, ဒဲရီၥံၫ့အထံ",
			"5": "<sup>5</sup> လၧဆၧအၪ့အဂးတၭး- ဘၪဆၧနၫ့ထၪ့ခွံၬလၧၦၡၩ အကျၩတၭ ဆၧကိၭဎီထွ့ၫအဝ့ၫၥံၪဘဲၫဆၧအၪ့ဂူၪအ",
			"6": "<sup>6</sup> ၥိၭတၭး- အဝ့ၫၥံၪအီၪဝ့ၫလၧခိၪလီၩ့ဆူၭမၩၥၭမဲၪ ဆၧအဖၧၩ့နီၪ, လၧဂၪ့ခိၪဒဲလိးၥံၪလဲၫ့ၥံၪအအိၩဖၧၩ့",
			"7": "<sup>7</sup> နီၪလီၫ.- ကိၭထၪ့ဝ့ၫလၧဆၧၡိၬကျၩဘဲၫကၥ့ၪယီၩ့အ ၥိၭတၭ, အီၪကီၪ့ဝ့ၫလၧဆၧဆူၪဆၧမဲၪအဖၫ့လၬနီၪ",
			"8": "<sup>8</sup> လီၫ.- မွဲၦဂီၩ့အဖိၪအလံၩ,မွဲကဒၪ,ၦလၧအမံၩ့လအီၪ ဘၪနီၪအဖိၪအလံၩတၭ, ဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫလၧထံၫ ၥံၪခးၥံၪအဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> တၭဘိၩ့နဲၪ့ယီၩ ယကဲၪထၪ့အဝ့ၫၥံၪအထၭခိၪဒဲယ",
			"10": "<sup>10</sup> ကဲၪထၪ့ဆၧချဲၩ့ဒီၩ့အလးလၧအဝ့ၫၥံၪအဂးလီၫ.- အ ဝ့ၫၥံၪၥၭလိၪယၧၩတၭ, ဆၧၫ့ထုၪ့ယဲၩ့လၧယၧၩတၭ,",
			"11": "<sup>11</sup> မွဲအထိၪဖျံၭဆၧလၧယမ့ၬယၫဆ့လီၫ.- အဂဲးဘဲၫယီၩ ယွၩကွဲၪလၩ့အဖျံၩဒဲဆၪ့လၩ့ယၧၩတၭး အဝ့ၫၥံၪဖျါ",
			"12": "<sup>12</sup> ခွံၬဆ့ခၪဖျံၩလၧယမ့ၬယၫလီၫ.- လၧယစူၪထွ့ၪလခီၫ ၦလဒီၪ့ဂဲထုၪ့တၭ, ဆၪ့ခွံၬယခၪ့ၥံၪ, ဒဲမၩထၪ့အလး",
			"13": "<sup>13</sup> အကျဲၩဘဲၫၥိၭအမိမၩဂၭဂီၩ့ယၧၩလီၫ.- အဝ့ၫၥံၪမၩ ဂၭဂီၩ့ယဖၧၩ့ၥၭ, မၩနၭထၪ့ယဆၧၡၪ့ဆၧနၭတၭ, မွဲၦ",
			"14": "<sup>14</sup> လၧဆၧမၩဆၧၩ့ဝ့ၫအီၪနးဂၩအ့ၬး- အဝ့ၫၥံၪဂဲၫနုၬဘဲၫ ဆၧဘုၪ့ဖိးဖၭလဲအၥိၭတၭ, ချံးအၥၭလၧဆၧလၩ့ဎီး",
			"15": "<sup>15</sup> အဖၫ့လၬလီၫ.- ဆၧမၩၥၭမဲၪၥံၪ ကၠၪအၥၭ လၧယ လီၩ့တၭ,ယလးမုၬဖၭဒိၪနီၪ အဝ့ၫၥံၪလီၩ့ဆီးဘဲၫလံၩ အၥိၭတၭ, ယဆၧဘီၪဆၧယီၫနီၪ ဖီၩ့ခွံၬဝ့ၫဘဲၫဆၧ",
			"16": "<sup>16</sup> အုၪ့အၥိၭနီၪလီၫ.- တၭဘိၩ့နဲၪ့ယီၩယၥၭဘၪဆၧ လူၫလၩ့ခွံၬဝ့ၫလၧယဖၧၩ့တၭး ဆၧခိဆၧဝီၩအမုနံၩ",
			"17": "<sup>17</sup> လဖၪဖီၪ့ထၬယၧၩလီၫ.- လၧမုနၩလခီၫယဎွံၪၥံၪဘၪ ဆၧဆ့ၭဖျီၫ့ဝ့ၫး ဒဲယထီၪ့လဖၪအီၪပွံၭချႃၭနးစီၪ့အ့ၬ.",
			"18": "<sup>18</sup> လၧအစီၩ့ဒိၪ အမၩ့ဒိၪအကၠီၩ့နီၪ, ယဆၧစူၭဆၧဆၫ ကဲၪထၪ့ယကီၩ့ယၥိၭတၭး ဘဲၫယဆဲၫ့အၥိၭမွဲအဘီၪ့",
			"19": "<sup>19</sup> ထၬယၧၩလီၫ.- ယွၩခွံၬလၩ့ယၧၩလၧဆၧလၩ့လၧၩ့ အဖၧၩ့တၭ, ယကဲၪထၪ့ဘဲၫဂၪ့ခိၪမုၬ ဒဲဖံၫ့ချၪအၥိၭဆ့",
			"20": "<sup>20</sup> လီၫ.- ယကိၭထၪ့နၧၩတၭ,နစံၭဆၧၫ့ယၧၩအ့ၬး ယ",
			"21": "<sup>21</sup> ဆၧၫ့ထုၪ့တၭ, နဒၪဘၪယၧၩအ့ၬး- နကဲၪထၪ့ဆၧမၩ အၧၩ့ယၧၩတၭ,လၧနစူၪဆီၪ့နီၪ, နထၫ့ဒုၪဒၩယၧၩ",
			"22": "<sup>22</sup> လီၫ.- နဆိၬထၪ့ယၧၩလၧလံၩအအီၪး ဒဲဒုၭထူၬယၧၩ",
			"23": "<sup>23</sup> ဒဲဒုၭဖံၪထၪ့ယၧၩလၧလဖုၬအဆၧဂၭဂီၩ့နီၪလီၫ.- အ ဂဲးဘဲၫယီၩယၥ့ၪယၫလၧနမိၥိၫ့ယၧၩ လၧဆၧၥံၫဒိၪအ အီၪး ဒဲလၧဂံၪ့လၧဆၧဖၭဝဲၩဝ့ၫ လၧကယဲၦမၧၫ့ထီးအ",
			"24": "<sup>24</sup> လူၬအဂးလီၫ.- မွဲလါနၫ့တၭထီးအမၩဂၭဂီၩ့ဆၧနီၪ, ဆၧအၪ့ကံၩ့အၪ့ယၫအ့ၪအီၪလၧအကျၩတၭး မွဲအယူၬ",
			"25": "<sup>25</sup> ထၪ့အစူၪလၧဆၧလၩ့ဎီးခွံၬ အဖၫ့ခိၪနီၪဆ့အ့ၬ.- မွဲ မၬ,ၦလၧအဘၪဆၧခိဆၧဝီၩနီၪ, ယမ့ၬထံၫလၩ့လၧ အကၠီၩ့တၭ, ဒဲယၥုၪ့အုၭၥၭအုၭ လၧၦဘၪၡၪ့ဘၪနၭ",
			"26": "<sup>26</sup> အကၠီၩ့လီၫ.- ထီးယယိလါဆၧဂ့ၩအဖၧၩ့ၥၭနီၪ, ဆၧ အၧၩ့ဂဲၫထၪ့ဝ့ၫတၭး ယအီၪခိၭဆၧဖၩ့လါနၫ့နီၪ,",
			"27": "<sup>27</sup> ဆၧခံၭဂဲၫထၪ့ဝ့ၫဒၪလီၫ.- ယဎွံၬၥံၪလၬထၪ့တၭ,အီၪပွံၭ ၥ့ၪနးဆံၭအ့ၬး ဆၧခိဆၧဝီၩအမုနံၩလဖၪ ချႃၭန့ယၧၩ",
			"28": "<sup>28</sup> လီၫ.- ယလီၩ့ထၪ့ၥၧၫ့လါနၫ့, မွဲလၧမုခိအကၠီၩ့နီၪဆ့ အ့ၬး လၧဆၧအီၪကီၪ့အကျၩနီၪ ယဆၧၫ့ထုၪ့အၪ့ကံၩ့",
			"29": "<sup>29</sup> ဆၧမၩဆၧၩ့လီၫ.- ယထၧၫ့ဖုဝဲလၧထွံၪဂၪ့ခိၪၥံၪ, ဒဲ",
			"30": "<sup>30</sup> ထၧၫ့ထံၩထၧၫ့ၥိၭ လၧထိၪကလအူၭနီၪလီၫ.- ယဖံၭ ယယၪထၪ့ၥၧၫ့တၭ, လၩ့ထ့ၬခွံၬဝ့ၫတၭ,ယဎွံၪလဖၪ",
			"31": "<sup>31</sup> ဎဲၫ့ထၬလၧဆၧခိအကၠီၩ့နီၪလီၫ.- ထီးနီၪယၥၭကဲၪထၪ့ ဆၧၥုၪ့အုၭၥၭအုၭတၭ, ယပံၩအၥီၫနီၪလၧၦမ့ၬထံၫ လၩ့အၥီၫနီၪလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> ယအုၩ့လၩ့ဆၧလၧယမ့ၬၥၪၥံၪတၭ, မွဲယမိယိၦမုၪ",
			"2": "<sup>2</sup> နၩ့နီၪမိၥ့ၪဘဲၫၥ့ၪလဲၪ.- အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, လၧ ယွၩလၧထၭလခီၫနီၪ, မွဲယမိန့ဘၪဆၧနီၪလမံၩ့လဲၪး ဒဲယမိန့ၥၫဆၧလၧၦၥ့ၪဆၧလူၬအီၪလၧဆၧထၪ့ထီၫနီၪ",
			"3": "<sup>3</sup> ဆၧနီၪလမံၩ့လဲၪ.- ဆၧဂၭဂီၩ့ဂၭစၪအီၪလၧၦအၧၩ့ အဂးနီၪ,မွဲအ့ၬဧၪး ဒဲဆၧစ့ၩရၫ့လၩ့မဲၩဒၪဆၧလၧၦ",
			"4": "<sup>4</sup> မၩအၧၩ့မၩၥၫ့ဒၪဆၧအဂးနီၪ,မွဲအ့ၬဧၪ.- အဝ့ၫလဂၩ ဒၪဘၪယဖၧၩ့ၥၭလဖၪနီၪ, ဒဲဝံထၪ့နၬထၪ့ယခၫထၪ့လ",
			"5": "<sup>5</sup> ဖၪထီးအလူၬမွဲအ့ၬဧၪ.- ယအ့ၪလ့ၩလၧဆၧကဘျံၭ ကဘျၪအဖၧၩ့နီၪ, ဒဲယခၪ့အ့ၪလ့ၩချဲၫ့လီၩ့ဆီးဆၧအၪ့",
			"6": "<sup>6</sup> လီၫဝ့ၫနီၪး- မွဲယွၩခံၫ့ယၧၩလၧခံၫ့တီၩတီၩအဖၧၩ့နီၪး",
			"7": "<sup>7</sup> ဘဲၫၥိၭအမိၥ့ၪယၫယမၩဆၧအလၧၫ့ဎွ့ၩနီၪဆံၭ.- ယ ခၪ့ခၫထၪ့ဆၧနီၪအ့ၪဂၭဖျိၭဖၧၩ့ၥၭတၭ, ယၥၭအ့ၪဖိၬ ယမ့ၬၥၪၥံၪအခဲၫ့နီၪး ဒဲဆၧၥၭလိၪအ့ၪဘုၭထၬလၧယ",
			"8": "<sup>8</sup> စူၪတၭ,- ထီးနီၪလဖၧၫ့, မွဲယဎွံၪဆၧတၭ,ဂူၫဂၩလဂၩ ကူၭဝ့ၫဒၪဘီၪး ဒဲယဆၧၥုၪ့လၩ့ဖျၭလၩ့လဖၪနီၪ, မွဲ",
			"9": "<sup>9</sup> အဘၪဆၧထ့ၭထၪ့ခွံၬဝ့ၫဒၪဘီၪ.- ယၥၭအ့ၪဘၪဆၧ အၪ့လွ့ၫလၧၦမုၪနီၪ, ဒဲယအီၪခိၭၥူၪဆၧလၧၦအီၪဘူၭ",
			"10": "<sup>10</sup> ယၧၩအတရၫ့ထံၭနီၪး- ထီးနီၪလဖၧၫ့မွဲယမၫဂူၬဆုၪ့ ဂူၬလၧဂူၫဂၩအဂးတၭ, မွဲဂူၫဂၩမံၫဎုၬ လၧအဝ့ၫဒၪ",
			"11": "<sup>11</sup> ဘီၪ.- အဂဲးဘဲၫယီၩ အနီၪမွဲဆၧအၧၩ့ဖၭဒိၪတၭး မွဲ ကဒၪယူၭ, မွဲဆၧအၧၩ့ဘၪဆဲၫ့ လၧၦစ့ၩရၫ့ဆၧလဖၪ",
			"12": "<sup>12</sup> နီၪလီၫ.- အဂဲးဘဲၫယီၩမွဲမ့ၪလၧအမိအၪ့ဆၧထီၩ့လၧ ဆၧဂၭဂီၩ့ဂၭစၪနီၪး ဒဲမိထ့ၭန့ခွံၬကယဲယဆၧအၪထၪ့",
			"13": "<sup>13</sup> ထီးအလူၬလီၫ.- ယဎီးမုၪမွဲဂ့ၩ, ယဎီးခွၫမွဲဂ့ၩး ထီး အချဲၩ့ခွး လၧယၧၩတၭ, ယအ့ၪမၩကြၩ့ထမးအခွး",
			"14": "<sup>14</sup> နီၪး- ထီးနီၪလဖၧၫ့ယွၩအ့ၪဂဲထုၪ့တၭ,မွဲယမိမၩဘဲၫ ၥ့ၪလဲၪးအဝ့ၫအ့ၪစ့ၩရၫ့ယၧၩတၭ, မွဲယမိချဲၩ့ဆၧၫ့ဆၧ",
			"15": "<sup>15</sup> ဘဲၫၥ့ၪလဲၪ.- ၦလၧအမၩကဲၪထၪ့ယၧၩလၧဒၧၩ့လး ဖၧၩ့နီၪ,မွဲအမၩကဲၪထၪ့အဝ့ၫဒၪဆ့, မွဲအ့ၬဧၪး ၦလ ဂၩဎးနီၪတဲၩ့ဝဲၩပၧၩ လၧဒၧၩ့လးဖၧၩ့နီၪ, မွဲအ့ၬဧၪ,",
			"16": "<sup>16</sup> ၦၡၪ့ဖိၪယၬဖိၪနီၪ ယအ့ၪပဒၩ့ထၬ ဆၧလၧအဆိၫ့န့ ဘၪနီၪ, ယအ့ၪဒုၭလၩ့မါၦမုၪမဲၫအမ့ၬၥၪလဖၪတၭး",
			"17": "<sup>17</sup> ယအ့ၪအၪ့ယဆၧလလီၪ့လဂၩဎးနီၪ, ဒဲၦဖိၪဎွ့ၪလအၪ့",
			"18": "<sup>18</sup> ဘၪတၭး- (မွဲအဒိၪထၪ့လၧယၥိၭ လၧယဖိၪၥၪခွၫ လံၩလံၩဘဲၫလၧထၧၫ့ဖိၪဖါအၥိၭနီၪ, ဒဲယၥိၫ့ဂၧၩ့ၦမုၪ",
			"19": "<sup>19</sup> မဲၫလၧယမိအဒၧၩ့လးဖၧၩ့ယူၭလီၫ.)- ယအ့ၪဒၪဘၪ ၦဘၪဆၧဂၭဂီၩ့ဂၭစၪ လၧအကီၩ့အၥိၭလအီၪဘၪအ ကၠီၩ့,ဒဲၦၡၪ့ဖိၪယၬဖိၪ အဆၧလုၬဘံၭလအီၪဘၪတၭး",
			"20": "<sup>20</sup> အယးဒံၩ့နီၪအ့ၪလဆိၪဂ့ၩဘၪယၧၩ, ဒဲယၥိၪဖိၪလ",
			"21": "<sup>21</sup> ဖၪအဖံၭအ့ၪလမၩလၧၩ့ထၪ့ဘၪတၭး- လၧယဒၪဘၪ ဆၧမၩဆၧၩ့ယၧၩ လၧတရၫ့ဖၧၩ့အကၠီၩ့နီၪ, ယအ့ၪ",
			"22": "<sup>22</sup> ယူၬထၪ့ဘၪစူၪထၫ့ဒၩၦဖိၪဎွ့ၪတၭး- ထီးနီၪလဖၧၫ့မွဲ ယစူၪလၩ့ထ့ၬခွံၬ လၧယခိၬထံၭခိၪ, ဒဲယစူၪဒူၪလၩ့",
			"23": "<sup>23</sup> ထ့ၬခွံၬလၧစူၪဆၧၫ့နီၪဆံၭး- အဂဲးဘဲၫယီၩယွၩအဆၧ မၩဂီၩ့နီၪ မၩၥၭမဲၪယၧၩး ဒဲလၧအဝ့ၫဒၪ အစီၩ့ဒိၪအ မၩ့ဒိၪအမ့ၬယၫနီၪယဂဲးယဘၭအီၪအ့ၬ.",
			"24": "<sup>24</sup> ထီၫ့နီၪယအ့ၪအီၪက့ၪလၧယဆၧယိလါအဂး, ဒဲစံၭ",
			"25": "<sup>25</sup> ထီၫ့ဆံၫ့နီၪး နမွဲယဆၧဒိၭနဲၩ့ယၥၭဖီၩး- လၧယစူၪ လးခၪ့ခိၪအၪအကၠီၩ့နီၪ, ဒဲလၧယစူၪန့ဘၪဆၧအၪအ",
			"26": "<sup>26</sup> ကၠီၩ့ယအ့ၪၥုၪ့ထိၬၥၭထိၬတၭး- မုဖၩ့ထၪ့အဘိၩ့ဘၭ နီၪ,ယအ့ၪဒၪဘၪ, ဒဲလၩလၧအလ့ၩဆၧလၧအဆၧ",
			"27": "<sup>27</sup> ယုၩ့ယဲအဖၧၩ့နီၪး- ဒဲယၥၭဘၪဆၧအၪ့လွ့ၫၥူၪဝ့ၫ,ဒဲ",
			"28": "<sup>28</sup> ယနိၭအ့ၪအဲၪဂါယစူၪတၭး- အယီၩလမံၩ့ဆ့မွဲဆၧ အၧၩ့ဘၪဆဲၫ့ လၧၦစ့ၩရၫ့ခွးလဖၪနီၪ အဂဲးဘဲၫယီၩ အ့ၪမွဲဘဲၫနီၪတၭ, မွဲအမၩယူၭဆၧကဘျံၭကဘျၪလၧ",
			"29": "<sup>29</sup> ယွၩလၧဆၧထၪ့ထီၫယူၭလီၫ.- လၧယဒုၪယဒၩဘၪ ၡၪ့ဘၪနၭအကၠီၩ့နီၪ, ယအ့ၪၥုၪ့ထိၬၥၭထိၬ ဒဲမၩမုၬလၩ ယၥၭလၧဆၧအၧၩ့လၩ့ဘၪ အဝ့ၫဒၪအကၠီၩ့တၭး",
			"30": "<sup>30</sup> (လၧယအၪ့ကံၩ့ဆၧဆိၪအၧၩ့ လၩ့ဘၪအဝ့ၫဒၪအၥၭ",
			"31": "<sup>31</sup> နီၪ,ယဖ့ၪလၫ့ယနိၭမၪဘၪဆၧအ့ၬ.)- ၦၡၩအီၪလၧ ယတဲၩဖၧၩ့အ့ၪလစံၭဘၪဘဲၫယီၩ, ၦလဂၩဂၩလအၪ့",
			"32": "<sup>32</sup> ဘျဲၩအၪ့ဘၪအဆၧယၪနီၪ, မွဲအအီၪခီၫခီၫလဲၪး- (ၦ မွံၩမံၫဘၪ လၧခီၫ့အ့ၬး ယဝဲထၪ့ယတရၫ့ လၧၦလ့ၩ",
			"33": "<sup>33</sup> ဆၧအဂး)- ယအ့ၪချႃၬဘံၭခွံၬယဆၧအမၪဘဲၫစအၫ ဒၫ့အၥိၭ, ဘဲၫၥိၭယမိအီၪက့ၪၥူၪခွံၬ ယဆၧအၧၩ့လၧ",
			"34": "<sup>34</sup> ယၥၭနၫအဖၧၩ့အကၠီၩ့နီၪး- ထီးနီၪလဖၧၫ့မွဲယၥၭမဲၪ ဆၧအီၪကီၪ့ဖၭဒိၪနီၪ, မွဲဆၧအဒီၪ့လဖၪမၩကြၩ့ထမး ယၧၩ,ဒဲယအီၪလၩ့မါပံၭတၭ, မွဲယထီးစဲၪ့ထၪ့ခွံၬလၧ",
			"35": "<sup>35</sup> ယတရၫ့နီၪနးဆိၭလဂ့ၩး- မွဲယွၩခိၭနၪလါယလူဆံၭး ယိခွါ, ယဆိၫ့ဆၧလမံၩ့ လၧၦၥ့ၪဆၧလူၬ မိချဲၩ့ဆၧၫ့ ယၧၩးဒဲၦလၧအချဲၩ့ခွးယၧၩ မိကွ့ၭန့အမူၭ အဂဲးအ",
			"36": "<sup>36</sup> ကၠီၪ့လီၫ.- မွဲမၬ, လၧယခိၬထံၭခိၪအလီၩ့နီၪယမိယိၭ ဒၪယဝ့ၫတၭး ယမိချႃၬထၪ့ဝ့ၫဘဲၫၥရဖူၩအၥိၭနိၪလီၫ.",
			"37": "<sup>37</sup> ယမိဒုၭနဲၪအဝ့ၫဒၪလၧယခၫထၪ့ဆၧထီးအလူၬ, ယမိ လ့ၩဘူၭအဝ့ၫဘဲၫ လၧၦဒိၪဖၭဒိၪအအီၪအၥိၭနီၪလီၫ.",
			"38": "<sup>38</sup> ယဂၪ့ခိၪလဝၩ့အ့ၪကိၭထၪ့ထၫ့ဒၩယၧၩ, ဒဲအကၠီၪ့ၥံၪ",
			"39": "<sup>39</sup> အမ့ၬထံၫအ့ၪလၩ့တၭး- ယအ့ၪအၪ့အဆၧၥၪလဖၪ လၧယလဖ့ၪလၫ့ဘၪအဎွ့ၩနီၪ, ဒဲဒုၭစဲၪ့ထၪ့ခွံၬအက",
			"40": "<sup>40</sup> ဆါလဖၪအၥၭမၧၫ့နီၪး- မွဲဆၧဆူၪဆၧမဲၪထၪ့လၧ ဘုၪကၠိၩ့အလးနီၪ, နၪ့ၥံၪမံၩ့ၥံၪလၧဘုၪမုယီၩအလး နီၪဆံၭ.စယိဘၭအဆၧချဲၩ့လဖၪထုၬဝ့ၫဒၪလီၫ."
		},
		"32": {
			"1": "<sup>1</sup> တၭလၧစယိဘၭအီၪက့ၪတီၩ အီၪက့ၪလီၩ့ဒၪအၥၭ အကၠီၩ့နီၪ, ၦၥၧၫ့ဂၩၥံၪအီၪထီခွံၬ လၧအချဲၩ့ဆၧၫ့အ",
			"2": "<sup>2</sup> ဝ့ၫဒၪလီၫ.- ထီးနီၪလဖၧၫ့ ၦတၧဇၭဖိၪဘၪဆဲၫ့လၧစ ရၫ့အဂံၪ့ဒီၪ့နီၪ, စဘၫရခ့လၭအဖိၪခွၫ, စအံၫလဲဟုၫအ ၥၭထၪ့ခဲၩထၪ့ဝ့ၫတၭး အၥၭထၪ့နီၪခဲၩထၪ့ထၫ့ဒၩ စယိဘၭလဂၩ, အဂဲးဘဲၫယီၩ လၧအဝ့ၫဒၪအီၪက့ၪ",
			"3": "<sup>3</sup> တီၩအီၪက့ၪလီၩ့အၥၭဒၪဝ့ၫအၪနဲၪ့ယွၩနီၪလီၫ.- ဒဲလၧ အထံၩအၥိၭၥၧၫ့ဂၩလဖၪနီၪ, မွဲအၥၭထၪ့ခဲၩထၪ့ထၫ့ ဒၩအဝ့ၫၥံၪဆ့း အဂဲးဘဲၫယီၩမွဲအစ့ၩရၫ့စၪလါနၫ့စယိ",
			"4": "<sup>4</sup> ဘၭတၭ, ချဲၩ့ဆၧၫ့ဝ့ၫနီၪၥ့ၪဆ့အ့ၬ.- တၭလၧအဝ့ၫၥံၪ အၥၭၡါနဲၪ့စအံၫလဲဟုၫအကၠီၩ့တၭ, အဝ့ၫနီၪအီၪခိၭ",
			"5": "<sup>5</sup> ဒၪဆၧဘဲၫနီၪ, လချဲၩ့ဆၧၫ့ဘၪစယိဘၭနီၪလီၫ.- တၭ စအံၫလဲဟုၫဒၪဘၪ လၧဆၧချဲၩ့ဆၧၫ့လအီၪဘၪလၧၦ ၥၧၫ့ဂၩၥံၪအနိၭဖၧၩ့နီၪတၭ, အၥၭထၪ့နီၪခဲၩထၪ့ဝ့ၫ",
			"6": "<sup>6</sup> ဒၪလီၫ.- ထီးနီၪလဖၧၫ့ၦဘၧဇၭဖိၪ စဘၫရခ့လၭအဖိၪ ခွၫစအံၫလဲဟုၫချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪး ယဝ့ၫဒၪယမွဲၦၥၭဘၪ့တၭ, နၥံၪဝ့ၫဒၪနၥံၪမွဲၦၥၭၡါ က့ၭယူၭတၭ, အခိးမွဲယၥၭမဲၪဆၧနီၪ, ဒဲနဲၪဖျီၪထၪ့ယ",
			"7": "<sup>7</sup> ၥၭဒၪယဝ့ၫဘုၪ့ဝါဆ့အ့ၬ- ယစံၭ, မုနံၩလဖၪမိဘၪချဲၩ့ ဆၧ, ဒဲနံၪ့အၪအၪလ့ၬၥံၪ မိၥီၪ့လိၪဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ",
			"8": "<sup>8</sup> လီၫ.- အ့ၪမွဲၥၭအီၪလၧၦၡၩအဖၧၩ့တၭ, ၦၥ့ၪဆၧလူၬ",
			"9": "<sup>9</sup> နီၪအၥၪဖ့ၪလၫ့အဝ့ၫၥံၪအၥုၪ့ဖၭၥၭဖၭလီၫ.- ၦၡၩ အဒိၪကိၪ့ဆၧဘၪလထံၪဎးမွဲအ့ၬ. မွဲၦၥၭၡါၥံၪနၪၥ့ၪ ဆၧတီၩဆၧလီၩ့ဆ့အ့ၬ.",
			"10": "<sup>10</sup> ဆၧမၩအၥၭဘဲၫနီၪတၭ, ယစံၭး ခိၭနၪယၧၩဘီၪး",
			"11": "<sup>11</sup> ယမိလီၩဖျီၪထၪ့ယၥၭဒၪယဝ့ၫလီၫ.- ယိခွါ, ယအီၪ ခိၭဒၪဆၧလၧနၥံၪ အဆၧချဲၩ့လဖၪး လၧနၥံၪအၪ့ဎူၫ အၪ့ဎၬဆၧချဲၩ့လဖၪနီၪ, ယဒိၭယနါလၧနၥံၪအဆၧ",
			"12": "<sup>12</sup> ဒုၭၥ့ၪယၫအဂဲးအကၠီၪ့တၭး- မွဲကဒၪယူၭ, ယခိၭနၪ နၥံၪတၭ,ယိခွါ, ၦချဲၩ့ဆၧၫ့စယိဘၭအဆၧချဲၩ့လဖၪ,",
			"13": "<sup>13</sup> ဒဲအၪ့ၥီၪ့အဝ့ၫနီၪအီၪလၧနၥံၪအကျၩနးဂၩအ့ၬ.- အ့ၪ မွဲဘဲၫနီၪတၭ, နၥံၪမိစံၭဘၪခိၬ ပဒၪဘၪဆ့ဆၧကိၪ့ၥ့ၪ ကိၪ့ဘၪအဖၧၩ့ၥၭး ယွၩဆၪ့လၩ့အဝ့ၫဒၪၥ့ၪ, မွဲၦၡၩ",
			"14": "<sup>14</sup> မၩၥ့ၪအ့ၬ.- အဝ့ၫဒၪချဲၩ့ဆၧထၫ့ဒၩယၧၩမွဲအ့ၬး ဘဲၫ နၥံၪအဆၧချဲၩ့လဖၪနီၪ ယမိချဲၩ့ဆၧၫ့အဝ့ၫဒၪဆ့အ့ၬ.",
			"15": "<sup>15</sup> အဝ့ၫၥံၪထီၫမံၫထီၫမၪချဲၩ့ဆၧၫ့လၧၩ့ဆၧအ့ၬ. မွဲအအီၪ",
			"16": "<sup>16</sup> က့ၪခွံၬဆၧချဲၩ့လဖၪယဲၩ့လၧအအီၪနီၪလီၫ.- လၧအ ဝ့ၫၥံၪလချဲၩ့ဘၪနီၪ, ယအီၪခိၭတၭ, ယချဲၩ့ဆၧအ့ၬး မွဲလၧအဝ့ၫၥံၪအီၪလၩ့မါပံၭ လချဲၩ့ဆၧၫ့လၧၩ့ဘၪအ",
			"17": "<sup>17</sup> ကၠီၩ့နီၪလီၫ.- ယဝ့ၫဒၪယီၩ ယမိချဲၩ့ဆၧလၧယဂးဒၪ ယဝ့ၫဒဲယမိလီၩဖျီၪထၪ့ ယၥၭဒၪယဝ့ၫအဂဲးအကၠီၪ့ဆ့",
			"18": "<sup>18</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယလၧၫ့ဎွ့ၩလၧဆၧချဲၩ့လဖၪ",
			"19": "<sup>19</sup> တၭ,ယၥၭလၧယဖၧၩ့နီၪထိၪဂဲၩယၧၩဆ့လီၫ.- ယိခွါ, ယဂူၭဖိၫ့မၩအၥၭဘဲၫစဘံၭထံၫလၧအဆံၬထၪ့အလး လအီၪဘၪနီၪး လၩ့ဘူၭလၧယမိဖီးဖၭဘဲၫထိၪ့ဆၧဖံၭ",
			"20": "<sup>20</sup> အၥိၭနီၪလီၫ.- ယမိချဲၩ့ဆၧတၭ,ယမိအီၪမုၬထၪ့ထဲၩ့",
			"21": "<sup>21</sup> ဝ့ၫနီၪ,ယမိအၩ့ထၪ့ယနိၭ ဒဲချဲၩ့ဆၧၫ့ဆၧလီၫ.- မွဲယ ထီးယိမ့ၬၦၡၩနးဂၩလဂ့ၩး ယချဲၩ့မုၬနါၦၡၩနီၪ,မွဲဆ့",
			"22": "<sup>22</sup> အ့ၬ.- အဂဲးဘဲၫယီၩဆၧချဲၩ့မုၬနါနီၪ ယၥ့ၪယၫအ့ၬး လယံၬလမီဘၪ ၦလၧအမၩကဲၪထၪ့ယၧၩ လဂၩနီၪမိ ဆိၬခွံၬယၧၩဆ့လီၫ."
		},
		"33": {
			"1": "<sup>1</sup> အခိးမွဲ, စယိဘၭဧ့, ခိၭနၪယဆၧချဲၩ့လဖၪယီၩ, ဒဲဒိၭနနါလၧကယဲဆၧလၧယမိလီၩဘၪ ထီးအလူၬ",
			"2": "<sup>2</sup> ဆံၭ.- ယိခွါ, ဘိၩ့နဲၪ့ယီၩယအၩ့ထၪ့ယူၭယနိၭယူၭ",
			"3": "<sup>3</sup> တၭ, ယဖျ့ၩလၧယနိၭဖၧၩ့ချဲၩ့ထၪ့ယူၭ.- ယဆၧချဲၩ့ ၥံၪဘၪဆဲၫ့လၧယၥၭ အတီၩအလီၩ့, ဒဲယနိၭဖျံၩၥံၪ",
			"4": "<sup>4</sup> မိလီၩဘၪဆၧၥ့ၪယၫ လၩ့ထံးလၩ့ဆ့ၭဆ့လီၫ.- ယွၩ အၥၭမၩကဲၪထၪ့ယၧၩတၭ, ၦၥ့ၪဆၧလူၬအၥၪနီၪဖ့ၪ",
			"5": "<sup>5</sup> လၫ့ယၥၭမၧၫ့လီၫ.- နဝ့ၫဒၪနချဲၩ့ဆၧၫ့ယၧၩအ့ၪၥ့ၪတၭ,",
			"6": "<sup>6</sup> တဲၩ့ဝဲၩဆၧလၧယမ့ၬယၫ, ဒုၭဆၧၫ့ထုၪ့နၥၭဆံၭ.- ယိ ခွါ,ယဝ့ၫဒၪယဘၪဆဲၫ့ လၧယွၩဘဲၫနဝ့ၫဒၪအၥိၭတၭး",
			"7": "<sup>7</sup> ယဘၪဆၧမၩန့ယၧၩလၧကဖံၬနီၪဆ့လီၫ.- ယိခွါ,ယ မၩၥၭမဲၪဆၧနီၪ မိဒုၭၥၭမဲၪနၧၩဆ့အ့ၬ, ဒဲယဆၧယိၭ",
			"8": "<sup>8</sup> မိဎၧၫ့လၧနလီၩ့နီၪမွဲဆ့အ့ၬ.- အ့ၪမွဲနစံၭလၧယနါဖၧၩ့,",
			"9": "<sup>9</sup> ဒဲဆၧချဲၩ့လဖၪအၥီၫနီၪ ယနါဂၧၫ့တၭး- ယမွဲၦဆံၫ့, ယမၪဘၪဆၧအ့ၬး ယဆံၫ့နီၪဆၧအၧၩ့အီၪလၧယလီၩ့",
			"10": "<sup>10</sup> နးမံၩ့အ့ၬ.- ယိခွါ, ယွၩအၪ့ဎၬထၫ့ဒၩယၧၩအလး,",
			"11": "<sup>11</sup> အီၪက့ၪယၧၩဘဲၫအဒုၪအဒၩအၥိၭနီၪလီၫ.- မွဲအၥံၫ့ ထၬယခၪ့လၧၥံၫ့ဖၧၩ့တၭး ခိၭယိယဖၧၩ့ၥၭလဖၪထီး",
			"12": "<sup>12</sup> အလူၬလီၫ.- ယိခွါ, လၧဆၧလမံၩ့ယီၩအဖၧၩ့နတီၩ အ့ၬး ယမိချဲၩ့ဆၧၫ့နၧၩတၭး အဂဲးဘဲၫယီၩယွၩဒိၪနဲၪ့",
			"13": "<sup>13</sup> ၦၡၩနီၪလီၫ.- အခိးမွဲနဂဲးလိၬတ့ၭလိၬ လၧအဝ့ၫဒၪမွဲ အဂဲးဘဲၫၥ့ၪလဲၪ. အဂဲးဘဲၫယီၩအဆၧဖံၭဆၧမၩလ",
			"14": "<sup>14</sup> ဖၪအဂဲးအကၠီၪ့နီၪ, မိဖ့ၪလၫ့ဆၧရၫ့နးမံၩ့အ့ၬ.- အဂဲး ဘဲၫယီၩယွၩချဲၩ့ထၪ့ဆၧလဖၧၫ့တၭ, မွဲကဒၪယူၭ,နံၫ",
			"15": "<sup>15</sup> ဖၧၫ့လဖၧၫ့လါနၫ့နီၪ,ၦၡၩထီးန့ဝ့ၫအ့ၬး- လၧမံၫမးဆၧ အဖၧၩ့, လၧအဒၪဆၧလၧယၫမုနၩလခီၫနီၪ, ထီးဆၧ မံၫမၪယိၬ လၩ့ဘၪၦၡၩၥံၪ, လၧအမံၫနၩ့လၧလးမံၫ",
			"16": "<sup>16</sup> ဖၧၩ့အဘိၩ့ဘၭနီၪး- ထီးနီၪလဖၧၫ့အဆၧဒုၭဖိးၦၡၩ အနါတၭ, စဲၩနဲၪ့ထၬအဝ့ၫၥံၪ အဆၧၥီၪ့ဆၧၥၫ့နီၪး",
			"17": "<sup>17</sup> ဘဲၫၥိၭအမိအီၪက့ၪခွံၬ ၦၡၩအဆၧကိၪ့ထၪ့နီၪး ဒဲဘဲၫ",
			"18": "<sup>18</sup> ၥိၭအမိမၩလၩ့ဘံၭခွံၬ ၦၡၩအဆၧထၪ့ထီၫနီၪး- မိပ ဒၩ့ထၬအၥၭၡီၩ့ လၧဆၧဖၧၩ့, ဒဲအၥၭမၧၫ့ဘဲၫၥိၭအ ထီးဘၪဆၧဂၭဂီၩ့လၧနၭၥံၪဖၩ့ၥံၪလဂ့ၩလီၫ.",
			"19": "<sup>19</sup> လၧလးမံၫအဖၧၩ့နီၪ ဘၪဆၧအၪ့ၥီၪ့ဝ့ၫလၧဆၧဆၫ တၭ, ဒဲအဎွံၪအၪလဖၪနီၪ လၧဆၧဆၫနၭနၭလ့ၬ နီၪ",
			"20": "<sup>20</sup> လီၫ.- တၭအၥၭမၧၫ့နီၪၥၭလိၪကိၪ, ဒဲဆၧအအွံၪထုၬ",
			"21": "<sup>21</sup> နီၪဆ့လီၫ.- အဖံၭအယၪလူၬခွံၬ ထီးဆၧဒၪဘၪဝ့ၫၥ့ၪ အ့ၬး ဒဲအဎွံၪၥံၪလၧအလဖျီၪဘၪနီၪ အီၪဘိၪ့ဝ့ၫဒၪ",
			"22": "<sup>22</sup> လီၫ.- အၥၭၡီၩ့လၩ့ဘူၭလၧဆၧဖၧၩ့, ဒဲအၥၭမၧၫ့လၧ",
			"23": "<sup>23</sup> ၦမၩဂၭဂီၩ့ဆၧလီၫ.- အဝ့ၫဒၪအ့ၪအီၪလၧဆၧအၥီၫ့ နးဂၩ,ၦလီၩဖျီၪထၪ့ဆၧ, ၦလဂၩလၧၦလထီၫ့အကျၩ,",
			"24": "<sup>24</sup> လၧအမိဒုၭနဲၪၦၡၩအဖၧၩ့ၥၭတီၩတၭး- ထီးနီၪလ ဖၧၫ့ယွၩမိယၫ့ၥၭအဝ့ၫဒၪ, ဒဲစံၭ, ဘဲၫၥိၭအဝ့ၫနီၪထီး ထီၩ့လၩ့လၧဆၧဖၧၩ့နီၪလဂ့ၩ, မၩဖီၩ့မၩဖျ့ၭဝ့ၫဆံၭး အဂဲးဘဲၫယီၩဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫနီၪ ယဒၪဘၪယူၭယဝ့ၫ",
			"25": "<sup>25</sup> ယူၭ.- အဖံၭအယၪ မိကဲၪထၪ့ဆၧဘၪ့နဲၪ့ဖိၪၥၪနီၪ, ဒဲအမိထဲၩ့ထဲၩ့လၧအၥၭဘၪ့အမုနံၩ လဖၪနီၪလီၫ.",
			"26": "<sup>26</sup> အဝ့ၫဒၪမိအၪ့ကံၩ့အၪ့ယၫယွၩတၭ, ယွၩမိထိးဆၧၫ့ အဝ့ၫ,ဒဲဒုၭဒၪဘၪအမ့ၬလၧဆၧၥုၪ့ထိၬၥၭထိၬ, ဒဲအမိ",
			"27": "<sup>27</sup> ဖ့ၪလၫ့ထဲၩ့ၦၡၩလၧအဆၧတီၩဆၧလီၩ့နီၪလီၫ.- အဝ့ၫ ဒၪယိထံၫယိဆၭၦၡၩ, ၦအ့ၪစံၭ, ယဝ့ၫဒၪယမၪဘၪ ဆၧယူၭ, ဒဲဘိၭကဒၩထဲၩ့ဆၧတီၩအဖၧၩ့ၥၭတၭ, ယ",
			"28": "<sup>28</sup> န့ကၩဆၧနးမံၩ့အ့ၬ.- အဝ့ၫဒၪမၩဖီၩ့မၩဖျ့ၭယၥၭၡီၩ့ ဘဲၫၥိၭအထီးလ့ၩလၩ့လၧဆၧဖၧၩ့နီၪလဂ့ၩ, ဒဲယၥၭ မၧၫ့ဘဲၫၥိၭအမိဒၪဘၪဆၧဖၩ့နီၪလီၫ.",
			"29": "<sup>29</sup> ယိခွါ, ဆၧထီးအလူၬလဖၪယီၩယွၩမၩဝ့ၫ,လၧၦၡၩ",
			"30": "<sup>30</sup> နံၫဖၧၫ့,မွဲမၬ, ၥၧၫ့ဖၧၫ့ဆ့.- ဘဲၫၥိၭအမိဒုၭထဲၩ့ကဒၩ ထဲၩ့အၥၭၡီၩ့လၧဆၧဖၧၩ့နီၪ, ဘဲၫၥိၭအမိဖၩ့ထၪ့လၧ လၧၥၭမၧၫ့အဆၧဖၩ့နီၪလီၫ.",
			"31": "<sup>31</sup> စယိဘၭဧ့, ဒိၭနနါခိၭနၪယၧၩဘီၪၬ အီၪလၩ့မါပံၭ",
			"32": "<sup>32</sup> တၭယမိချဲၩ့ထၪ့ဆၧလီၫ.- နချဲၩ့ဆၧအ့ၪၥ့ၪတၭ, စံၭ ဆၧၫ့ယၧၩဘီၪး အဂဲးဘဲၫယီၩယမိဒုၭတီၩဒုၭလီၩ့နၧၩ",
			"33": "<sup>33</sup> လီၫ.- အ့ၪလၥ့ၪဘၪတၭ, ခိၭနၪယၧၩဆံၭ. အီၪလၩ့ မါပံၭတၭ, ယမိၥီၪ့လိၪနၧၩလၧ ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪအ ဂဲးအကၠီၪ့လီၫ."
		},
		"34": {
			"1": "<sup>1</sup> စအံၫလဲဟုၫ ချဲၩ့ဆၧၫ့ဒံၭဝ့ၫတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> ၦၡၩကိၪ့ဆၧၥ့ၪနၥံၪဝ့ၫဧ့, ခိၭနၪယဆၧချဲၩ့လဖၪ ဘီၪၬ ၦလၧအၥ့ၪယၫဆၧၥံၪဧ့, ဒိၭနၥံၪအနါလၧယၧၩ",
			"3": "<sup>3</sup> ဆံၭ.- အဂဲးဘဲၫယီၩ နါနီၪ မၩခွါဆၧချဲၩ့ၥံၪ, ဘဲၫနိၭ",
			"4": "<sup>4</sup> ထဲးယိဆၧအၪ့အၥိၭနီၪလီၫ.- ပရွံန့ဆၧတီၩလၧပနၫ့ ဆါဒၪပဝ့ၫအဂး ဆၧအဂ့ၩနီၪပကြၨၭၥ့ၪယၫလၧ ပ",
			"5": "<sup>5</sup> နၫ့ဆါဒၪပဝ့ၫအကျၩဘီၪ.- အဂဲးဘဲၫယီၩ စယိဘၭ စံၭယူၭ,ယမွဲၦအတီၩအလီၩ့တၭ, ယွၩမၩန့ခွံၬယ",
			"6": "<sup>6</sup> ဆၧတီၩနီၪလီၫ.- မွဲယကြၨၭချဲၩ့ဘျံၭချဲၩ့ဘျၪထၫ့ဒုၪ ဒၩယဆၧတီၩနီၪဆ့ဧၪ. ယလမၪဘၪဆၧလါနၫ့တၭ,",
			"7": "<sup>7</sup> ယဖျါအဖၧၩ့လးဘျၪထဲၩ့ၥ့ၪအ့ၬ.- ၦၡၩမၩအၥၭဘဲၫ စယိဘၭအၥိၭနီၪ, မွဲၦလဂၩလဲၪ. အဝ့ၫဒၪအီၩဆၧ",
			"8": "<sup>8</sup> ကြၩ့ထမးဘဲၫထံၫအၥိၭး- ဒဲအဖိၬၡီၩ့ဖၧၩ့ၥၭလၧၦ မၩဆၧအၧၩ့ဆၧၥၫ့နီၪ, ဒဲလ့ၩလၧၦလတီၩလလီၩ့ဘၪအ",
			"9": "<sup>9</sup> ၥိၭနီၪဆ့လီၫ.- အဂဲးဘဲၫယီၩမွဲအစံၭ, ၦလၧအထၧၫ့ ထံၩထၧၫ့ၥိၭလၧယွၩနီၪ, န့ကၩဆၧနးမံၩ့အ့ၬ.",
			"10": "<sup>10</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအၥုၪ့ဖၭၥၭဖၭၥံၪဧ့,ခိၭ နၪယၧၩဆံၭး ဆၧလတီၩလလီၩ့ဘၪနီၪ, မွဲအအီၪယဲၩ့ လါလၧယွၩဆံၭး ဒဲဆၧအၧၩ့ဆၧၥၫ့ လၧၦၥ့ၪဆၧလူၬ",
			"11": "<sup>11</sup> လဂၩနီၪဆ့ဆံၭၬ- အဂဲးဘဲၫယီၩအဝ့ၫဒၪမိဖ့ၪဆၧၫ့ၦ ၡၩအဆၧမၩနီၪ, ဒဲဒုၭဘၪကယဲၦလဂၩလါလါဘဲၫအ",
			"12": "<sup>12</sup> ဖၧၩ့ၥၭအီၪဝ့ၫအၥိၭဆုၬဆုၬလီၫ.- မွဲတၡါယူၭ, ယွၩ မၩဆၧအၧၩ့ဆၧၥၫ့အ့ၬး ဒဲၦၥ့ၪဆၧလူၬလဂၩနီၪဘိၭ",
			"13": "<sup>13</sup> ကဒၩခွံၬဆၧတီၩဆၧလီၩ့နီၪၥ့ၪဆ့အ့ၬ.- မွဲပလၫအီၪ က့ၪဂၪ့ခိၪလၧအဝ့ၫဒၪအစူၪဖၧၩ့လဂၩလဲၪး မွဲပလၫ",
			"14": "<sup>14</sup> ဒုၭအီၪထၪ့ဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫလဂၩလဲၪ.- တၭယွၩ အ့ၪအီၪက့ၪအၥၭလၧဆၧလမံၩ့ လၧၦၡၩအလီၩ့နီၪ, ကိၭကီၪ့ထဲၩ့အၥၭ ဒဲအၥၪလၧအနၫ့ဆါအအီၪတၭး",
			"15": "<sup>15</sup> ကယဲဆၧဖံၭဆၧယၪထီးအလူၬ မိၥံၫစီၪ့ဎး, ဒဲၦၡၩမိ",
			"16": "<sup>16</sup> ကဲၪထဲၩ့ဂၪ့ခိၪအမုၬလီၫ.- နၥုၪ့ဖၭၥၭဖၭအ့ၪအီၪတၭ, ခိၭနၪဆၧယီၩဘီၪး ဒိၭနနါလၧယဆၧချဲၩ့လဖၪအလူ",
			"17": "<sup>17</sup> နီၪဆံၭ.- ၦလၧအၥၭဂဲၫ့ဆၧတီၩလဂၩနီၪပၧၩ့ဆၧဘၪ မိၥ့ၪဧၪး ၦလၧအတီၩထုၬလီၩ့ထုၬလဂၩနီၪ, နမိအီၪ",
			"18": "<sup>18</sup> က့ၪဆၧမၪလၧအဝ့ၫဒၪအလီၩ့ဆ့ဧၪ.- ၦလဂၩအ့ၪ စံၭစဎွၩ, ၦအၧၩ့လဂၩဧ့ၬ ဒဲလၧၦဒိၪဖၭဒိၪၥံၪ, ၦလ",
			"19": "<sup>19</sup> တီၩလလီၩ့ဘၪၥံၪဧ့,နီၪၬ မွဲအကြၨၭဆ့ဧၪ.- ၦလၧအ လယိဘၪၦဒိၪဖၭဒိၪၥံၪအမ့ၬ, ဒဲၦၥထံၫလဖၪနီၪလ အီၪက့ၪဘၪထီၫနဲၪ့ၦၡၪ့ဖိၪယၬဖိၪၥံၪ, အၪနဲၪ့အနီၪ ဒံၭမွဲအ့ၬဧၪး အဂဲးဘဲၫယီၩ ၦထီးအလူၬနီၪမွဲအစူၪအ",
			"20": "<sup>20</sup> ဆၧမၩလီၫ.- လဆိဖိၪအထးဖၧၩ့ အဝ့ၫၥံၪၥံၫဝ့ၫဒၪ တၭးလၧဖိၭဖၫ့မုနီၪ, ၦခမျၧးဘၪဆၧကျီၪ့ဝ့ၫတၭ,ဖီၩ့ ခွံၬဝ့ၫးလၧစူၪလအီၪဘၪ, ၦဆီၪ့ၥံၪဘၪဆၧဆိၬခွံၬဝ့ၫ",
			"21": "<sup>21</sup> ဒၪလီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫဒၪအမ့ၬၥၪၥံၪအီၪလၧ ၦၡၩအဖၧၩ့ၥၭအဖၫ့ခိၪတၭ, ဒၪဘၪအဝ့ၫၥံၪခၫထၪ့",
			"22": "<sup>22</sup> ဆၧထီးအလူၬလဖၪလီၫ.- ဘဲၫၥိၭၦမၩအၧၩ့ဆၧလ ဖၪမိအီၪက့ၪၥူၪခွံၬအၥၭတၭ, ဆၧခံၭအလးမွဲဂ့ၩ, ဒဲ",
			"23": "<sup>23</sup> ဆၧၥံၫအလၩၡုၪနီၪမွဲဂ့ၩအီၪနးစီၪ့အ့ၬ.- အဂဲးဘဲၫ ယီၩမၩဝံၩ့ဝၩ့အၥၭယံၬယံၬ ဘဲၫၥိၭအမိဒုၭဂဲၫထီၩ့ဝ့ၫ လၧဆၧစ့ၩရၫ့အဖၧၩ့လၧယွၩအမ့ၬယၫနီၪအလးအီၪ",
			"24": "<sup>24</sup> အ့ၬ.- လၧအလအၪ့စိၭအၪ့စၪ့ဘၪတၭ, မၩလၩ့ဘျ့ၭ ခွံၬၦအဆီၪ့ၥံၪ, ဒဲအီၪက့ၪထၪ့ဂူၫဂၩလဖၪလၧအဝ့ၫၥံၪ",
			"25": "<sup>25</sup> အလးလီၫ.- အဂဲးဘဲၫယီၩၥ့ၪယၫအဝ့ၫၥံၪ အဆၧမၩ တၭး လၧမုနၩလခီၫချႃၬလၩ့ခွံၬအဝ့ၫၥံၪ ထီးအဘၪ",
			"26": "<sup>26</sup> ဆၧဂၭဂီၩ့လီၫ.- လၧၦၡၩၥံၪယိဖၧၩ့ဆၧအလးနီၪ, အဝ့ၫဒၪကျီၪ့အဝ့ၫၥံၪလၧ အဆၧမၩအၧၩ့အကၠီၩ့လီၫ.",
			"27": "<sup>27</sup> အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ ကၠၪဒိၭချိၫ့ခွံၬအၥၭတၭ, ယူၭ",
			"28": "<sup>28</sup> ယၪ့အဝ့ၫဒၪအဖၧၩ့ၥၭၥံၪနးဘီၩ့အ့ၬ.- ဒုၭထၪ့ၦၡၪ့ ဖိၪယၬဖိၪအဆၧကိၭၡၭ လၧအအီၪနီၪ, ဘဲၫၥိၭအမိ",
			"29": "<sup>29</sup> ခိၭနၪၦၡၪ့ဖိၪယၬဖိၪအဆၧကိၭၡၭနီၪလီၫ.- ထီးယွၩ အ့ၪဒုၭအီၪပွံၭၦၡၩတၭ, မွဲပလၫမိမၩခိမၩဝီၩလဂၩ လဲၪၬအဝ့ၫဒၪအ့ၪအီၪက့ၪၥူၪခွံၬအမ့ၬတၭ, မွဲပလၫမိ ဒၪဘၪလဂၩလဲၪၬ အ့ၪဘၪဆဲၫ့လၧလဆၨၩမွဲဂ့ၩ, ၦလ",
			"30": "<sup>30</sup> ဂၩမွဲဂ့ၩ, မီၪ့ဎီၩ့လီၫ.- ဘဲၫၥိၭၦအၪ့လီၫဆၧၥံၪထီး ပၧၩ့ဘၪလဂ့ၩး ဒဲၦခမျၧးထီးဘၪ ဖျံၩခွၩ့လဂ့ၩလီၫ.",
			"31": "<sup>31</sup> မွဲကဒၪယူၭကြၨၭစံၭယွၩ, ယထိးဆၧနၧၩ့တၭ,ယ",
			"32": "<sup>32</sup> မၪဘၪလၧၩ့ဆၧအ့ၬ.- ဆၧလၧယလဒၪဘၪနီၪၥီၪ့လိၪ ဒုၭနဲၪယၧၩဘီၪး ယအ့ၪမၩအၧၩ့ဆၧတၭ, လၧယၫလ",
			"33": "<sup>33</sup> ခီၫယမၩလၧၩ့အ့ၬ.- ဘဲၫနၥၭဒၪနဝ့ၫအၥိၭမွဲအ့ၬ, န လမၩဘၪမွဲဂ့ၩ, နရွံန့မွဲဂ့ၩ, ယွၩမိမၩဒၪဝ့ၫတၭ, နဘၪ ရွံန့ဒၪနဝ့ၫမွဲယၧၩအ့ၬး အခိးမွဲဆၧလၧနၥ့ၪယၫနဝ့ၫ",
			"34": "<sup>34</sup> နီၪးလီၩဖျီၪထၪ့ဘီၪ.- ၦၥုၪ့ဖၭၥၭဖၭမိစံၭယၧၩ, ဒဲၦ",
			"35": "<sup>35</sup> ကိၪ့ဆၧၥ့ၪလၧအနါဂၧၫ့ယၧၩ, မိစံၭ,- စယိဘၭနီၪလ ၥ့ၪယၫဘၪဆၧလါနၫ့ချဲၩ့ထၪ့ဝ့ၫတၭ, အဆၧချဲၩ့လဖၪ",
			"36": "<sup>36</sup> နီၪအီၪလၧဆၧကိၪ့ၥ့ၪကိၪ့ဘၪအ့ၬ.- ယဝ့ၫဒၪယၥၭ အီၪလၧစယိဘၭဘၪဆၧမၩခွါဝ့ၫထီးအထုၬ. လၧအ",
			"37": "<sup>37</sup> ချဲၩ့ဆၧၫ့ဆၧလၧၦၡၩအၧၩ့အဂးအကၠီၩ့နီၪလီၫ.- အ ဂဲးဘဲၫယီၩ လၧအဆၧဒဲၩဘၭအဖၫ့ခိၪနီၪ ပိၩ့ထၪ့ဆၧ တၭ,လၧပကျၩယီၩမၩကြၩ့ထမးဆၧ, ဒဲမၩအၪထၪ့ အဆၧချဲၩ့လဖၪ, လၧအထၫ့ဒုၪဒၩယွၩလီၫ."
		},
		"35": {
			"1": "<sup>1</sup> စအံၫလဲဟုၫချဲၩ့ဆၧၫ့ဒံၭဝ့ၫတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> လၧနစံၭ,ယဆၧတီၩဆၧလီၩ့အၪနဲၪ့ ယွၩအဆၧတီၩ",
			"3": "<sup>3</sup> ဆၧလီၩ့နီၪ,မွဲနဆီၫ့မီၪ့ဘၪဆ့ဧၪ.- အဂဲးဘဲၫယီၩနစံၭး နဘၪခိးဘၪတၩလၧဆၧနီၪလမံၩ့လဲၪး ယမိန့ကၩဆၧ",
			"4": "<sup>4</sup> အၪနဲၪ့လၧယမၪဘၪဆၧနီၪဘဲၫၥ့ၪလဲၪ.- ယမိချဲၩ့ ဆၧၫ့နၧၩ, ဒဲနထံၩနၥိၭလဖၪဆ့လီၫ.",
			"5": "<sup>5</sup> ယိထၪ့ဆၧလၧမူၭခိၪနီၪ, ဒဲဒၪဘၪဆၧဘီၪးယိခွါ,ဆၧ",
			"6": "<sup>6</sup> အုၪ့လဖၪလၧအအီၪထီၫနဲၪ့နၧၩတၭး- နအ့ၪမၪဘၪ ဆၧတၭ,နထၫ့ဒုၪဒၩအဝ့ၫနီၪ နမၩဆၧနီၪလမံၩ့လဲၪ. နဆၧၥူၭဆၧမၪၥံၪအ့ၪအၪထၪ့တၭ, နမၩအဝ့ၫဒၪလၧ",
			"7": "<sup>7</sup> ဆၧနီၪလမံၩ့လဲၪ.- နအ့ၪတီၩနီၪ, မွဲနဖ့ၪလၫ့အဝ့ၫဒၪ လၧဆၧနီၪလမံၩ့လဲၪး အဝ့ၫဒၪန့ဘၪဆၧနီၫလၫ လၧန",
			"8": "<sup>8</sup> စူၪဖၧၩ့လမံၩ့လဲၪ.- နဆၧအၧၩ့နီၪဘၪန့ၫနနၫ့ဆါဒၪ နဝ့ၫတၭ,နဆၧတီၩဆၧလီၩ့ မၩခိးမၩတၩၦၡၩအဖိၪ",
			"9": "<sup>9</sup> ခွၫလီၫ.- လၧဆၧမၩခိမၩဝီၩအၪအကၠီၪ့နီၪၦၡၩကိၭ ၡၭထၪ့ဆၧတၭး လၧၦအဆီၪ့အစူၪဒူၪအကၠီၩ့နီၪ, အဝ့ၫ ၥံၪကိၭၡၭထၪ့ လၧဆၧမၩဘိၭမၩဆၧၩ့ဝ့ၫအဂးလီၫ.",
			"10": "<sup>10</sup> ၦလၧအတဲၩ့လၩ့န့ယၧၩ, ယွၩနီၪလၧအဖ့ၪလၫ့ဆၧၥံၫ ကျံၩလၧမုနၩလခီၫတၭ,မွဲအအီၪခီၫခီၫလဲၪနီၪ, ၦစံၭ",
			"11": "<sup>11</sup> နးဂၩအ့ၬး- အဝ့ၫဒၪၥီၪ့လိၪပၧၩအၪနဲၪ့ဆၧဖိၪဆၧဎါ လၧဂၪ့ခိၪချိၫ့, ဒဲဒုၭကိၪ့ၥ့ၪကိၪ့ဘၪပၧၩအၪနဲၪ့ထိၪၥံၪ",
			"12": "<sup>12</sup> လံၪၥံၪလၧဆၧဖိၭဖၫ့နီၪလီၫ.- ၦၡၩကိၭၡၭထၪ့နီၪ, အဝ့ၫစံၭဆၧၫ့ဆၧနးမံၩ့အ့ၬး မွဲလၧၦၡၩအၧၩ့ အၥၭ",
			"13": "<sup>13</sup> ထၪ့ထီၫအကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩယွၩခိၭနၪဆၧအၪ့ ကံၩ့ပျီၩပျီၩအ့ၬး ၦၥ့ၪဆၧလူၬလဂၩနီၪ ထိးဆၧၫ့ဝ့ၫ",
			"14": "<sup>14</sup> အ့ၬ.- နစံၭလၧနဒၪဘၪအဝ့ၫဒၪလၥ့ၪဘၪလါနၫ့တၭ, ဆၧတီၩဆၧလီၩ့အီၪလၧအဖၧၩ့, အခိးမွဲအီၪခိၭအဝ့ၫ",
			"15": "<sup>15</sup> ဒၪလဂၩဘီၪ.- အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ အဝ့ၫဒၪအဆၧၥၭ ထၪ့အဆၧစ့ၩရၫ့ လထီၩ့ဘၪအကၠီၩ့ဒဲလယိနဲၪ့ဘၪ",
			"16": "<sup>16</sup> ဆၧမၪနီၪလၩ့ထံးလၩ့ဆ့ၭဘၪတၭး- အခိးမွဲစယိဘၭ နီၪမၩဎွ့ၩအနိၭလၧဆၧပျီၩပျီၩတၭ, မၩအၪထၪ့အဆၧ ချဲၩ့လဖၪလၧဆၧလၧအလၥ့ၪယၫဘၪဝ့ၫနီၪလီၫ."
		},
		"36": {
			"1": "<sup>1</sup> စအံၫလဲဟုၫ ချဲၩ့ဒံၭဆၧတၭ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> အွံၪၥၭဆၧၩ့ဒၪခလူၬယၧၩနးဆံၭတၭ, ယမိဒုၭနဲၪ နၧၩလၧဆၧချဲၩ့လဖၪ လၧယွၩအဂးနီၪအီၪဒံၭဆ့လီၫ.",
			"3": "<sup>3</sup> ယမိဂဲၫဆိၬ ယဆၧၥ့ၪယၫလၧအယဲၩ့တၭး ယမိဒုၭ တီၩဒုၭလီၩ့ ၦလၧအတဲၩ့လၩ့န့ယၧၩ လဂၩနီၪလီၫ.",
			"4": "<sup>4</sup> မွဲမၬ,ယဆၧချဲၩ့လဖၪ မွဲဆၧကဘျံၭကဘျၪအ့ၬး ၦ လၧအလၧၫ့အဎွ့ၩလၧဆၧၥ့ၪယၫလဂၩနီၪ အီၪလၧန မ့ၬယၫလီၫ.",
			"5": "<sup>5</sup> ယိခွါ,ယွၩမွဲအၦဒိၪအထီၫတၭ, မၩကြၩ့ထမးၦ နးဂၩအ့ၬး အဝ့ၫဒၪဒိၪဝ့ၫဆီၪ့ဝ့ၫ လၧဆၧနၪၥ့ၪအဂဲးအ",
			"6": "<sup>6</sup> ဘၭလီၫ.- အဝ့ၫဒၪဒုၭဘီၪထၪ့ယီၫထၪ့ၦအၧၩ့ဖိၪအ့ၬး ၦလၧအဘၪဆၧခိဆၧဝီၩလဖၪနီၪ မိဖ့ၪလၫ့ဝ့ၫလၧဆၧ",
			"7": "<sup>7</sup> အတီၩလီၫ.- ၥုၭခွံၬအမ့ၬၥၪၥံၪလၧၦအတီၩအလီၩ့ နီၪအ့ၬး အီၪဝ့ၫလၧစဎွၩၥံၪ လၧလးဆီၩ့ဆီအဖၫ့ခိၪ တၭ,အီၪက့ၪဂုးအဝ့ၫၥံၪအဆိၩအကၠၪ, ဒဲအဝ့ၫၥံၪဘၪ",
			"8": "<sup>8</sup> ဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫလီၫ.- ထီးအ့ၪဘၪ ဆၧဘဲၩ့ ထၬလၧၥွ့ၫထၭနီၪ, ဒဲဘၪဆၧဖီၪ့ထၬလၧဆၧၡၪ့ဆၧ",
			"9": "<sup>9</sup> နၭအဖျံၩလဖၪတၭး- ထီးနီၪလဖၧၫ့အဆၧဒုၭနဲၪအ ဝ့ၫၥံၪအဆၧဖံၭဆၧမၩဒၪဝ့ၫလဖၪနီၪ, ဒဲအမၩမၪဆၧ",
			"10": "<sup>10</sup> လမံၩ့မံၩ့ မွဲအဒိၪအယိၬလီၫ.- ဒုၭဖိးအဝ့ၫၥံၪ အနါ လဖၪဘဲၫၥိၭအမိဒိၭန့ဆၧၥီၪ့ဆၧၥၫ့, ဒဲမၪလူၬအဝ့ၫ ၥံၪလၧအဘၪကၠၪခွံၬအၥၭ လၧဆၧအၧၩ့အဖၧၩ့ၥၭ",
			"11": "<sup>11</sup> လီၫ.- အဝ့ၫၥံၪအ့ၪခိၭနၪဒဲမၩအဆၧတၭ, အမုနံၩလ ဖၪမိအီၪလၧဆၧဘီၪဆၧယီၫ, ဒဲအနံၪ့ၥံၪအီၪလၧဆၧ",
			"12": "<sup>12</sup> မုၬလၩလဖၪဆ့လီၫ.- အ့ၪမွဲအဝ့ၫၥံၪအ့ၪလခိၭနၪဘၪ တၭ,မိဘၪဆၧဂၭဂီၩ့လၧနၭၥံၪဖၩ့ၥံၪ, ဒဲမိၥံၫလၧဆၧ",
			"13": "<sup>13</sup> ၥ့ၪယၫလအီၪဘၪလီၫ.- ၦလၧအအၪ့လီၫဆၧလၧအ ၥၭခံဖၧၩ့နီၪအီၪက့ၪကီၪ့ဆၧၥၭထၪ့တၭ, ထီးယွၩအ့ၪ ဘဲၩ့ထၬဝ့ၫနီၪ, အဝ့ၫၥံၪအၪ့ကံၩ့ အဆၧမၩဘိၭမၩ",
			"14": "<sup>14</sup> ဆၧၩ့ဆ့အ့ၬ.- အဝ့ၫၥံၪမိၥံၫလၧအၥၭဘၪ့တၭ, အၥၭ",
			"15": "<sup>15</sup> မၧၫ့နီၪလူၬလၧၦၥၭလိၪအကျၩနီၪလီၫ.- ၦလၧအဘၪ ခိဘၪဝီၩနီၪအဝ့ၫဒၪဒုၭဖီၩ့ဒုၭဖျ့ၭဝ့ၫ, ဒဲလၧအဆၧၡၪ့",
			"16": "<sup>16</sup> ဆၧနၭအဖၧၩ့နီၪ, ဒုၭဖိးအနါဆ့လီၫ.- မွဲမၬအမိဒုၭ စဲၪ့ထၪ့ခွံၬနၧၩဆ့လၧဆၧမၩထံၬထၬအလးနီၪ,ဖိးလၧ အလးလဲလဲလ့ၬ လၧအလလၩ့အံၪ့ဘၪတၭ, နစပွဲခိၪ",
			"17": "<sup>17</sup> လၧၫ့ဎွ့ၩလၧဆၧဘီၪ့ၥိၪဝ့ၫလဖၪနီၪလီၫ.- အ့ၪမွဲနအ့ၪ လၧၫ့ဎွ့ၩလၧၦအၧၩ့လဖၪအဆၧစ့ၩရၫ့နီၪ, ဆၧစ့ၩရၫ့",
			"18": "<sup>18</sup> ဒဲဆၧတီၩမိဖီၪ့ထၬနၧၩလီၫ.- လၧဆၧၥၭထၪ့အီၪဝ့ၫ အကၠီၩ့နီၪ, ထီးလၩ့နၥၭဘီၪး ဘၪလဘၪမိဆိၬန့ခွံၬ နၧၩလၧအထးဆၧနီၪတၭ, ဆၧဎွ့ၩန့ထဲၩ့ဖၭဒိၪနီၪ",
			"19": "<sup>19</sup> ဒုၭဖျ့ၭနၧၩၥ့ၪအ့ၬ.- မွဲအမိယူၭယၪ့နဆၧလူဒိၪဎွ့ၩဒိၪ ဆ့ဧၪးကျိၪၥံၪစ့ၩၥံၪမွဲဂ့ၩ, ထီၫ့ၥံၪလွ့ၫၥံၪမွဲဂ့ၩ, ဆၧဂဲး ဆၧဘၭအစီၩ့အမၩ့ထီးအလူၬမွဲဂ့ၩ, ယူၭယၪ့ဝ့ၫအ့ၬ.",
			"20": "<sup>20</sup> မုနၩလၧၦဆၨၩလဖၪအီၪကီၪ့လၧဖျႃဖၧၩ့နီၪ, ထီးယိ",
			"21": "<sup>21</sup> လါလဂ့ၩ.- ထီးလၩ့နၥၭဘီၪ! ထီးကၠၪနၥၭလၧဆၧ အၧၩ့အအီၪနီၪလဂ့ၩး အဂဲးဘဲၫယီၩ အယီၩလမံၩ့နရွံ န့အၪနဲၪ့ဆၧၡၪ့ဆၧနၭနီၪလီၫ.",
			"22": "<sup>22</sup> ယိခွါ, ယွၩဒုၭနဲၪအနၫ့ဆါဖၭဒိၪလၧအစီၩ့အမၩ့ အဖၧၩ့နီၪး ၦလၧအၥီၪ့လိၪဆၧဘဲၫအဝ့ၫဒၪအၥိၭ, မွဲ",
			"23": "<sup>23</sup> ၦလဂၩလဲၪ.- ၦလၧအဖၭဝဲၩအဝ့ၫဒၪ အဖၧၩ့ၥၭနီၪ, မွဲၦလဂၩလဲၪး နဝ့ၫဒၪနမၩဆၧအၧၩ့နီၪ, မွဲပလၫစံၭ",
			"24": "<sup>24</sup> ဘဲၫနီၪမိၥ့ၪလဂၩလဲၪ.- အဝ့ၫဒၪအဆၧမၩလၧၦၡၩ ယိဝ့ၫနီၪ, ဘဲၫၥိၭအမိဒုၭလၩဖၩ့ဝ့ၫတၭ, ထီးၥၭနၪ့လ",
			"25": "<sup>25</sup> ဂ့ၩ,ဧီၪ,- ၦၡၩကိၭဂၩဒ့ၭယိဝ့ၫနီၪ, ၦဒၪဘၪဝ့ၫလၧအ",
			"26": "<sup>26</sup> ယဲၩ့ဆ့လီၫ.- ယိခွါ,ယွၩမွဲဖၭဒိၪတၭ,ပၥ့ၪယၫအဝ့ၫ အ့ၬး အနံၪ့အလၩအဆၧဝံထၪ့နၬထၪ့နီၪ, ၦအၪ့ဎူၫအၪ့ ဎၬဒၪဘၪဝ့ၫၥ့ၪအ့ၬ.",
			"27": "<sup>27</sup> အဂဲးဘဲၫယီၩ အဝ့ၫဒၪထုၭထၪ့ထံၫလၩ့ဆၩ့လဖၪ အဝ့ၫၥံၪဒုၭဆၧၩ့လၩ့ဘဲၫဆၧအအွံၩအီၪဝ့ၫအၥိၭနီၪ,",
			"28": "<sup>28</sup> လၧဆၧအုၪ့ၥံၪဒုၭလၩ့ဆၩ့နီၪ, လၩ့ဆၩ့ဝ့ၫလၧၦၡၩ",
			"29": "<sup>29</sup> အလီၩ့အၪအၪလ့ၬဆ့လီၫ.- ဆၧအုၪ့ၥံၪပၠၪလၩ့အၥၭ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ဒဲအတဲၩၥီၫဘဲၫၥ့ၪလဲၪဘဲၫ",
			"30": "<sup>30</sup> ၥ့ၪလဲၪနီၪ,ၦၡၩနၪမိၥ့ၪလဂၩဂၩဆ့ဧၪ.- ယိခွါ,အဝ့ၫ ဒၪပၠၪလၩ့အဆၧဖၩ့ဝၬဖီၩ့အနၫ့ဆါနီၪ, ဒဲလုၬဘံၭမၫ",
			"31": "<sup>31</sup> ဆမံၭအဆၧယိၬလဖၪဆ့လီၫ.- အဂဲးဘဲၩယီၩလၧဆၧ ယီၩလဖၪအကၠီၩ့နီၪ, အဝ့ၫဒၪစ့ၩရၫ့ၦခမျၧးၥံၪ, ဒဲဖ့ၪ",
			"32": "<sup>32</sup> လၫ့ဆၧအၪ့ဆၧအီၩအၪအၪလ့ၬဆ့လီၫ.- အစူၪယၫ ၥၭနီၪချႃၬဘံၭဝ့ၫလၧဆၧဖၩ့တၭ, မၪလူၬဝ့ၫထီးဒၪ",
			"33": "<sup>33</sup> အလးလၧအမိဘၪဝ့ၫနီၪလီၫ.- အလၫ့ဎွံၩ့ဒုၭနဲၪအဝ့ၫ ဒၪအဂဲးလၧဆၧဖိၪဆၧဎါၥံၪ, လၧၦလဂၩအီၪလၧထၭ နီၪအဂဲးအကၠီၪ့ဒၪလ့ၬလီၫ."
		},
		"37": {
			"1": "<sup>1</sup> လၧဆၧနီၪလမံၩ့အကၠီၩ့ယၥၭဝၭထိၬ, ဒဲၥုၭခွံၬအၥၭ",
			"2": "<sup>2</sup> လၧအလးနီၪလီၫ.- အလူၥီၫဒဲဆၧၥီၫဖၭဒိၪလၧအစဲၪ့ ထၪ့ခွံၬလၧအနိၭဖၧၩ့နီၪ, ခိၭနၪထံၫထံၫဆၭဆၭဘီၪ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪဒုၭလ့ၩဝ့ၫ လၧမူၭခိၪထၧၫ့ဘံၪ့ယၫအဖၫ့လၬ",
			"4": "<sup>4</sup> နီၪ,ဒဲအလၫ့ဝဲအဒံၭဖိးလၧဂၪ့ခိၪအထုၬလီၫ.- လၧခဲၫ့ နီၪဆၧအလူၥီၫထၪ့, ဒဲလၧဆၧၥူၭဆၧၥဲၪ့အလူလၫ့ဎွံၩ့ တၭးထီးဆၧအ့ၪနါဂၧၫ့ အလူနီၪတၭ, ဆၧပဒၩ့ဝ့ၫ",
			"5": "<sup>5</sup> အ့ၬ.- ယွၩဒုၭဎွံၩ့လၫ့လၩ့လၭလၧအလူး အဝ့ၫဒၪမၩ",
			"6": "<sup>6</sup> ဆၧဖၭဒိၪလဖၪတၭ, အဂဲးအကၠီၪ့ပနၪၥ့ၪအ့ၬ.- အဂဲး ဘဲၫယီၩစံၭမူၭခိၪဖီၫနီၪး အီၪနဝ့ၫလၧဂၪ့ခိၪအလီၩ့နီၪ ဘီၪးဒဲလၧဆၧဆၧၩ့ပြံၩကဒံၩဆ့း ဒဲဆၧဆၧၩ့လၩ့ဆီၪ့",
			"7": "<sup>7</sup> ဆီၪ့ဘဲၫနီၪၥိၭလီၫ.- အဝ့ၫဒၪစဲၩ့နဲၪ့ထၬၦကိၭဂၩဒ့ၭ အစူၪ,ဘဲၫၥိၭကယဲၦလၧ အမၩကဲၪထၪ့ဝ့ၫလဂၩလါ",
			"8": "<sup>8</sup> လါမိၥ့ၪယၫတၭး- ဆၧဖိၪဆၧဎါၥံၪလ့ၩနုၬလၧအအိၩ",
			"9": "<sup>9</sup> ဖၧၩ့,ဒဲအီၪဂုးခၧၫ့ဝ့ၫလၧအဆၧဖၧၩ့ဖၧၩ့လီၫ.- လံၩ ၥဝံၭဂဲၫထၪ့လၧအဒူၭမုခံၫ့ဒဲဆၧဂီးနီၪ လၧမုဖၩလခီၫ",
			"10": "<sup>10</sup> ဆ့လီၫ.- လၧယွၩၥၪဝ့ၫအကၠီၩ့ထံၫလိးကဲၪထၪ့ဝ့ၫတၭ,",
			"11": "<sup>11</sup> ထံၫလဲနီၪလၩ့အံၪ့ထဲၩ့ဝ့ၫဒၪဆ့လီၫ.- ဆၧအုၪ့တၪ့နီၪ မွဲအမၩဎၧၫ့ထၪ့ လၧဆၧစီၪတၭ, မၩလၩ့ပြံၩလၩ့ပၩ",
			"12": "<sup>12</sup> ဆၧအုၪ့လၫ့ဝဲအဒံၭနီၪလီၫ.- တၭဆၧကၠၪအၥၭဝံၩ့ဝၩ့ ဘဲၫအဝ့ၫဒၪဒုၭလ့ၩဝ့ၫအၥိၭ, ဘဲၫၥိၭအမိမၩကယဲအ မၪလူၬဆၧလမံၩ့လါလါ လၧဂၪ့ခိၪချိၫ့ယီၩ ကိၭအလး",
			"13": "<sup>13</sup> အစီၪ့ဒ့ၭလီၫ.- လၧအအၪ့ၥီၪ့ဆၧအလးမွဲဂ့ၩ, လၧဂၪ့ ခိၪအဂးမွဲဂ့ၩ. လၧဆၧယၫ့ၥၭအဂးမွဲဂ့ၩ, ဒုၭဂဲၫဝ့ၫဒၪ လီၫ.",
			"14": "<sup>14</sup> စယိဘၭဧ့, ခိၭနၪဆၧယီၩဘီၪး ဆၧၫ့ထုၪ့တၭ,ယိ",
			"15": "<sup>15</sup> ဆီၫ့မီၪ့ယွၩအဆၧလၩ့လၭလဖၪဆံၭ.- ယွၩတဲၩ့ဝဲၩ ဆၧလဖၪနီၪ, ဒဲဒုၭဖၩ့ထၪ့ဆၧအုၪ့ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪ",
			"16": "<sup>16</sup> လဲၪနီၪ,မွဲနၥ့ၪယၫဆ့ဧၪး- ခံၫ့ဆၧအုၪ့လဖၪနီၪဒဲယွၩ လၧၫ့ဎွ့ၩလၧဆၧကိၪ့ၥ့ၪ အဆၧမၩလၩ့လၭလဖၪတၭ,",
			"17": "<sup>17</sup> မွဲနနၪၥ့ၪအဂဲးအကၠီၩ့ဆ့ဧၪ.- ထီးအဒုၭအီၪပွံၭဂၪ့ခိၪ လၧအလံၩမုခံၫ့နီၪ, နကီၩ့နၥိၭလၧၩ့ထၪ့ဝ့ၫ ဘဲၫၥ့ၪ",
			"18": "<sup>18</sup> လဲၪ.- ဆၧဖိၭဖၫ့အီၪဂုးခၧၫ့ဝ့ၫ, ဘဲၫမ့ၬထံၫလၩၥိၫ့အ",
			"19": "<sup>19</sup> ၥၭအၥိၭနီၪ, မွဲနမၩဘိၭမၩဆၧၩ့ပၠၪလၩ့ဧၪ.- ပဘၪ စံၭအဝ့ၫဒၪနီၫလဲၪနီၫလဲၪနီၪ, ၥီၪ့လိၪပၧၩဘီၪး လၧ",
			"20": "<sup>20</sup> ဆၧခံၭအကၠီၩ့တၭ, ပချဲၩ့ၥ့ၪအ့ၬ.- လၧယချဲၩ့ထၪ့ယီၩ ဆၧမိလီၩဘၪအဝ့ၫဒၪဆ့ဧၪး ၦလဂၩဂၩ အ့ၪချဲၩ့ဒုၪ့",
			"21": "<sup>21</sup> အဝ့ၫနီၪ,မိဘၪဆၧဂၭဂီၩ့ဝ့ၫလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ ၦၡၩယိထၪ့ဆၧဖၩ့ယုၩ့ယဲ လၧဆၧဖိၭဖၫ့နီၪၥ့ၪအ့ၬး အဂဲးဘဲၫယီၩ လံၩနီၪလ့ၩဖီၩ့ခွံၬတၭ,ဒုၭဖၩ့ထၪ့အဝ့ၫ",
			"22": "<sup>22</sup> ၥံၪလီၫ.- ဆၧလၩ့ဂၬထီၫ့ဂဲၫထၪ့ လၧမုဖၩလခီၫနီၪ",
			"23": "<sup>23</sup> ယွၩအၥူၭအၥဲၪ့နီၪမွဲဆၧၥၭမဲၪဆံၭဒိၪလဲၪ!- ၦၥ့ၪဆၧ လူၬလဂၩနီၪ, ပယိအၪ့ဎၬအဂဲးအကၠီၪ့တၭ, ဒၪဘၪ ၥ့ၪနးစီၪ့အ့ၬး အစီၩ့ဒိၪအမၩ့ဒိၪ, ဒဲဆၧစ့ၩရၫ့တီၩ,ဒဲ အတီၩထုၬလီၩ့ထုၬတၭ, အဝ့ၫဒၪမၩအၧၩ့မၩၥၫ့ဆၧ",
			"24": "<sup>24</sup> ၥ့ၪအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ၦၡၩကြၨၭၥၭမဲၪအဝ့ၫ ဒၪး ယွၩယိမ့ၬ ၦၡၩကိၪ့ၥ့ၪကိၪ့ဘၪ လၧအၥၭဖၧၩ့နီၪနး ဂၩအ့ၬ."
		},
		"38": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩချဲၩ့ဆၧၫ့စယိဘၭလၧလဖုၬ",
			"2": "<sup>2</sup> အဖၧၩ့နီၪ,စံၭဝ့ၫဒၪ,- လၧဆၧချဲၩ့လအီၪဘၪလၧဆၧ ၥ့ၪယၫနီၪ, ၦလၧအမၩခံၭလၩ့ဆၧဒုၭကိၪ့ မွဲပလၫလ",
			"3": "<sup>3</sup> ဂၩလဲၪ.- ခဲးထူၬနယးဒံၩ့ဘဲၫၦခွၫအၥိၭနီၪဆံၭး ယ မိအၪ့စိၭအၪ့စၪ့နၧၩတၭ, ဒုၭၥ့ၪယၫယၧၩဆံၭ.",
			"4": "<sup>4</sup> လၧယအီၪက့ၪလၩ့ဂၪ့ခိၪအခၪ့ထံၭအဘိၩ့ဘၭနီၪ, နဝ့ၫဒၪယီၩမွဲနအီၪခီၫခီၫလဲၪ. နအ့ၪၥ့ၪယၫဆၧနီၪလီၩ",
			"5": "<sup>5</sup> ဘၪယၧၩဆံၭ.- ဘဲၫနမိၥ့ၪယၫအၥိၭတၭ, မွဲပလၫအီၪ က့ၪလၩ့အနိၪထိၪၥံၪလဂၩလဲၪး မွဲပလၫစၧၩ့ဖျံၩလၧ",
			"6": "<sup>6</sup> အဖၫ့ခိၪလဂၩလဲၪ.- အခၪ့ထံၭအီၪဝဲၩဝ့ၫလၧဆၧနီၪ",
			"7": "<sup>7</sup> လၫအလီၩ့လမံၩ့လဲၪး- ထီးၡၪထူဂီၩၥံၪၥံၫကျံၩဆၧ စီၪ့ဎးနီၪ, ဒဲယွၩအဖိၪခွၫထီးအလူၬၥံၪ ကိၭၡၭထၪ့လၧ ဆၧၥၭထိၬတၭး မွဲပလၫအီၪက့ၪလၩ့လိးလၧနိၪ့အခၪ့",
			"8": "<sup>8</sup> ထံၭနီၪလဂၩလဲၪ.- ထီးမၫဆမံၭနီၪဖိးထၪ့ဘဲၫအဂဲၫ ထၪ့လၧဆၧဒၧၩ့လးဖၧၩ့အၥိၭတၭ, မွဲပလၫကၭဘံၭ",
			"9": "<sup>9</sup> ထၬဝ့ၫလၧတရၫ့လဂၩလဲၪ.- လၧယမၩအကီၩ့အၥိၭ လၧဆၧအုၪ့နီၪ, ဒဲဆၧခံၭၥၧၫ့လၧအဆၧယၬဘီၪ့ထၬ",
			"10": "<sup>10</sup> ဆၧတၭး- ယထိၪန့အလးဒဲအီၪက့ၪလၩ့ဝ့ၫတၭ,ယ",
			"11": "<sup>11</sup> အီၪက့ၪနိၪဘီၩ့ၥံၪဒဲတရၫ့လဖၪး- ဒဲစံၭ, ထီးအလး ယီၩနမိဘၪထီၩ့တၭ, လၧယၫလခီၫနီၪနလ့ၩထီၩ့ဘၪ နးစီၪ့အ့ၬး ထီးယီၩ, နလပီၩထၪ့ထီၫဝ့ၫလဖၪမိဘၪအီၪ",
			"12": "<sup>12</sup> ပထုၬဝ့ၫဒၪလီၫ.- လၧနမုနံၩမုနၩအထးဖၧၩ့နီၪ နမၪ လူၬမုဂီၩတၭ,နဒုၭၥ့ၪယၫမုဆဲၪ့ထၪ့အလးနီၪဆ့ဧၪး",
			"13": "<sup>13</sup> ဘဲၫၥိၭအမိဖီၪ့ထၬ ဂၪ့ခိၪအနိၪ့လဖၪ, ဒဲမၩပြံၩပၩၦ",
			"14": "<sup>14</sup> လတီၩလလီၩ့ဘၪလဖၪနီၪဆ့ဧၪ.- အၪ့လဲၩအၥၭဘဲၫ ကဖံၬလၧဆၧစဲၩနဲၪ့ထၬ အဖၫ့လၬအၥိၭနီၪး ဒဲဆၧ ထီးအလူၬဆၧၫ့ထုၪ့ဝ့ၫဘဲၫ ဆၧကီၩ့ဆၧၥိၭဎံၫလၩဝ့ၫ",
			"15": "<sup>15</sup> အၥိၭလီၫ.- တၭဆၧပဒၩ့အဆၧဖၩ့ လၧၦအၧၩ့ဖိၪၥံၪ အမ့ၬယၫနီၪ, ဒဲစူၪယူၬထၪ့အၥၭနီၪဘၪဆၧခါခွံၬဝ့ၫ ဒၪလီၫ.",
			"16": "<sup>16</sup> မွဲနလ့ၩနုၬလၧမၫဆမံၭဖိးထၪ့အလးနီၪဆ့ဧၪး မွဲန",
			"17": "<sup>17</sup> လ့ၩဝံၩ့ဝၩ့လၧမၫဆမံၭအယိၬဖၧၩ့နီၪဆ့ဧၪ.- ဆၧၥံၫ အတရၫ့လဖၪအီၪဝဲထၪ့အၥၭ လၧနဂးဆ့ဧၪး ဒဲဆၧ",
			"18": "<sup>18</sup> ၥံၫလၩၡုၪအတရၫ့လဖၪနီၪ, မွဲနဒၪဘၪယူၭဧၪ.- ဂၪ့ ခိၪဆံၭလဲလဲၪနီၪ, မွဲနၥ့ၪယၫဆ့ဧၪး နအ့ၪၥ့ၪယၫလူၬ တၭ,လီၩဘၪယၧၩဆံၭ.",
			"19": "<sup>19</sup> ဖၧၩ့ၥၭမိဖိးလၧဆၧဖၩ့အီၪဝ့ၫအလးနီၪ, မွဲအအီၪ",
			"20": "<sup>20</sup> ခီၫခီၫလဲၪး ဒဲဆၧခံၭနီၪမွဲအလးအီၪခီၫခီၫလဲၪ.- ဘဲၫ ၥိၭနမိၥိၫ့ဝ့ၫထီၩ့လၧအဂံၪ့နီၪ ဖိးလၧအလးလၩ့ထံး",
			"21": "<sup>21</sup> လၩ့ဆ့ၭတၭ,မွဲနၥ့ၪယၫဖၧၩ့ၥၭၥံၪဆ့ဧၪ.- အထီနီၪမွဲ နအီၪဖျဲၪယူၭအကၠီၩ့တၭ, နမုနံၩမုနၩၥံၪအီၪအၪအ ကၠီၩ့နီၪ,နၥ့ၪယၫဆၧဘဲၫနီၪၥိၭဆ့ဧၪ.",
			"22": "<sup>22</sup> မူၭခိၪဖီၫအီၪကီၪ့အလးနီၪမွဲနနုၬဘၪယူၭဧၪး မွဲနဒၪ",
			"23": "<sup>23</sup> ဘၪမုၥၪအီၪကီၪ့အလးနီၪဆ့ဧၪ.- မွဲဆၧလၧယအီၪ က့ၪဝဲၩဝ့ၫလၧဆၧခိဆၧဝီၩအထီအဂး လၧဆၧဒုၭၥုၭ မုနံၩအဂးနီၪလီၫ.",
			"24": "<sup>24</sup> ဆၧမၩလၩ့ပြံၩပၩဆၧဖၩ့ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪး ဒဲလံၩမုထၪ့နီၪ မၩလၩ့ပၠၪအၥၭ လၧဂၪ့ခိၪချိၫ့ဘဲၫၥ့ၪ",
			"25": "<sup>25</sup> လဲၪး- မွဲပလၫတဲၩ့ဝဲၩထံၫကၠီၪ့ၥံၪ လၧဆၧမိဆၧၩ့လၩ့",
			"26": "<sup>26</sup> အဂးလဂၩလဲၪ, ဒဲလၫ့ဎွံၩ့မ့ၪလၪအဖၧၩ့ၥၭနီၪး- ဘဲၫ ၥိၭဆၧမိဆၧၩ့လၩ့ လၧခးၦၡၩလအီၪဘၪ အဖၧၩ့နီၪ, ဒဲလၧၡါမုနၧၫ့ဖၫနီၪ အလးလၧၦၡၩအီၪဂုးခၧၫ့နးဂၩ",
			"27": "<sup>27</sup> အ့ၬး- ဘဲၫၥိၭအမိမၩဘၪစီၪမံၩ့လၬကျၩခးအီၪယူဝ့ၫ အလးနီၪး ဒဲဒုၭမဲၪထၪ့နၪ့ၥံၪမံၩ့ၥံၪနီၪ, မွဲပလၫမၩလ",
			"28": "<sup>28</sup> ဂၩလဲၪ.- ဆၧဆၧၩ့နီၪအီၪလၧအဖါဆ့ဧၪး မွဲပလၫဒုၭ အီၪထၪ့ဆၩ့ထံၫလၩ့ဆၩ့ အဖျိၪ့လဖၪနီၪလဂၩလဲၪ.",
			"29": "<sup>29</sup> ထံၫလိးနီၪဂဲၫထၪ့လၧ ပလၫအဒၧၩ့လးဖၧၩ့လဂၩလဲၪ ဒဲမူၭခိၪအဆၩ့လၩ့ဒၭနီၪ, မွဲပလၫဒုၭဒၧၩ့ဝ့ၫလဂၩ",
			"30": "<sup>30</sup> လဲၪ.- ထံၫၥံၪအီၪၥူၪဝ့ၫ ဘဲၫလၧလိးဖၧၩ့အၥိၭနီၪ, ဒဲ ဆၧယိၬအထံၫဖံၭခိၪကဲၪထၪ့ ဘဲၫလိးဖၧၩ့အၥိၭနီၪ လီၫ.",
			"31": "<sup>31</sup> နဝ့ၫဒၪမွဲနဘီၪ့ထၪ့ၡၪဒိၩ့မုအဆၧၡုၪဆၧမုၬ, ဒဲနဖျါ",
			"32": "<sup>32</sup> ခွံၬၡၪအိၫရဲအၧၫ့အဆၧစၧၩ့ထၬနီၪဘၪမိၥ့ၪဧၪ.- ထီး အဆၧၫ့အထီအ့ၪဘၪနီၪ, မွဲနဒုၭဂဲၫထၪ့ ဆၧမၭဇရီၭ ဘၪမိၥ့ၪဆ့ဧၪး နၥိၫ့ၡၪကဆၫ့ဒဲအဖိၪၥၪၥံၪဆ့ဧၪ.",
			"33": "<sup>33</sup> မူၭခိၪအထူၫအရူၫနီၪ မွဲနၥ့ၪယၫဧၪး နဒုၭအီၪဂုးခၧၫ့",
			"34": "<sup>34</sup> အစီၩ့အမၩ့လၧဂၪ့ခိၪချိၫ့ဆ့ဧၪ.- နထုၭထၪ့နလူထၪ့ ဘၭလၧဆၧအုၪ့ၥံၪဘဲၫၥိၭ ထံၫအၪအၪလ့ၬမိလုၬဘံၭ",
			"35": "<sup>35</sup> နၧၩ,ဘၪမိၥ့ၪဧၪ.- လၫ့ဝဲအဒံၭလဖၪ နဖျါလၩ့ခွံၬ, ဘဲၫၥိၭအမိလ့ၩဆၧ,ဒဲစံၭနၧၩ, ယိခွါ,ပအီၪပဝ့ၫယီၩ,",
			"36": "<sup>36</sup> ဘၪမိၥ့ၪဧၪ.- မွဲပလၫဒုၭနုၬဆၧကိၪ့ၥ့ကိၪ့ဘၪလၧ နဖၧၩ့လဂၩလဲၪး မွဲပလၫဖ့ၪလၫ့ ၥုၪ့ဖၭၥၭဖၭလဂၩ",
			"37": "<sup>37</sup> လဲၪ.- ဆၧအုၪ့လဖၪနီၪမွဲပလၫဝံထၪ့လၧ အဆၧကိၪ့ၥ့ၪ",
			"38": "<sup>38</sup> လဂၩလဲၪး- ထီးဂၪ့ခိၪအမုၬကဲၪထၪ့ကဖံၬ, ဒဲဂၪ့ခိၪ အလီၪ့ၥံၪဘုၭထၬလိၬအၥၭနီၪ, မွဲပလၫလူၫလၩ့ခွံၬ",
			"39": "<sup>39</sup> ထံၫလၧမူၭခိၪအထိၪ့ဖၧၩ့မိၥ့ၪလဂၩလဲၪ.-ထီးဆၬ လၥၧၫ့မိအ့ၪကူၭလၩ့လၧအအိၩဖၧၩ့, ဒဲခိၭၥူၪဝ့ၫလၧ ဆၧၡိၬကျၩနီၪ, နအၪ့ဎၬန့ဆၧအၪ့ဂူၬဆီၪ့လၧအဂး,",
			"40": "<sup>40</sup> ဒဲဒုၭဘျဲၩအၪ့ အဖိၪလဖၪနီၪ, ဘၪမိၥ့ၪဆ့ဧၪ.-",
			"41": "<sup>41</sup> ထီး ကျၭအဖိၪအ့ၪကိၭထၪ့ယွၩဒဲ လ့ၩဝံၩ့ဝၩ့လၧဆၧအၪ့လ အီၪဘၪအကၠီၩ့တၭ, မွဲပလၫတဲၩ့ဝဲၩဆၧအၪ့လၧအဂး လဂၩလဲၪ."
		},
		"39": {
			"1": "<sup>1</sup> အဆၧၫ့အထီလၧလဲၫ့အဘ့ၪမံၩ့ၥံၪဖိၪဆါနီၪ, မွဲန ၥ့ၪယၫဧၪး ဒဲခံၫဘၩ့မိဖိၪဆါအဖိၪနီၪ,နထီးန့ဆ့ဧၪ.",
			"2": "<sup>2</sup> အမုအလၩလၧအဝ့ၫၥံၪမၩလၧၫ့ဎွ့ၩနီၪ, နဝံထၪ့နၬထၪ့ ဘၪမိၥ့ၪဧၪ. ဒဲအဆၧၫ့အထီလၧအဖိၪဆါဝ့ၫနၥ့ၪယၫ",
			"3": "<sup>3</sup> ဆ့ဧၪ.- အဝ့ၫၥံၪခိၬလၩ့ဖိၪဆါအဖိၪတၭး ခွံၬလၩ့ခွံၬ",
			"4": "<sup>4</sup> အဂူၭဆၫၥံၪနီၪလီၫ.- အဖိၪၥံၪဘီၪ့ထၪ့, ဒိၪထၪ့လၧ မံၩ့လၬကျၩတၭ, စဲၪ့ထၪ့ခွံၬနီၪဂဲၫထဲၩ့လၧၩ့အ့ၬ.",
			"5": "<sup>5</sup> ကၥ့ၪယီၩ့အမံၩ့နီၪ, မွဲပလၫဖျါလၩ့ဖီၩ့ဖျ့ၭဝ့ၫလဂၩ လဲၪး ကၥ့ၪယီၩ့အမံၩ့အဖျံၩနီၪ, မွဲပလၫကွဲၪလၩ့ခွံၬ",
			"6": "<sup>6</sup> ဝ့ၫလဂၩလဲၪ.- ယအီၪက့ၪၡါမုနၧၫ့ဖၫ လၧအဂံၪ့အ",
			"7": "<sup>7</sup> ဂးဒဲဆၧပျၩ့ဎီၫထိၫ့လၧအအီၪဝ့ၫအလးနီၪတၭး- ဒိၩ့ ဖိၪၥံၪၥူၭထၪ့ဝ့ၫနီၪ, အဝ့ၫဒၪအီၪက့ၪ လၧဆၧနးမံၩ့",
			"8": "<sup>8</sup> အ့ၬးၦနၫ့ဆၧအကိၭၡၭနီၪခိၭနၪဝ့ၫအ့ၬ.- အၪ့အဆၪ အလးနီၪ မွဲလၧခိၪလီၩ့လဖၪအလီၩ့တၭး အၪ့ဎၬက ယဲဆၧအၥံၫ့ၥံၪလမံၩ့လါလါကိၭအမံၩ့ဒ့ၭဆ့လီၫ.",
			"9": "<sup>9</sup> တၭချီဖၫမံၩ့နီၪမိမၩနဆၧ, ဒဲအီၪဝ့ၫလၧနတၩ့ခူၬအ",
			"10": "<sup>10</sup> နဲၩ့ထံၭနီၪဆ့ဧၪ.- မွဲနစၧၩ့ထၬချီဖၫမံၩ့လၧအဖျံၩလၧ ထဲၫကၠီၪ့ဖၧၩ့ဘၪမိၥ့ၪဧၪး အဝ့ၫဒၪမိထုၭခရါလၧဆၧ",
			"11": "<sup>11</sup> ဒၩဖၧၩ့ဖိၬထွ့ၫနခဲၫ့နီၪဆ့ဧၪ.- လၧအဂဲးအဘၭဆီၪ့အ ကၠီၩ့နီၪ,နမိဒိၭနဲၩ့နၥၭလၧအဖၧၩ့, ဒဲနမိအီၪက့ၪနဆၧ",
			"12": "<sup>12</sup> ဖံၭဆၧမၩလၧအဝ့ၫဒၪဆ့ဧၪ.- လၧအမိဂဲၫထဲၩ့ဆိၬန ဘုၪၥံၪဂူၫၥံၪ, ဒဲအီၪက့ၪကီၪ့ဝ့ၫလၧနခရဲးဖၧၩ့နီၪ, မွဲန",
			"13": "<sup>13</sup> နဲၩဆ့ဧၪ.- ထိၪကလအူၭအဒံၭနီၪဖူၬဝ့ၫလၧအၥၭထိၬ တၭ,အီၪလၧအဆီၪ့ၥံၪအဒံၭၥံၪနီၪ, မွဲနဖ့ၪလၫ့ဆ့ဧၪ.",
			"14": "<sup>14</sup> အဝ့ၫနီၪအီၪက့ၪလၩ့ထးအဒံၪလဖၪ လၧဂၪ့ခိၪအလီၩ့",
			"15": "<sup>15</sup> တၭ,ဒုၭလၧၩ့ထၪ့ဝ့ၫလၧဂၪ့ခိၪမုၬအကျၩး- တၭဆၧ အခၪ့မိမၩလၩ့ဘျ့ၭဝ့ၫ, ဒဲဆၧဖိၪဆၧဎါအမံၩ့မိယဲးထ့",
			"16": "<sup>16</sup> ဖၭဘၪနီၪ, ၥၭနၪ့ခွံၬဝ့ၫဒၪလီၫ.- အၥၭနီၩ့လၧအဖိၪ အဂးဘဲၫအလမွဲဘၪအဖိၪဒၪဝ့ၫအၥိၭနီၪ, ဒဲမၩဆၧမွဲ",
			"17": "<sup>17</sup> ဆၧပျီၩပျီၩ အၪ့ယိၪဆၧနးမံၩ့အ့ၬ.- အဂဲးဘဲၫယီၩ ယွၩလဖ့ၪလၫ့ဘၪဆၧကိၪ့ၥ့ၪကိၪ့ဘၪတၭ, ၥုၪ့ဖၭၥၭ",
			"18": "<sup>18</sup> ဖၭဖ့ၪလၫ့ဝ့ၫဒၪဆ့အ့ၬ.- ထီးအဆိၬထၪ့အၥၭလၧထၭ နီၪ,မွဲအမၩကြၩ့ထမးကၥ့ၪ ဒဲၦလၧအထူၬဝ့ၫလဂၩနီၪ ဆ့လီၫ.",
			"19": "<sup>19</sup> နဝ့ၫဒၪနဖ့ၪလၫ့ကၥ့ၪနီၪ အဂဲးအဘၭဧၪ, နဒုၭၥိၭ",
			"20": "<sup>20</sup> ထၪ့အခိၬဘီၩ့ လၧဆၧၥၭမဲၪဆ့ဧၪ.- နဒုၭဖုၫထၪ့ဝ့ၫ ဘဲၫထွ့အၥိၭနီၪဆ့ဧၪး အၥၪဖူၬထၪ့နီၪ, မွဲဆၧၥၭမဲၪ",
			"21": "<sup>21</sup> ဖၭဒိၪလီၫ.- အစူၪကွၭဆၧလၧဆၧပျၩ့ဖၧၩ့တၭ, ၥုၪ့ ထိၬၥၭထိၬ လၧအဂဲးအဘၭအကၠီၩ့နီၪး လ့ၩထၪ့ဆီး",
			"22": "<sup>22</sup> ဆၧစူၪဝဲၩၥံၪလီၫ.- မၩကြၩ့ထမးဆၧၥၭမဲၪတၭ, အၪ့ ယိၪဆၧနးမံၩ့အ့ၬး လၧနၭၥံၪဖၩ့ၥံၪအကၠီၩ့နီၪကၠၪက",
			"23": "<sup>23</sup> ဒၩထဲၩ့အၥၭဆ့အ့ၬ.- လၧၫ့ဖီၩ့ၥီၫထၪ့ လၧအဖၫ့ခိၪ",
			"24": "<sup>24</sup> နီၪ,ဖၩ့ၥံၪနၭၥံၪယုၩ့ယဲတၭး- လၧအၥၭဆီၪ့ထၪ့နီၪ ဒဲအၥၭဒူၩအကၠီၩ့ယုလၩ့ခွံၬဂၪ့ခိၪတၭ, ခွ့ၩၥီၫထၪ့အ",
			"25": "<sup>25</sup> ဘိၩ့ဘၭနီၪအီၪဒၪဆၧဘဲၫနီၪၥ့ၪဝါအ့ၬ.- ထီးခွ့ၩအ့ၪ ၥီၫထၪ့နီၪမွဲအစံၭ, အၫဟၩၬ ဒဲနၧၫ့ဘၪစိၩဆၧဒုၭၥုၭ လၧအယဲၩ့ၦၥုၭခိၪအလူၥီၫထၪ့, ဒဲဆၧဒုၭၥုၭအကိၭ ၡၭနီၪဆ့လီၫ.",
			"26": "<sup>26</sup> လံၬယၪအုၪနီၪယူၩထၪ့ဝ့ၫ ဒဲယၩ့ယါစိၩအဒံၭၥံၪလၧ",
			"27": "<sup>27</sup> မုခံၫ့လခီၫနီၪ, မွဲလၧနဆၧကိၪ့ၥ့ၪအကၠီၩ့ဆ့ဧၪ.- လံၬ ကျီၫ့ကျီၫ့ထၪ့ဝ့ၫ,ဒဲမၩအၥွံၫလၧဆၧထၪ့ထီၫအလးနီၪ,",
			"28": "<sup>28</sup> မွဲလၧနဆၧမၪလူၬအကၠီၩ့ဆ့ဧၪ.- အီၪဝ့ၫလၧလိးၥံၪလဲၫ့ ၥံၪအလီၩ့, ဒဲလၧလဲၫ့အၥွၫလီၩ့ ဒဲလၧအလးဂုးခၧၫ့ဆ့",
			"29": "<sup>29</sup> လီၫ.- လၧအလးနီၪဒၪဘၪအဆၪတၭ, အမ့ၬၥၪဒၪ",
			"30": "<sup>30</sup> ဘၪဝ့ၫယဲၩ့ယဲၩ့လ့ၬလီၫ.- အဖိၪလဖၪ အၪ့ဆူၭထၪ့ ဆၧၥွံၪတၭ, ထီးဒၪအလးလၧဆၧၥံၫအီၪဝ့ၫနီၪ အဝ့ၫ ဒၪအီၪဝ့ၫထီးနီၪလီၫ."
		},
		"40": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧၫ့ဒံၭစယိဘၭနီၪ, စံၭဝ့ၫဒၪး",
			"2": "<sup>2</sup> ၦလၧအဂဲးလိၬတ့ၭလိၬ လၧၦၥ့ၪဆၧလူၬလဂၩနီၪ, မိၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့အဝ့ၫဆ့ဧၪး ၦလၧအမိချဲၩ့ခွးလၧယွၩ နီၪ,မွဲအချဲၩ့ဆၧၫ့ဒၪဝ့ၫဆံၭ.",
			"3": "<sup>3</sup> ထီးနီၪလဖၧၫ့ စယိဘၭချဲၩ့ဆၧၫ့ ယဟိဝၩတၭ,",
			"4": "<sup>4</sup> စံၭဝ့ၫဒၪး- ယိခွါ,ယမွဲဆၧဘၪၥၭလိၪတၭ, ယမိစံၭ ဆၧၫ့နၧၩဘဲၫၥ့ၪလဲၪး ယအီၪက့ၪယစူၪလၧယနိၭအ",
			"5": "<sup>5</sup> လီၩ့လီၫ.- ယချဲၩ့ယူၭလဖၧၫ့တၭ, ယမိချဲၩ့ဆၧၫ့ အ့ၬးမွဲမၬ,နံၫဖၧၫ့လါနၫ့တၭ, ယမိချဲၩ့ဆၧၫ့ဒီၭနးမံၩ့ အ့ၬ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့ယဟိဝၩချဲၩ့ဆၧၫ့ စယိဘၭလၧလ",
			"7": "<sup>7</sup> ဖုၬအဖၧၩ့တၭ, စံၭဝ့ၫဒၪး- ဘိၩ့နဲၪ့ယီၩခဲးထူၬထၪ့န ယးဒံၩ့ဘဲၫၦခွၫအၥိၭး ယမိအၪ့စိၭ အၪ့စၪ့နၧၩတၭ, ဒုၭ",
			"8": "<sup>8</sup> နဲၪဖျီၪထၪ့ယၧၩဘီၪ.- နဝ့ၫဒၪနမိဒုၭကဲၪထၪ့ယဆၧ စ့ၩရၫ့လၧဆၧပျီၩပျီၩဆ့ဧၪး ဘဲၫနမိတီၩမိလီၩ့အၥိၭ",
			"9": "<sup>9</sup> တၭ,မွဲနမိအီၪက့ၪဆၧမၪလၧယလီၩ့ဆ့ဧၪ.- နစူၪဒူၪ အီၪဘဲၫယွၩအၥိၭနီၪဧၪး နဒုၭအီၪထၪ့လၫ့ဎွံၩ့အၥီၫ",
			"10": "<sup>10</sup> ဘဲၫအဝ့ၫဒၪအၥိၭနီၪဆ့ဧၪ.- မၩကယၧၩ့နၥၭလၧဆၧ စီၩ့ဆၧမၩ့ ဒဲဆၧၥူၭဆၧၥဲၪ့း ဒဲတဲၩ့ဝဲၩနၥၭ လၧဆၧ",
			"11": "<sup>11</sup> လၩဆၧဖၩ့ဒဲဆၧဎံၫဆၧလၩနီၪဆံၭ.- မၩပြံၩပၩန ဆၧၥၭထၪ့ဆီၪ့တၭ, ယိခွါ, ကယဲဆၧလၧအထၪ့ထီၫ",
			"12": "<sup>12</sup> လမံၩ့လါလါတၭ, ဒုၭဆၪ့လၩ့ဝ့ၫဆံၭ.- ယိခွါ,ကယဲ ဆၧလၧအထၪ့ထီၫလမံၩ့လါလါတၭ, ဒုၭလၩ့ဖၨၪအ",
			"13": "<sup>13</sup> ဝ့ၫးဒဲယဲးထဲးၦအၧၩ့ၥံၪလၧအလးဒၪဝ့ၫဆံၭ.- အီၪ က့ၪၥူၪခွံၬအဝ့ၫၥံၪ လၧဂၪ့ခိၪမုၬနီၪစီၪ့ဎးတၭး ဘီၪ့ ဘံၭထၬအဝ့ၫၥံၪအမ့ၬလၧဆၧခံၭအဖၧၩ့ဆံၭ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့ယမိစံၭထၪ့အၪ့အူၭနၧၩဆ့း အဂဲးဘဲၫ ယီၩနစူၪထွ့ၪဒၪနဝ့ၫ ထိးထဲၩ့တၩ့ထဲၩ့နနၫ့ဆါဒၪနဝ့ၫ",
			"15": "<sup>15</sup> ၥ့ၪလီၫ.- ယိခွါ,ချီဖၫထံလၧယမၩကဲၪထၪ့ဆ့, ဘဲၫ နၧၩအၥိၭး အဝ့ၫဒၪအၪ့နၪ့ ဘဲၫချီလဒီၪ့ အၥိၭလီၫ.",
			"16": "<sup>16</sup> ယိခွါ,အဂဲးအဘၭလၧအယးဒံၩ့ဖၧၩ့, ဒဲအဆၧဆီၪ့",
			"17": "<sup>17</sup> နီၪအီၪလၧအဂူၭဖိၫ့အထီၪ့ၥံၪအဖၧၩ့လီၫ.- ဖျ့ၪဖျိၪအ မ့ဘဲၫၥံၪ့ၡိၫအ့ရ့ၭအၥိၭး အကံၪဒူၪအထီၪ့ၥံၪဝံၬကဲၩ့",
			"18": "<sup>18</sup> ဎုၬအၥၭနီၪလီၫ.- အဎွံၪၥံၪမၩအၥၭ ဘဲၫထီးဝီၩအ ဘီၩ့အၥိၭနီၪး အဎွံၪလဖၪ ဘဲၫထၭဘီၩ့အၥိၭလီၫ.",
			"19": "<sup>19</sup> အဝ့ၫဒၪမွဲယွၩအဖၧၩ့ၥၭၥံၪအခိၪတၭး ၦလၧအတဲၩ့",
			"20": "<sup>20</sup> လၩ့ဝ့ၫနီၪဖ့ၪလၫ့ဝ့ၫအနၭလီၫ.- မွဲမၬ, ခိၪလီၩ့ၥံၪဖ့ၪ လၫ့အဆၪ, ဒဲကယဲဆၧဖိၪဆၧဎါထီးအလူၬလဖၪလိၬ",
			"21": "<sup>21</sup> ကွ့ၩထီးနီၪလီၫ.- မံၫနၩ့ဝ့ၫလၧၥံၪ့အလၩၡုၪဂ့ၩအဖၫ့",
			"22": "<sup>22</sup> လၬ,ဒဲလၧဖီးၥံၪလၧဆၧစီၪအကျၩလီၫ.- ၥံၪ့အလၩ ၡုၪဂ့ၩၥံၪချႃၬဘံၭအဝ့ၫ လၧအလၩၡုၪး ဒဲဖံစလီၫ့လ",
			"23": "<sup>23</sup> ဖၪလၧထံၫဖိၪချိၬနဲၩ့ထံၭ အီၪဝၬဖီၩ့အဝ့ၫဒၪလီၫ.- ယိ ခွါ,ထံၫဒိၪထၪ့ လါနၫ့နီၪၥၭမဲၪဝ့ၫအ့ၬး ထံၫယီၫဒၫ့နီၪ ဂဲၫယွၩလၩ့ဆီၪ့ဆီၪ့လ့ၬ ဘၪလါနၫ့အနိၭတၭ, အီၪဒၪ",
			"24": "<sup>24</sup> ဆၧလီၫ.- လၧအမ့ၬယၫနီၪၦၡၩမၩန့ဝ့ၫဘၪမိၥ့ၪဧၪး ထီးၦအ့ၪဖီၪ့ထၬဝ့ၫလၧဖျံၩခွၩ့လဖၪတၭ, မွဲပလၫထူ ဖိးအနၫနီၪမိၥ့ၪလဂၩလဲၪ."
		},
		"41": {
			"1": "<sup>1</sup> နထုၭထၪ့ၥမၪလၧခွ့ၫ, ဒဲအဖျ့ၩလၧဖျံၩလဘီၩ့လၧန",
			"2": "<sup>2</sup> ဆဲၩလၩ့နီၪဘၪမိၥ့ၪဆ့ဧၪ.- နဒုၭနုၬဖျံၩလဘီၩ့လၧနၫ ဖၧၩ့နီၪ,ဒဲနဖျံၭဖိးအခၪလၬဎွံၪ လၧနိၪကွၭဘၪမိၥ့ၪဧၪ.",
			"3": "<sup>3</sup> မွဲအမိအၪ့ကံၩ့အၪ့ယၫနၧၩအၪဖၧၫ့ဧၪး မိချဲၩ့လၧနၧၩ",
			"4": "<sup>4</sup> မုၬမုၬဆ့ဧၪ.- မွဲအမိအုၩ့လၩ့ဆၧလၧနၧၩဧၪး နမိမၩန့",
			"5": "<sup>5</sup> အဝ့ၫနီၪလၧနဎီးနၡၩအဂး အဆိၩအကၠၪဆ့ဧၪ.- နမိ လိၬကွ့ၩလၧအဝ့ၫနီၪ, ဘဲၫလၧထိၪလဘံၪ့အၥိၭ ဒဲနမိ",
			"6": "<sup>6</sup> စၧၩ့ထၬဝ့ၫလၧနဖိၪၥၪမုၪၥံၪအဂးဆ့ဧၪ.- ၦထၧၫ့ထံၩ ထၧၫ့ၥိၭမိမၩန့ဝ့ၫ လၧဆၧအၪ့အဂးဧၪး မိအၪ့နၩ့ဖၭ",
			"7": "<sup>7</sup> ဝ့ၫလၧၦဖနံၬဖိၪ အကျၩဆ့ဧၪ.- နမိမၩဎွ့ၩအဖံၭလၧ ဖျဲၩ့ၥံၪ,ဒဲအခိၪဎွံၪ လၧဖၩ့ဆ့ၭယၪၥံၪ ဘၪမိၥ့ၪဧၪ.",
			"8": "<sup>8</sup> အီၪက့ၪလၩ့နစူၪလၧအလီၩ့ဘီၪၬ တၭဆၧဒုၭၥုၭနီၪန မိဆီၫ့မီၪ့လၧၩ့အ့ၬ.",
			"9": "<sup>9</sup> ယိခွါ,ၦယိလါလၧအမိန့ဘၪအဝ့ၫနီၪပျီၩပျီၩတၭ,",
			"10": "<sup>10</sup> ၦမိဘၪဆၧအၪ့ယိၪဝ့ၫလၧအမ့ၬယၫမွဲအ့ၬဧၪ.- ၦအၥၭ ဒူၩလၧအမိထိၪဂဲၩဝ့ၫနီၪအီၪနးဂၩအ့ၬး အခိးမွဲၦလၧ အမိဆၧၫ့ထုၪ့လၧယမ့ၬယၫနီၪ, မွဲပလၫလဂၩလဲၪ.",
			"11": "<sup>11</sup> ၦလၧအဖ့ၪလၫ့ဆိၫယၧၩ ဘဲၫၥိၭယမိဘၪဖ့ၪထဲၩ့အဝ့ၫ ဒၪနီၪ,မွဲပလၫလဂၩလဲၪး ကယဲဆၧလမံၩ့လါလါလၧ မူၭခိၪအဖၫ့လၬထီးအလူၬနီၪ, မွဲယဆၧလီၫ.",
			"12": "<sup>12</sup> လၧအဝ့ၫဒၪအခံးအဂၩ့အဂဲးအကၠီၪ့ ဒဲအစီၩ့အမၩ့",
			"13": "<sup>13</sup> မွဲဂ့ၩ, အဎံၫအလၩမွဲဂ့ၩ,ယအီၪလၩ့မါပံၭအ့ၬ.- မွဲပ လၫဘဲၪ့လၩ့ခွံၬအကီၩ့အၥိၭ မိၥ့ၪလဂၩလဲၪး မွဲပလၫ",
			"14": "<sup>14</sup> လ့ၩဘူၭလၧအၥွၫနံၫဂဲးနီၪမိၥ့ၪလဂၩလဲၪ.- မွဲပလၫ အၩ့ထၪ့အဝ့ၫဒၪအနိၭ အတရၫ့မိၥ့ၪလဂၩလဲၪး အ",
			"15": "<sup>15</sup> ၥွၫအဝၩ့ၥံၪမွဲဆၧၥၭမဲၪအလးဖၭဒိၪလီၫ.- အဘံၪ့နီၩ့ လဖၪမွဲဆၧအီၪက့ၪထၪ့ထီၫအၥၭနီၪ, ဘုၭထၬလိၬအ",
			"16": "<sup>16</sup> ၥၭဘဲၫဆၧစဲၩနဲၪ့ထၬဝ့ၫအၥိၭလီၫ.- အဝ့ၫၥံၪလဘံၪ့ ဘၪလဘံၪ့ဘုၭထၬလိၬအၥၭတၭ, လံၩနုၬလၧအဘိၩ့",
			"17": "<sup>17</sup> ဆၧၩ့နီၪဖိးနးဆံၭအ့ၬ.- လဘံၪ့ဒဲလဘံၪ့ဘုၭထၬလိၬ အၥၭဆုၬဆုၬတၭ, ဘုၭထၬလိၬအၥၭခၧၫ့ထီးဆၧထုၭ",
			"18": "<sup>18</sup> ဖၭဝ့ၫၥ့ၪအ့ၬ.- လၧအကဆ့ၪနီၪဆၧအဖၩ့ဖၩ့ထၪ့ဝ့ၫ တၭ,အမ့ၬၥၪၥံၪမၩအၥၭဘဲၫ မုဝီၩအမ့ၬဖံၭအၥိၭနီၪ",
			"19": "<sup>19</sup> လီၫ.- မ့ၪလၪၥံၪစဲၪ့ထၪ့ခွံၬလၧအနိၭဖၧၩ့, ဒဲမ့ၪဖီၫၥံၪ",
			"20": "<sup>20</sup> စဲၪ့ထၪ့ခွံၬဆ့လီၫ.- မ့ၪခူၪစဲၪ့ထၪ့ခွံၬလၧအနၫဖၧၩ့နီၪ,",
			"21": "<sup>21</sup> ဘဲၫဆၧလၬထၪ့လၧဖၧၩ့ဖၧၩ့အၥိၭနီၪလီၫ.- အၥၪနီၪ မၩခဲၩထၪ့မ့ၪအၧၩ့ဖၭၥံၪတၭ, မ့ၪလၪစဲၪ့ထၪ့လၧအ",
			"22": "<sup>22</sup> နိၭဖၧၩ့လီၫ.- အခိၬနီၪအီၪလၧဆၧဂဲးဆၧဘၭတၭ,",
			"23": "<sup>23</sup> ဆၧၥၭမဲၪနီၪဂဲထုၪ့လံလၧအမ့ၬယၫလီၫ.- အယၪအ ဘံၪ့ၥံၪဘုၭထၬလိၬအၥၭနီၪ, အီၪဂုးခၧၫ့လၧအလီၩ့",
			"24": "<sup>24</sup> တၭဆၧဂဲၩဝ့ၫၥ့ၪအ့ၬ.- အၥၭအီၪဂုးခၧၫ့ ဘဲၫလိးအ ၥိၭ,မွဲမၬ,နီၩ့ဘဲၫ ဆုၪ့ဂူၬလိး အဖၫ့လၬလဖျိၪ့လီၫ.",
			"25": "<sup>25</sup> ထီးအ့ၪထိၪဂဲထုၪ့အၥၭတၭ, ၦဆီၪ့ၥံၪၥၭမဲၪထၪ့နီၪး လၧဆၧၥၭမဲၪနီၪအကၠီၩ့တၭ, အၥၭထုၬထုၩဝ့ၫဒၪ",
			"26": "<sup>26</sup> လီၫ.- ၦၡၩအ့ၪဆ့ၭလါနၫ့လၧနၭတၭ,နုၬအ့ၬး ဒဲဖၩ့",
			"27": "<sup>27</sup> ၥံၪဒဲဖျါၥံၪ, ဒီၩၥံၪ, နုၬဆ့အ့ၬ.- အဝ့ၫအီၪက့ၪထၭဘဲၫ လီခၫ့အၥိၭ, ဒဲထီးဘၩ့ဘဲၫၥံၪ့အအုၪအၥိၭနီၪလီၫ.",
			"28": "<sup>28</sup> ဖျါၥံၪဒုၭစဲၪ့ဝ့ၫၥ့ၪအ့ၬး ဖလီၥၪလဖၪမၩအၥၭလၧအ",
			"29": "<sup>29</sup> မ့ၬယၫနီၪဘဲၫဖ့ၫအၥိၭလီၫ.- နိၪထးမၩအၥၭဘဲၫလီ",
			"30": "<sup>30</sup> ခၫ့အၥိၭတၭး နံဘၪဖၩ့လၧဆၧမၩဂဲၩဝ့ၫနီၪလီၫ.- လၧ အဖၫ့လၬနီၪအီၪလၧဆၧစူၩၥံၪတၭ, ဒၩလၩ့ဆၧစူၩနီၪ",
			"31": "<sup>31</sup> လၧကဖံၬအဖၫ့ခိၪလီၫ.- ဆၧယိၬနီၪ အဝ့ၫဒၪမၩလၬ ထၪ့ဝ့ၫဘဲၫဖၧၩ့လၬထၪ့ဝ့ၫအၥိၭတၭ, ဒုၭကဲၪထၪ့မၫ",
			"32": "<sup>32</sup> ဆမံၭနီၪဘဲၫဖၧၩ့အီၪလၧၥံၪဂုၪဆၧအၥိၭနီၪလီၫ.- လၧ အလးခဲၫ့မၩဖၧၩ့ၥၭယုၩ့ယဲဝ့ၫတၭ, ၦၡၩဆီၫ့မီၪ့လၧ",
			"33": "<sup>33</sup> ဆၧယိၬနီၪခိၪဘွၩထၪ့ဝ့ၫဒၪလီၫ.- လၧဂၪ့ခိၪချိၫ့ဆၧ မၩအၥၭဘဲၫအဝ့ၫဒၪ အီၪနးစီၪ့အ့ၬး ဆၧမၩကဲၪထၪ့",
			"34": "<sup>34</sup> အဝ့ၫလၧအဆၧၥၭမဲၪအီၪနးမံၩ့အ့ၬ.- ကယဲဆၧထၪ့ ထီၫလမံၩ့လါလါနီၪ, အဝ့ၫဒၪယိလၩ့ဝ့ၫတၭး ကဲၪစ ဎွၩလၧဆၧအီၪက့ၪထၪ့ထီၫအၥၭအဖိၪၥံၪ ထီးအလူၬ အဖၫ့ခိၪလီၫ."
		},
		"42": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့စယိဘၭချဲၩ့ဆၧၫ့ယဟိဝၩတၭ, စံၭ ဝ့ၫဒၪး",
			"2": "<sup>2</sup> ယၥ့ၪယၫလၧနမၩဆၧၥ့ၪထီးအလူၬတၭး နကိၪ့ထၪ့",
			"3": "<sup>3</sup> ဆၧလမံၩ့လါလါနီၪဆၧပဒၩ့ထၬၥ့ၪနးစီၪ့အ့ၬ.- ၦလၧ အဆၧချဲၩ့လအီၪဘၪ လၧဆၧၥ့ၪယၫ မၩခံၭလၩ့ဆၧ ဒုၭကိၪ့နီၪ, မွဲပလၫလဂၩလဲၪး မွဲမၬ, ယချဲၩ့ထၪ့ဆၧ လၧယနၪလၥ့ၪဘၪနီၪ, ဆၧလၩ့လၭၥံၪအၪလၨၪလၧ",
			"4": "<sup>4</sup> ယဂးလၧယလၥ့ၪယၫဘၪနီၪလီၫ.- ဘိၩ့နဲၪ့ယီၩခိၭနၪ လါဘီၪ, ယမိချဲၩ့ထၪ့ဆၧတၭး ယမိအၪ့ကံၩ့အၪ့ယၫ",
			"5": "<sup>5</sup> နၧၩတၭ, ဒုၭနဲၪဖျီၪထၪ့ယၧၩဆံၭ.- ယနါဂၧၫ့ယူၭန ဂဲးနကၠီၪ့လၧယနါတၭး အ့ၪမွဲဘိၩ့နဲၪ့ယီၩယမ့ၬၥၪဒၪ",
			"6": "<sup>6</sup> ဘၪယူၭနၧၩယူၭး- မၩအၥၭဘဲၫနီၪတၭ, ယၥၭလိၪ လၩ့ယၥၭ, ဒဲနီၫ့ယါလၩ့ထဲၩ့ယၥၭလၧဂၪ့ခိၪမုၬဒဲလၧ ဖံၫ့ချၪအကျၩလီၫ.",
			"7": "<sup>7</sup> လၧယဟိဝၩချဲၩ့ဆၧလဖၪနီၪ လၧစယိဘၭအလး ခဲၫ့တၭ, ယဟိဝၩစံၭၦတံမၫ့ဖိၪစအံၫလဲဖၭလဂၩ,ယ ၥၭခိထၪ့ထၫ့ဒုၪဒၩနၧၩ, ဒဲနထံၩနၥိၭနံၫဂၩၥံၪး အဂဲး ဘဲၫယီၩနၥံၪချဲၩ့ဆၧအတီၩအလီၩ့ လၧယဂဲးယကၠီၪ့",
			"8": "<sup>8</sup> ဘဲၫယခ့ၫယၡၩစယိဘၭအၥိၭနီၪမွဲအ့ၬ.- အခိးမွဲဘိၩ့ နဲၪ့ယီၩ မၩန့နၥံၪဝ့ၫချီဖၫနွ့ၫဒုၩ, ဒဲၥိၪဖၫနွ့ၫဒုၩတၭ, လ့ၩလၧယခ့ၫယၡၩစယိဘၭအအီၪနီၪ, ဒဲလုထၪ့ဆၧ လုမ့ၪလၧနၥံၪအဂးဆံၭ. တၭယခ့ၫယၡၩစယိဘၭမိ ဘၩဆိၪဖၪန့နၥံၪအဂးလီၫ. အ့ၪမွဲအဝ့ၫဒၪလဂၩယ မိထိးဆၧၫ့, ဘဲၫၥိၭယထီးဖ့ၪဆၧၫ့နၥံၪပျီၩပျီၩအီၪဝ့ၫ အၥိၭနီၪလဂ့ၩး အဂဲးဘဲၫယီၩနၥံၪချဲၩ့ဆၧအတီၩအ လီၩ့လၧယဂဲးယကၠီၪ့ ဘဲၫယခ့ၫယၡၩစယိဘၭအၥိၭ နီၪမွဲအ့ၬ.",
			"9": "<sup>9</sup> ထီးနီၪလဖၧၫ့ၦတံမၫဖိၪစအံၫလဲဖၭ, ဒဲၦၡုအၫဖိၪ စဘံလဒၭ, ဒဲၦနၫအမၭနီၪစဇိဖၫၥံၪလ့ၩမၩဘဲၫယဟိ ဝၩလီၩဘၪဝ့ၫအၥိၭတၭ, ယဟိဝၩထိးဆၧၫ့စယိဘၭ",
			"10": "<sup>10</sup> နီၪလီၫ.- ထီးစယိဘၭဘၩဆိၪဖၪန့အထံၩအၥိၭအဂး အဘိၩ့ဘၭနီၪ, ယဟိဝၩကၠၪထဲၩ့အဆၧကဲၪဎီးနီၪတၭ, ယဟိဝၩဖ့ၪလၫ့စယိဘၭအၪနဲၪ့ အလးထီးအလူၬနံၫ",
			"11": "<sup>11</sup> စၩနီၪလီၫ.- ထီးနီၪလဖၧၫ့အထၧၫ့ဖုဝဲခွၫထီးအလူၬ, ဒဲအထၧၫ့ဖုဝဲမုၪထီးအလူၬ, ဒဲကယဲၦလၧအၥ့ၪယၫဝဲၩ အဝ့ၫနီၪကိၭဂၩဒ့ၭ ဂဲၫလၧအအီၪတၭး အဝ့ၫၥံၪအၪ့ ဆၧအီၩဆၧလၧအၥိၭလၧအဂံၪ့ဖၧၩ့နီၪ, ဒဲၥုၪ့အုၭၥၭ အုၭလၧအၥိၭတၭ, လၧဆၧအၧၩ့လၧယဟိဝၩဒုၭဘၪ အလီၩ့ထီးအလူၬအကၠီၩ့နီၪ, အဝ့ၫၥံၪချဲၩ့မုၬထၪ့အၥၭ ဆ့လီၫ. အဝ့ၫၥံၪလဂၩဒဲလဂၩဖ့ၪလၫ့အဝ့ၫလၧကစံ တၫလဘံၪ့, ဒဲစူၪၥံၭထီၫ့လဘီၩ့ကိၭဂၩဒ့ၭဆုၬဆုၬဆ့ လီၫ.",
			"12": "<sup>12</sup> တၭယဟိဝၩဆိၪဂ့ၩစယိဘၭအထုၬနီၪအၪနဲၪ့ဒံၭ အခၪ့ထံၭလီၫ. အဂဲးဘဲၫယီၩ အၥိၪၥံၪဒဲဘ့ၪၥံၪအီၪ ဝ့ၫလလၬလံထီၫ့လဖၪ, ဒဲကလအူၭလဖၪဎူၫထီၫ့,ဒဲချီ",
			"13": "<sup>13</sup> ဖၫအခိၪလထီၫ့, ဒဲကၥ့ၪယီၩ့မိလထီၫ့နီၪလီၫ.- တၭအ",
			"14": "<sup>14</sup> ဖိၪခွၫလဖၪအီၪနွ့ၫဂၩ, ဒဲအဖိၪမုၪၥၧၫ့ဂၩဆ့လီၫ.- အ အခၪ့ထံၭလဂၩနီၪဖျိၬဝ့ၫအမံၩ့နးယမဲမၫ, ဒဲနံၫဂၩလဂၩ အမံၩ့ နးကဇံအၫ, ဒဲၥၧၫ့ဂၩလဂၩအမံၩ့ နးက့ၭရံၫ့ဟၭ",
			"15": "<sup>15</sup> ပၧၭလီၫ.- လၧထံၫၥံၪခးၥံၪထီးအလူၬအဖၧၩ့နီၪၦမုၪ အခံးအဂၩ့ဎံၫလၩ ဘဲၫစယိဘၭအဖိၪမုၪအၥိၭနီၪအီၪ ဝ့ၫနးစီၪ့အ့ၬ. အဝ့ၫၥံၪအဖါဖ့ၪလၫ့အန့ၥၫအလး,လၧ အဝ့ၫၥံၪအထၧၫ့ဖုဝဲခွၫအကျၩနီၪလီၫ.",
			"16": "<sup>16</sup> တၭလၧဆၧနီၪအလးခဲၫ့ စယိဘၭ မၧၫ့ဝ့ၫအနံၪ့လ ယၩလံဆံၫတၭးဒဲဒၪဘၪအဖိၪခွၫၥံၪ, ဒဲအဖိၪခွၫၥံၪအ",
			"17": "<sup>17</sup> ဖိၪခွၫလဖၪ, ထီၩ့လၩ့လံဆိၩၥံၪလီၫ.- တၭစယိဘၭ ၥံၫဝ့ၫ,ၥၭၡါက့ၭယူၭဒဲလၧၫ့ဎွ့ၩလၧမုနံၩလဖၪဆ့လီၫ."
		}
	}
};
module.exports = book;